ks();\n  });\n\n  test(\"Table Renders\", async () => {\n    axiosMock\n      .onGet(\"/api/rosterstudents/course/1\")\n      .reply(200, rosterStudentFixtures.threeStudents);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"EnrollmentTabComponent\n          courseId={1}\n          testIdPrefix={testId}\n          currentUser={currentUserFixtures.instructorUser}\n        />\n      <"+"/QueryClientProvider>,\n    );\n\n    const rsTestId = \"InstructorCourseShowPage-RosterStudentTable\";\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-0-col-id`),\n      ).toHaveTextContent(rosterStudentFixtures.threeStudents[0].id);\n    });\n\n    const studentFirstName0 = screen.getByText(\n      rosterStudentFixtures.threeStudents[0].firstName,\n    );\n    expect(studentFirstName0).toBeInTheDocument();\n\n    const studentId0 = screen.getByTestId(\n      `${rsTestId}-cell-row-0-col-studentId`,\n    );\n    expect(studentId0).toHaveTextContent(\n      rosterStudentFixtures.threeStudents[0].studentId,\n    );\n  });\n  test(\"Table Renders with no students\", async () => {\n    axiosMock.onGet(\"/api/rosterstudents/course/7\").reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"EnrollmentTabComponent\n          courseId={7}\n          testIdPrefix={testId}\n          currentUser={currentUserFixtures.instructorUser}\n        />\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\n          \"InstructorCourseShowPage-RosterStudentTable-header-studentId\",\n        ),\n      ).toBeInTheDocument();\n    });\n\n    expect(\n      screen.queryByTestId(`${testId}-cell-row-0-col-id`),\n    ).not.toBeInTheDocument();\n\n    const expectedHeaders = [\"Student Id\", \"First Name\", \"Last Name\", \"Email\"];\n    const expectedFields = [\"studentId\", \"firstName\", \"lastName\", \"email\"];\n\n    // assert\n    expectedHeaders.forEach((headerText, index) => {\n      const header = screen.getByTestId(\n        `InstructorCourseShowPage-RosterStudentTable-header-${expectedFields[index]}`,\n      );\n      expect(header).toHaveTextContent(headerText);\n    });\n\n    expectedFields.forEach((field) => {\n      const fieldElement = screen.queryByTestId(\n        `${testId}-cell-row-0-col-${field}`,\n      );\n      expect(fieldElement).not.toBeInTheDocument();\n    });\n    expect(screen.queryByTestId(`${testId}-csv-modal`)).not.toBeInTheDocument();\n    expect(\n      screen.queryByTestId(`${testId}-post-modal`),\n    ).not.toBeInTheDocument();\n  });\n\n  test(\"Successfully makes a call to the backend on submit and clears search filter\", async () => {\n    const queryClientSpecific = new QueryClient({\n      defaultOptions: {\n        queries: {\n          retry: false,\n          staleTime: Infinity,\n        },\n      },\n    });\n    const file = new File([\"there\"], \"egrades.csv\", { type: \"text/csv\" });\n\n    axiosMock\n      .onGet(\"/api/rosterstudents/course/7\")\n      .reply(200, rosterStudentFixtures.threeStudents);\n\n    axiosMock.onPost(\"/api/rosterstudents/upload/csv\").reply(200);\n\n    const user = userEvent.setup();\n    render(\n      <"+"QueryClientProvider client={queryClientSpecific}>\n        <"+"ArbitraryTestQueryComponent />\n        <"+"EnrollmentTabComponent\n          courseId={7}\n          testIdPrefix={testId}\n          currentUser={currentUserFixtures.instructorUser}\n        />\n      <"+"/QueryClientProvider>,\n    );\n    const openModal = await screen.findByTestId(`${testId}-csv-button`);\n\n    const arbitraryUpdateCount = queryClientSpecific.getQueryState([\n      \"arbitraryQuery\",\n    ]).dataUpdateCount;\n\n    const updateCountStudent = queryClientSpecific.getQueryState([\n      \"/api/rosterstudents/course/7\",\n    ]).dataUpdateCount;\n\n    // Get the search input and set a search term\n    const searchInput = screen.getByTestId(\"InstructorCourseShowPage-search\");\n    fireEvent.change(searchInput, { target: { value: \"test search\" } });\n    expect(searchInput.value).toBe(\"test search\");\n\n    fireEvent.click(openModal);\n    expect(screen.getByTestId(`${testId}-csv-modal`)).toHaveClass(\n      \"modal-dialog modal-dialog-centered\",\n    );\n\n    const upload = await screen.findByTestId(\n      \"RosterStudentCSVUploadForm-upload\",\n    );\n    const submitButton = screen.getByTestId(\n      \"RosterStudentCSVUploadForm-submit\",\n    );\n    await user.upload(upload, file);\n    fireEvent.click(submitButton);\n    await waitFor(() => {\n      expect(axiosMock.history.post[0].params).toEqual({\n        courseId: 7,\n      });\n    });\n    expect(axiosMock.history.post[0].data.get(\"file\")).toEqual(file);\n    expect(toast).toBeCalledWith(\"Roster successfully updated.\");\n    expect(\n      queryClientSpecific.getQueryState([\"arbitraryQuery\"]).dataUpdateCount,\n    ).toBe(arbitraryUpdateCount);\n    expect(\n      queryClientSpecific.getQueryState([\"/api/rosterstudents/course/7\"])\n        .dataUpdateCount,\n    ).toEqual(updateCountStudent + 1);\n\n    // Verify that the search filter is cleared\n    await waitFor(() => {\n      expect(searchInput.value).toBe(\"\");\n    });\n    expect(screen.queryByTestId(`${testId}-csv-modal`)).not.toBeInTheDocument();\n  });\n\n  test(\"CsvForm error returns correctly\", async () => {\n    const file = new File([\"there\"], \"egrades.csv\", { type: \"text/csv\" });\n\n    axiosMock\n      .onGet(\"/api/rosterstudents/course/7\")\n      .reply(200, rosterStudentFixtures.threeStudents);\n\n    axiosMock\n      .onPost(\"/api/rosterstudents/upload/csv\")\n      .reply(409, loadResultFixtures.failed);\n\n    const user = userEvent.setup();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"EnrollmentTabComponent\n          courseId={7}\n          testIdPrefix={testId}\n          currentUser={currentUserFixtures.instructorUser}\n        />\n      <"+"/QueryClientProvider>,\n    );\n    const openModal = await screen.findByTestId(`${testId}-csv-button`);\n\n    // Get the search input and set a search term\n    const searchInput = screen.getByTestId(\"InstructorCourseShowPage-search\");\n    fireEvent.change(searchInput, { target: { value: \"test search\" } });\n    expect(searchInput.value).toBe(\"test search\");\n\n    fireEvent.click(openModal);\n    expect(screen.getByTestId(`${testId}-csv-modal`)).toHaveClass(\n      \"modal-dialog modal-dialog-centered\",\n    );\n\n    const upload = await screen.findByTestId(\n      \"RosterStudentCSVUploadForm-upload\",\n    );\n    const submitButton = screen.getByTestId(\n      \"RosterStudentCSVUploadForm-submit\",\n    );\n    await user.upload(upload, file);\n    fireEvent.click(submitButton);\n    await waitFor(() =>\n      expect(toast.error).toHaveBeenCalledWith(\n        `Error uploading CSV: ${JSON.stringify(loadResultFixtures.failed, null, 2)}`,\n      ),\n    );\n  });\n\n  test(\"RosterStudentForm submit works and clears search filter\", async () => {\n    const queryClientSpecific = new QueryClient({\n      defaultOptions: {\n        queries: {\n          retry: false,\n          staleTime: Infinity,\n        },\n      },\n    });\n    axiosMock\n      .onGet(\"/api/rosterstudents/course/7\")\n      .reply(200, rosterStudentFixtures.threeStudents);\n\n    axiosMock.onPost(\"/api/rosterstudents/post\").reply(200);\n    render(\n      <"+"QueryClientProvider client={queryClientSpecific}>\n        <"+"ArbitraryTestQueryComponent />\n        <"+"EnrollmentTabComponent\n          courseId={7}\n          testIdPrefix={testId}\n          currentUser={currentUserFixtures.instructorUser}\n        />\n      <"+"/QueryClientProvider>,\n    );\n\n    //Great time to check initial values\n    expect(\n      queryClientSpecific.getQueryData([\"/api/rosterstudents/course/7\"]),\n    ).toStrictEqual([]);\n\n    const openModal = await screen.findByTestId(`${testId}-post-button`);\n    const arbitraryUpdateCount = queryClientSpecific.getQueryState([\n      \"arbitraryQuery\",\n    ]).dataUpdateCount;\n    const updateCountStudent = queryClientSpecific.getQueryState([\n      \"/api/rosterstudents/course/7\",\n    ]).dataUpdateCount;\n\n    fireEvent.click(openModal);\n    await screen.findByLabelText(\"Student Id\");\n    expect(screen.getByTestId(`${testId}-post-modal`)).toHaveClass(\n      \"modal-dialog modal-dialog-centered\",\n    );\n\n    // Get the search input and set a search term\n    const searchInput = screen.getByTestId(\"InstructorCourseShowPage-search\");\n    fireEvent.change(searchInput, { target: { value: \"test search\" } });\n    expect(searchInput.value).toBe(\"test search\");\n\n    expect(screen.queryByText(\"Cancel\")).not.toBeInTheDocument();\n    fireEvent.change(screen.getByLabelText(\"Student Id\"), {\n      target: { value: \"123456789\" },\n    });\n    fireEvent.change(screen.getByLabelText(\"First Name\"), {\n      target: { value: \"Chris\" },\n    });\n    fireEvent.change(screen.getByLabelText(\"Last Name\"), {\n      target: { value: \"Gaucho\" },\n    });\n    fireEvent.change(screen.getByLabelText(\"Email\"), {\n      target: { value: \"cgaucho@ucsb.edu\" },\n    });\n    fireEvent.click(screen.getByTestId(\"RosterStudentForm-submit\"));\n    await waitFor(() => expect(axiosMock.history.post.length).toEqual(1));\n    expect(axiosMock.history.post[0].params).toEqual({\n      courseId: 7,\n      studentId: \"123456789\",\n      firstName: \"Chris\",\n      lastName: \"Gaucho\",\n      email: \"cgaucho@ucsb.edu\",\n    });\n    await waitFor(() => expect(toast).toBeCalled());\n    expect(toast).toBeCalledWith(\"Roster successfully updated.\");\n    expect(\n      queryClientSpecific.getQueryState([\"arbitraryQuery\"]).dataUpdateCount,\n    ).toBe(arbitraryUpdateCount);\n    expect(\n      queryClientSpecific.getQueryState([\"/api/rosterstudents/course/7\"])\n        .dataUpdateCount,\n    ).toEqual(updateCountStudent + 1);\n\n    // Verify that the search filter is cleared\n    await waitFor(() => {\n      expect(searchInput.value).toBe(\"\");\n    });\n    expect(\n      screen.queryByTestId(`${testId}-post-modal`),\n    ).not.toBeInTheDocument();\n  });\n\n  test(\"RosterStudentForm works on error\", async () => {\n    const queryClientSpecific = new QueryClient({\n      defaultOptions: {\n        queries: {\n          retry: false,\n          staleTime: Infinity,\n        },\n      },\n    });\n    const postResponse = {\n      insertStatus: \"REJECTED\",\n      rosterStudent: rosterStudentFixtures.oneStudent[0],\n    };\n\n    axiosMock\n      .onGet(\"/api/rosterstudents/course/7\")\n      .reply(200, rosterStudentFixtures.threeStudents);\n\n    axiosMock.onPost(\"/api/rosterstudents/post\").reply(409, postResponse);\n    render(\n      <"+"QueryClientProvider client={queryClientSpecific}>\n        <"+"ArbitraryTestQueryComponent />\n        <"+"EnrollmentTabComponent\n          courseId={7}\n          testIdPrefix={testId}\n          currentUser={currentUserFixtures.instructorUser}\n        />\n      <"+"/QueryClientProvider>,\n    );\n\n    //Great time to check initial values\n    expect(\n      queryClientSpecific.getQueryData([\"/api/rosterstudents/course/7\"]),\n    ).toStrictEqual([]);\n\n    const openModal = await screen.findByTestId(`${testId}-post-button`);\n\n    fireEvent.click(openModal);\n    await screen.findByLabelText(\"Student Id\");\n    expect(screen.getByTestId(`${testId}-post-modal`)).toHaveClass(\n      \"modal-dialog modal-dialog-centered\",\n    );\n\n    // Get the search input and set a search term\n    const searchInput = screen.getByTestId(\"InstructorCourseShowPage-search\");\n    fireEvent.change(searchInput, { target: { value: \"test search\" } });\n    expect(searchInput.value).toBe(\"test search\");\n\n    expect(screen.queryByText(\"Cancel\")).not.toBeInTheDocument();\n    fireEvent.change(screen.getByLabelText(\"Student Id\"), {\n      target: { value: \"1234567\" },\n    });\n    fireEvent.change(screen.getByLabelText(\"First Name\"), {\n      target: { value: \"Bob\" },\n    });\n    fireEvent.change(screen.getByLabelText(\"Last Name\"), {\n      target: { value: \"Smith\" },\n    });\n    fireEvent.change(screen.getByLabelText(\"Email\"), {\n      target: { value: \"bobsmith@ucsb.edu\" },\n    });\n    fireEvent.click(screen.getByTestId(\"RosterStudentForm-submit\"));\n    screen.debug(null, 1000000);\n    await waitFor(() => expect(axiosMock.history.post.length).toEqual(1));\n    await waitFor(() =>\n      expect(toast.error).toBeCalledWith(\n        `Error adding student: ${JSON.stringify(postResponse, null, 2)}`,\n      ),\n    );\n  });\n\n  test(\"Modals close on close buttons (respectively), download works\", async () => {\n    const download = vi.fn();\n    window.open = (a, b) => download(a, b);\n    axiosMock\n      .onGet(\"/api/rosterstudents/course/7\")\n      .reply(200, rosterStudentFixtures.threeStudents);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"ArbitraryTestQueryComponent />\n        <"+"EnrollmentTabComponent\n          courseId={7}\n          testIdPrefix={testId}\n          currentUser={currentUserFixtures.instructorUser}\n        />\n      <"+"/QueryClientProvider>,\n    );\n\n    const openModalPost = await screen.findByTestId(`${testId}-post-button`);\n    fireEvent.click(openModalPost);\n    let closeButton = await screen.findByRole(\"button\", { name: \"Close\" });\n    fireEvent.click(closeButton);\n    await waitFor(() =>\n      expect(\n        screen.queryByTestId(`${testId}-post-modal`),\n      ).not.toBeInTheDocument(),\n    );\n    const openModalCsv = await screen.findByTestId(`${testId}-csv-button`);\n    fireEvent.click(openModalCsv);\n    closeButton = await screen.findByRole(\"button\", { name: \"Close\" });\n    fireEvent.click(closeButton);\n    await waitFor(() =>\n      expect(\n        screen.queryByTestId(`${testId}-csv-modal`),\n      ).not.toBeInTheDocument(),\n    );\n    fireEvent.click(screen.getByText(\"Download Student CSV\"));\n    await waitFor(() => expect(download).toBeCalled());\n    expect(download).toBeCalledWith(\n      \"/api/csv/rosterstudents?courseId=7\",\n      \"_blank\",\n    );\n  });\n\n  describe(\"Search filter works correctly\", () => {\n    const testId = \"InstructorCourseShowPage\";\n    const rsTestId = \"InstructorCourseShowPage-RosterStudentTable\";\n    const studentList = [\n      ...rosterStudentFixtures.studentsWithEachStatus,\n      {\n        id: 7,\n        studentId: \"A626737\",\n        firstName: \"Fake\",\n        lastName: \"Name\",\n        email: \"fakename@ucsb.edu\",\n        githubLogin: \"DifferingGitHub\",\n        orgStatus: \"JOINCOURSE\",\n      },\n    ];\n    beforeEach(() => {\n      axiosMock.onGet(\"/api/rosterstudents/course/1\").reply(200, studentList);\n    });\n\n    test(\"PLaceholder, initial check\", async () => {\n      render(\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"EnrollmentTabComponent\n            courseId={1}\n            testIdPrefix={testId}\n            currentUser={currentUserFixtures.instructorUser}\n          />\n        <"+"/QueryClientProvider>,\n      );\n      await waitFor(() => {\n        expect(\n          screen.getByTestId(`${rsTestId}-cell-row-0-col-id`),\n        ).toBeInTheDocument();\n      });\n\n      const searchInput = screen.getByTestId(`${testId}-search`);\n      expect(searchInput).toBeInTheDocument();\n      expect(searchInput).toHaveAttribute(\n        \"placeholder\",\n        \"Search by name, email, student ID, or Github Login\",\n      );\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-0-col-firstName`),\n      ).toBeInTheDocument();\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-1-col-firstName`),\n      ).toBeInTheDocument();\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-2-col-firstName`),\n      ).toBeInTheDocument();\n    });\n\n    test(\"First Name, Email\", async () => {\n      render(\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"EnrollmentTabComponent\n            courseId={1}\n            testIdPrefix={testId}\n            currentUser={currentUserFixtures.instructorUser}\n          />\n        <"+"/QueryClientProvider>,\n      );\n\n      await waitFor(() => {\n        expect(\n          screen.getByTestId(`${rsTestId}-cell-row-0-col-id`),\n        ).toBeInTheDocument();\n      });\n\n      // Verify search input is rendered\n      const searchInput = screen.getByTestId(`${testId}-search`);\n\n      const fullNameStudent = rosterStudentFixtures.studentsWithEachStatus[2]; // Emma Watson\n      fireEvent.change(searchInput, {\n        target: {\n          value:\n            `${fullNameStudent.firstName} ${fullNameStudent.lastName}`.toUpperCase(),\n        },\n      });\n\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-0-col-firstName`),\n      ).toHaveTextContent(fullNameStudent.firstName);\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-0-col-lastName`),\n      ).toHaveTextContent(fullNameStudent.lastName);\n      expect(\n        screen.queryByTestId(`${rsTestId}-cell-row-1-col-firstName`),\n      ).not.toBeInTheDocument();\n\n      fireEvent.change(searchInput, { target: { value: \"\" } });\n\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-0-col-firstName`),\n      ).toBeInTheDocument();\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-1-col-firstName`),\n      ).toBeInTheDocument();\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-2-col-firstName`),\n      ).toBeInTheDocument();\n\n      fireEvent.change(searchInput, {\n        target: {\n          value:\n            rosterStudentFixtures.studentsWithEachStatus[1].email.toUpperCase(),\n        },\n      });\n\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-0-col-email`),\n      ).toHaveTextContent(\n        rosterStudentFixtures.studentsWithEachStatus[1].email,\n      );\n      expect(\n        screen.queryByTestId(`${rsTestId}-cell-row-1-col-email`),\n      ).not.toBeInTheDocument();\n    });\n\n    test(\"GitHub Login, Student ID\", async () => {\n      render(\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"EnrollmentTabComponent\n            courseId={1}\n            testIdPrefix={testId}\n            currentUser={currentUserFixtures.instructorUser}\n          />\n        <"+"/QueryClientProvider>,\n      );\n      await waitFor(() => {\n        expect(\n          screen.getByTestId(`${rsTestId}-cell-row-0-col-id`),\n        ).toBeInTheDocument();\n      });\n\n      const searchInput = screen.getByTestId(`${testId}-search`);\n      const studentWithGithub = studentList[6].githubLogin;\n      fireEvent.change(searchInput, {\n        target: { value: studentWithGithub.toUpperCase() },\n      });\n\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-0-col-githubLogin`),\n      ).toHaveTextContent(studentWithGithub);\n      expect(\n        screen.queryByTestId(`${rsTestId}-cell-row-1-col-firstName`),\n      ).not.toBeInTheDocument();\n\n      fireEvent.change(searchInput, { target: { value: \"\" } });\n\n      fireEvent.change(searchInput, {\n        target: {\n          value:\n            rosterStudentFixtures.studentsWithEachStatus[1].studentId.toUpperCase(),\n        },\n      });\n\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-0-col-studentId`),\n      ).toHaveTextContent(\n        rosterStudentFixtures.studentsWithEachStatus[1].studentId,\n      );\n      expect(\n        screen.queryByTestId(`${rsTestId}-cell-row-1-col-studentId`),\n      ).not.toBeInTheDocument();\n    });\n  });\n});\n"},"src/tests/pages/HomePageLoggedIn.test.jsx":{"tests":[{"id":"90","name":"HomePageLoggedIn tests tables render correctly"},{"id":"91","name":"HomePageLoggedIn tests tables don't render when there are no staffCourses or courses"},{"id":"92","name":"HomePageLoggedIn tests tables render correctly for instructor when courses exist"},{"id":"93","name":"HomePageLoggedIn tests table doesn't render for instructors when courses don't exist"},{"id":"94","name":"HomePageLoggedIn tests join callbacks work"},{"id":"95","name":"HomePageLoggedIn tests right message on 400"},{"id":"96","name":"HomePageLoggedIn tests right message on 404"},{"id":"97","name":"HomePageLoggedIn tests Loading message renders, student"},{"id":"98","name":"HomePageLoggedIn tests Loading message renders, staff"},{"id":"99","name":"HomePageLoggedIn tests Can submit new course"},{"id":"100","name":"HomePageLoggedIn tests toast called on instructor error"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter } from \"react-router\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport coursesFixtures from \"fixtures/coursesFixtures\";\nimport HomePageLoggedIn from \"main/pages/HomePageLoggedIn\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { React } from \"react\";\nimport { vi } from \"vitest\";\n\nconst axiosMock = new AxiosMockAdapter(axios);\nconst queryClient = new QueryClient();\n\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async (importOriginal) => {\n  return {\n    ...(await importOriginal()),\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"HomePageLoggedIn tests\", () => {\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    queryClient.clear();\n    mockToast.mockReset();\n  });\n\n  const setupUserOnly = () => {\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  };\n\n  const setupInstructorUser = () => {\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.instructorUser);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  };\n\n  test(\"tables render correctly\", async () => {\n    setupUserOnly();\n    axiosMock\n      .onGet(\"/api/courses/staffCourses\")\n      .reply(200, coursesFixtures.oneCourseWithEachStatus);\n    axiosMock\n      .onGet(\"/api/courses/list\")\n      .reply(200, coursesFixtures.oneCourseWithEachStatus);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePageLoggedIn />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.getByText(\"Your Student Courses\")).toBeInTheDocument();\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(`CoursesTable-cell-row-0-col-id`),\n      ).toHaveTextContent(\"1\");\n    });\n    expect(\n      screen.getByTestId(`CoursesTable-cell-row-1-col-id`),\n    ).toHaveTextContent(\"2\");\n    expect(\n      screen.getByTestId(`CoursesTable-cell-row-2-col-id`),\n    ).toHaveTextContent(\"3\");\n    expect(\n      screen.getByTestId(`CoursesTable-cell-row-0-col-courseName`),\n    ).toHaveTextContent(\"CMPSC 156\");\n    expect(\n      screen.getByTestId(`CoursesTable-cell-row-0-col-term`),\n    ).toHaveTextContent(\"Spring 2025\");\n    expect(\n      screen.getByTestId(`CoursesTable-cell-row-0-col-school`),\n    ).toHaveTextContent(\"UCSB\");\n    expect(\n      screen.getByTestId(`CoursesTable-cell-row-0-col-studentStatus`),\n    ).toHaveTextContent(\"Pending\");\n\n    expect(screen.getByText(\"Your Staff Courses\")).toBeInTheDocument();\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(`StaffCoursesTable-cell-row-0-col-id`),\n      ).toHaveTextContent(\"1\");\n    });\n    expect(\n      screen.getByTestId(`StaffCoursesTable-cell-row-1-col-id`),\n    ).toHaveTextContent(\"2\");\n    expect(\n      screen.getByTestId(`StaffCoursesTable-cell-row-2-col-id`),\n    ).toHaveTextContent(\"3\");\n    expect(\n      screen.getByTestId(`StaffCoursesTable-cell-row-0-col-courseName`),\n    ).toHaveTextContent(\"CMPSC 156\");\n    expect(\n      screen.getByTestId(`StaffCoursesTable-cell-row-0-col-term`),\n    ).toHaveTextContent(\"Spring 2025\");\n    expect(\n      screen.getByTestId(`StaffCoursesTable-cell-row-0-col-school`),\n    ).toHaveTextContent(\"UCSB\");\n    expect(\n      screen.getByTestId(`StaffCoursesTable-cell-row-0-col-studentStatus`),\n    ).toHaveTextContent(\"Pending\");\n  });\n\n  test(\"tables don't render when there are no staffCourses or courses\", async () => {\n    setupUserOnly();\n    axiosMock.onGet(\"/api/courses/staffCourses\").reply(200, []);\n    axiosMock.onGet(\"/api/courses/list\").reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePageLoggedIn />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(screen.getByText(\"Your Student Courses\")).toBeInTheDocument();\n    });\n    expect(\n      screen.getByText(\"You are not enrolled in any student courses yet.\"),\n    ).toBeInTheDocument();\n\n    expect(screen.queryByText(\"Your Staff Courses\")).not.toBeInTheDocument();\n  });\n\n  test(\"tables render correctly for instructor when courses exist\", async () => {\n    setupInstructorUser();\n    axiosMock\n      .onGet(\"/api/courses/allForInstructors\")\n      .reply(200, coursesFixtures.severalCourses);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePageLoggedIn />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(`InstructorCoursesTable-cell-row-0-col-id`),\n      ).toHaveTextContent(\"1\");\n    });\n    expect(screen.getByText(\"Create Course\")).toBeInTheDocument();\n    expect(screen.getByText(\"Your Instructor Courses\")).toBeInTheDocument();\n    expect(\n      screen.queryByText(\n        \"No instructor courses yet. Click the button above to create one.\",\n      ),\n    ).not.toBeInTheDocument();\n    expect(\n      screen.getByTestId(`InstructorCoursesTable-cell-row-1-col-id`),\n    ).toHaveTextContent(\"2\");\n    expect(\n      screen.getByTestId(`InstructorCoursesTable-cell-row-2-col-id`),\n    ).toHaveTextContent(\"3\");\n\n    const orgName = screen.getByText(\"wsu-cpts489-fa20\");\n    expect(orgName).toBeInTheDocument();\n\n    const button2 = screen.queryByTestId(\n      \"InstructorCoursesTable-cell-row-2-col-orgName-button\",\n    );\n    expect(button2).toBeInTheDocument();\n    expect(button2).toHaveTextContent(\"Install GitHub App\");\n\n    expect(screen.getByTestId(\"InstructorCoursesTable\")).toBeInTheDocument();\n  });\n\n  test(\"table doesn't render for instructors when courses don't exist\", async () => {\n    setupInstructorUser();\n    axiosMock.onGet(\"/api/courses/allForInstructors\").reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePageLoggedIn />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(screen.getByText(\"Your Instructor Courses\")).toBeInTheDocument();\n    });\n\n    expect(\n      screen.queryByTestId(`InstructorCoursesTable-cell-row-0-col-id`),\n    ).not.toBeInTheDocument();\n    expect(\n      screen.queryByTestId(`InstructorCoursesTable-cell-row-1-col-id`),\n    ).not.toBeInTheDocument();\n    expect(\n      screen.queryByTestId(`InstructorCoursesTable-cell-row-2-col-id`),\n    ).not.toBeInTheDocument();\n\n    const orgName = screen.queryByText(\"wsu-cpts489-fa20\");\n    expect(orgName).not.toBeInTheDocument();\n\n    expect(screen.getByText(\"Create Course\")).toBeInTheDocument();\n    expect(\n      screen.getByText(\n        \"No instructor courses yet. Click the button above to create one.\",\n      ),\n    ).toBeInTheDocument();\n\n    expect(\n      screen.queryByTestId(\"InstructorCoursesTable\"),\n    ).not.toBeInTheDocument();\n  });\n\n  test(\"join callbacks work\", async () => {\n    setupUserOnly();\n    axiosMock\n      .onGet(\"/api/courses/staffCourses\")\n      .reply(200, coursesFixtures.oneStaffMemberWithEachStatus);\n    axiosMock\n      .onGet(\"/api/courses/list\")\n      .reply(200, coursesFixtures.oneRosterStudentWithEachStatus);\n    axiosMock\n      .onPut(\"/api/rosterstudents/joinCourse\")\n      .reply(200, \"Successfully invited student to Organization\");\n    axiosMock\n      .onPut(\"/api/coursestaff/joinCourse\")\n      .reply(200, \"Successfully invited staff member to Organization\");\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePageLoggedIn />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findAllByText(\"Join Course\");\n    const studentJoinButton = screen.getByTestId(\n      \"CoursesTable-cell-row-1-col-studentStatus-button\",\n    );\n    fireEvent.click(studentJoinButton);\n    await waitFor(() => expect(axiosMock.history.put.length).toBe(1));\n    expect(axiosMock.history.put[0].url).toBe(\"/api/rosterstudents/joinCourse\");\n    expect(axiosMock.history.put[0].params).toEqual({ rosterStudentId: 22 });\n    await waitFor(() => {\n      expect(mockToast).toBeCalledWith(\n        \"Successfully invited student to Organization\",\n      );\n    });\n\n    const courseStaffJoinButton = screen.getByTestId(\n      \"StaffCoursesTable-cell-row-1-col-studentStatus-button\",\n    );\n\n    fireEvent.click(courseStaffJoinButton);\n    await waitFor(() => expect(axiosMock.history.put.length).toBe(2));\n    expect(axiosMock.history.put[1].url).toBe(\"/api/coursestaff/joinCourse\");\n    expect(axiosMock.history.put[1].params).toEqual({ courseStaffId: 32 });\n    await waitFor(() => {\n      expect(mockToast).toBeCalledWith(\n        \"Successfully invited staff member to Organization\",\n      );\n    });\n\n    expect(\n      queryClient.getQueryState([\"/api/courses/list\"]).dataUpdateCount,\n    ).toBe(2);\n    expect(\n      queryClient.getQueryState([\"/api/courses/staffCourses\"]).dataUpdateCount,\n    ).toBe(2);\n    expect(\n      queryClient.isFetching({ queryKey: [\"/api/courses/allForInstructors\"] }),\n    ).toBe(0);\n  });\n\n  test(\"right message on 400\", async () => {\n    setupUserOnly();\n    axiosMock\n      .onGet(\"/api/courses/staffCourses\")\n      .reply(200, coursesFixtures.oneStaffMemberWithEachStatus);\n    axiosMock\n      .onGet(\"/api/courses/list\")\n      .reply(200, coursesFixtures.oneRosterStudentWithEachStatus);\n    axiosMock\n      .onPut(\"/api/rosterstudents/joinCourse\")\n      .reply(\n        400,\n        \"Course has not been set up. Please ask your instructor for help.\",\n      );\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePageLoggedIn />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findAllByText(\"Join Course\");\n    const studentJoinButton = screen.getByTestId(\n      \"CoursesTable-cell-row-1-col-studentStatus-button\",\n    );\n    fireEvent.click(studentJoinButton);\n    await waitFor(() => expect(axiosMock.history.put.length).toBe(1));\n    expect(axiosMock.history.put[0].url).toBe(\"/api/rosterstudents/joinCourse\");\n    expect(axiosMock.history.put[0].params).toEqual({ rosterStudentId: 22 });\n    await waitFor(() => {\n      expect(mockToast).toBeCalledWith(\n        \"Course has not been set up. Please ask your instructor for help.\",\n      );\n    });\n  });\n\n  test(\"right message on 404\", async () => {\n    setupUserOnly();\n    axiosMock\n      .onGet(\"/api/courses/staffCourses\")\n      .reply(200, coursesFixtures.oneStaffMemberWithEachStatus);\n    axiosMock\n      .onGet(\"/api/courses/list\")\n      .reply(200, coursesFixtures.oneRosterStudentWithEachStatus);\n    axiosMock.onPut(\"/api/rosterstudents/joinCourse\").reply(404);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePageLoggedIn />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findAllByText(\"Join Course\");\n    const studentJoinButton = screen.getByTestId(\n      \"CoursesTable-cell-row-1-col-studentStatus-button\",\n    );\n    fireEvent.click(studentJoinButton);\n    await waitFor(() => expect(axiosMock.history.put.length).toBe(1));\n    expect(axiosMock.history.put[0].url).toBe(\"/api/rosterstudents/joinCourse\");\n    expect(axiosMock.history.put[0].params).toEqual({ rosterStudentId: 22 });\n    await waitFor(() => {\n      expect(mockToast).toBeCalledWith(\"Request failed with status code 404\");\n    });\n  });\n\n  test(\"Loading message renders, student\", async () => {\n    setupUserOnly();\n    axiosMock.onGet(\"/api/courses/staffCourses\").reply(200, [\n      ...coursesFixtures.oneStaffMemberWithEachStatus,\n      {\n        id: 7,\n        staffId: 36,\n        courseName: \"CMPSC 130B\",\n        term: \"Spring 2026\",\n        school: \"UCSB\",\n        orgName: \"ucsb-cs130b-s26\",\n        studentStatus: \"JOINCOURSE\",\n      },\n    ]);\n    axiosMock.onGet(\"/api/courses/list\").reply(200, [\n      ...coursesFixtures.oneRosterStudentWithEachStatus,\n      {\n        id: 7,\n        rosterStudentId: 26,\n        courseName: \"CMPSC 130B\",\n        term: \"Spring 2026\",\n        school: \"UCSB\",\n        orgName: \"ucsb-cs130b-s26\",\n        studentStatus: \"JOINCOURSE\",\n      },\n    ]);\n    axiosMock\n      .onPut(\"/api/rosterstudents/joinCourse\")\n      .withDelayInMs(5000)\n      .reply(202, \"Successfully invited student to Organization\");\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePageLoggedIn />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    await screen.findAllByText(\"Join Course\");\n    const studentJoinButton = screen.getByTestId(\n      \"CoursesTable-cell-row-1-col-studentStatus-button\",\n    );\n    fireEvent.click(studentJoinButton);\n    await screen.findByText(\"Joining...\");\n    expect(\n      screen.getByTestId(\"CoursesTable-cell-row-6-col-studentStatus-button\"),\n    ).toHaveTextContent(\"Join Course\");\n  });\n\n  test(\"Loading message renders, staff\", async () => {\n    setupUserOnly();\n    axiosMock.onGet(\"/api/courses/staffCourses\").reply(200, [\n      ...coursesFixtures.oneStaffMemberWithEachStatus,\n      {\n        id: 7,\n        staffId: 36,\n        courseName: \"CMPSC 130B\",\n        term: \"Spring 2026\",\n        school: \"UCSB\",\n        orgName: \"ucsb-cs130b-s26\",\n        studentStatus: \"JOINCOURSE\",\n      },\n    ]);\n    axiosMock.onGet(\"/api/courses/list\").reply(200, [\n      ...coursesFixtures.oneRosterStudentWithEachStatus,\n      {\n        id: 7,\n        rosterStudentId: 26,\n        courseName: \"CMPSC 130B\",\n        term: \"Spring 2026\",\n        school: \"UCSB\",\n        orgName: \"ucsb-cs130b-s26\",\n        studentStatus: \"JOINCOURSE\",\n      },\n    ]);\n    axiosMock\n      .onPut(\"/api/coursestaff/joinCourse\")\n      .withDelayInMs(5000)\n      .reply(202, \"Successfully invited staff member to Organization\");\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePageLoggedIn />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    await screen.findAllByText(\"Join Course\");\n    const studentJoinButton = screen.getByTestId(\n      \"StaffCoursesTable-cell-row-1-col-studentStatus-button\",\n    );\n    fireEvent.click(studentJoinButton);\n    await screen.findByText(\"Joining...\");\n    expect(\n      screen.getByTestId(\n        \"StaffCoursesTable-cell-row-6-col-studentStatus-button\",\n      ),\n    ).toHaveTextContent(\"Join Course\");\n  });\n  test(\"Can submit new course\", async () => {\n    setupInstructorUser();\n    axiosMock\n      .onPost(\"/api/courses/post\")\n      .reply(200, coursesFixtures.severalCourses[0]);\n    axiosMock\n      .onGet(\"/api/courses/allForInstructors\")\n      .reply(200, coursesFixtures.severalCourses);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePageLoggedIn />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(`InstructorCoursesTable-cell-row-0-col-id`),\n      ).toHaveTextContent(\"1\");\n    });\n\n    const createCourse = screen.getByText(\"Create Course\");\n    expect(createCourse).toHaveClass(\"btn btn-primary\");\n    expect(createCourse).toHaveStyle(\"float: right; margin-bottom: 10px;\");\n    fireEvent.click(createCourse);\n\n    await screen.findByLabelText(\"Course Name\");\n    const courseName = screen.getByLabelText(\"Course Name\");\n    const courseTerm = screen.getByLabelText(\"Term\");\n    const school = screen.getByLabelText(\"School\");\n    fireEvent.change(courseName, { target: { value: \"CMPSC 156\" } });\n    fireEvent.change(courseTerm, { target: { value: \"Spring 2025\" } });\n    fireEvent.change(school, { target: { value: \"UCSB\" } });\n    fireEvent.click(screen.getByText(\"Create\"));\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n    expect(axiosMock.history.post[0].url).toBe(\"/api/courses/post\");\n    expect(axiosMock.history.post[0].params).toEqual({\n      courseName: \"CMPSC 156\",\n      term: \"Spring 2025\",\n      school: \"UCSB\",\n    });\n    await waitFor(() =>\n      expect(mockToast).toBeCalledWith(\"Course CMPSC 156 created\"),\n    );\n    expect(\n      queryClient.getQueryState([\"/api/courses/allForInstructors\"]),\n    ).toBeTruthy();\n    expect(screen.queryByTestId(\"CourseModal-base\")).not.toBeInTheDocument();\n  });\n\n  test(\"toast called on instructor error\", async () => {\n    setupInstructorUser();\n    axiosMock.onGet(\"/api/courses/allForInstructors\").reply(500);\n    axiosMock\n      .onGet(\"/api/courses/staffCourses\")\n      .reply(200, coursesFixtures.oneCourseWithEachStatus);\n    axiosMock\n      .onGet(\"/api/courses/list\")\n      .reply(200, coursesFixtures.oneCourseWithEachStatus);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HomePageLoggedIn />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => expect(mockToast).toHaveBeenCalled());\n  });\n});\n"},"src/tests/components/RosterStudent/RosterStudentTable.test.jsx":{"tests":[{"id":"101","name":"RosterStudentTable tests renders empty table correctly"},{"id":"102","name":"RosterStudentTable tests Has the expected column headers, content and buttons for admin user"},{"id":"103","name":"RosterStudentTable tests Has the expected column headers, content for ordinary user"},{"id":"104","name":"RosterStudentTable tests Edit button navigates to the edit page"},{"id":"105","name":"RosterStudentTable tests Delete button calls delete callback"},{"id":"106","name":"tooltips for Team column name"},{"id":"107","name":"tooltips for PENDING status"},{"id":"108","name":"tooltips for JOINCOURSE status"},{"id":"109","name":"tooltips for INVITED status"},{"id":"110","name":"tooltips for OWNER status"},{"id":"111","name":"tooltips for MEMBER status"},{"id":"112","name":"tooltips for an illegal status"},{"id":"113","name":"expect the correct tooltip ID"},{"id":"114","name":"if teams is null, shows empty string"}],"source":"import { fireEvent, render, waitFor, screen } from \"@testing-library/react\";\nimport { rosterStudentFixtures } from \"fixtures/rosterStudentFixtures\";\nimport RosterStudentTable from \"main/components/RosterStudent/RosterStudentTable\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { expect, vi } from \"vitest\";\n\nconst queryClient = new QueryClient();\nconst axiosMock = new AxiosMockAdapter(axios);\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async (importOriginal) => {\n  return {\n    ...(await importOriginal()),\n    toast: (x) => mockToast(x),\n  };\n});\ndescribe(\"RosterStudentTable tests\", () => {\n  const expectedHeaders = [\n    \"id\",\n    \"Student Id\",\n    \"First Name\",\n    \"Last Name\",\n    \"Email\",\n    \"Status\",\n    \"GitHub Login\",\n    \"Teams\",\n  ];\n  const expectedFields = [\n    \"id\",\n    \"studentId\",\n    \"firstName\",\n    \"lastName\",\n    \"email\",\n    \"orgStatus\",\n    \"githubLogin\",\n    \"teams\",\n  ];\n  const testId = \"RosterStudentTable\";\n\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    queryClient.clear();\n  });\n  test(\"renders empty table correctly\", () => {\n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RosterStudentTable\n            students={[]}\n            currentUser={currentUser}\n            courseId=\"7\"\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n\n    const courseIdHiddenElement = screen.getByTestId(`${testId}-courseId`);\n    expect(courseIdHiddenElement).toBeInTheDocument();\n    expect(courseIdHiddenElement).toHaveAttribute(\"data-course-id\", \"7\");\n    // Expect it to have style display:none\n    expect(courseIdHiddenElement).toHaveStyle(\"display: none\");\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const fieldElement = screen.queryByTestId(\n        `${testId}-cell-row-0-col-${field}`,\n      );\n      expect(fieldElement).not.toBeInTheDocument();\n    });\n  });\n  test(\"Has the expected column headers, content and buttons for admin user\", () => {\n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RosterStudentTable\n            students={rosterStudentFixtures.studentsWithEachStatus}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(screen.queryByText(\"Edit Student\")).not.toBeInTheDocument();\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\n      \"1\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-studentId`),\n    ).toHaveTextContent(\"A123456\");\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-firstName`),\n    ).toHaveTextContent(\"Alice\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-lastName`),\n    ).toHaveTextContent(\"Brown\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-email`),\n    ).toHaveTextContent(\"alicebrown@ucsb.edu\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-3-col-githubLogin`),\n    ).toHaveTextContent(\"jonsnow\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-3-col-teams`),\n    ).toHaveTextContent(\"Team A, Team B\");\n\n    const pending = screen.getByText(\"Pending\");\n    expect(pending).toBeInTheDocument();\n    expect(pending).toHaveClass(\"text-danger\");\n\n    const joinCourse = screen.getByText(\"Join Course\");\n    expect(joinCourse).toBeInTheDocument();\n    expect(joinCourse).toHaveClass(\"text-primary\");\n\n    const member = screen.getByText(\"Member\");\n    expect(member).toBeInTheDocument();\n    expect(member).toHaveClass(\"text-success\");\n\n    const owner = screen.getByText(\"Owner\");\n    expect(owner).toBeInTheDocument();\n    expect(owner).toHaveStyle(\"color: rgb(128, 0, 128)\");\n\n    const invited = screen.getByText(\"Invited\");\n    expect(invited).toBeInTheDocument();\n    expect(invited).toHaveClass(\"text-primary\");\n\n    const unexpected = screen.getByText(\"Illegal status that will never occur\");\n    expect(unexpected).toBeInTheDocument();\n    expect(unexpected).not.toHaveClass(\"text-danger\");\n\n    const editButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Edit-button`,\n    );\n    expect(editButton).toBeInTheDocument();\n    expect(editButton).toHaveClass(\"btn-primary\");\n\n    const deleteButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n    expect(deleteButton).toHaveClass(\"btn-danger\");\n  });\n  test(\"Has the expected column headers, content for ordinary user\", () => {\n    // arrange\n    const currentUser = currentUserFixtures.userOnly;\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RosterStudentTable\n            students={rosterStudentFixtures.threeStudents}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-studentId`),\n    ).toHaveTextContent(\"2\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-firstName`),\n    ).toHaveTextContent(\"Alice\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-lastName`),\n    ).toHaveTextContent(\"Brown\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-email`),\n    ).toHaveTextContent(\"alicebrown@ucsb.edu\");\n\n    expect(screen.queryByText(\"Delete\")).not.toBeInTheDocument();\n    expect(screen.queryByText(\"Edit\")).not.toBeInTheDocument();\n  });\n\n  test(\"Edit button navigates to the edit page\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n    const queryClientSpecific = new QueryClient({\n      defaultOptions: {\n        queries: {\n          retry: false,\n          staleTime: Infinity,\n        },\n      },\n    });\n    queryClientSpecific.setQueryData(\n      [\"/api/rosterstudents/course/7\"],\n      rosterStudentFixtures.threeStudents,\n    );\n    queryClientSpecific.setQueryData([\"mock queryData\"], null);\n    axiosMock.onPut(\"/api/rosterstudents/update\").reply(200);\n    render(\n      <"+"QueryClientProvider client={queryClientSpecific}>\n        <"+"MemoryRouter>\n          <"+"RosterStudentTable\n            students={rosterStudentFixtures.threeStudents}\n            currentUser={currentUser}\n            courseId={7}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const editButton = screen.getByTestId(\n      \"RosterStudentTable-cell-row-0-col-Edit-button\",\n    );\n    fireEvent.click(editButton);\n    await screen.findByText(\"Edit Student\");\n    expect(screen.getByTestId(\"RosterStudentTable-modal-body\")).toHaveClass(\n      \"pb-3\",\n    );\n    expect(screen.queryByText(\"Cancel\")).not.toBeInTheDocument();\n    expect(screen.getByText(\"Update\")).toBeInTheDocument();\n    fireEvent.click(screen.getByText(\"Update\"));\n    await waitFor(() => axiosMock.history.put.length === 1);\n    expect(axiosMock.history.put[0].params).toEqual({\n      firstName: \"Alice\",\n      id: 3,\n      lastName: \"Brown\",\n      studentId: \"A123456\",\n    });\n    await waitFor(() =>\n      expect(screen.queryByText(\"Edit Student\")).not.toBeInTheDocument(),\n    );\n    expect(mockToast).toBeCalledWith(\"Student updated successfully.\");\n    expect(\n      queryClientSpecific.getQueryState([\"/api/rosterstudents/course/7\"])\n        .isInvalidated,\n    ).toBe(true);\n    expect(\n      queryClientSpecific.getQueryState([\"mock queryData\"]).isInvalidated,\n    ).toBe(false);\n  });\n\n  test(\"Delete button calls delete callback\", async () => {\n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    axiosMock\n      .onDelete(\"/api/rosterstudents/delete\")\n      .reply(200, { message: \"Student deleted\" });\n\n    // act - render the component\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RosterStudentTable\n            students={rosterStudentFixtures.threeStudents}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert - check that the expected content is rendered\n    expect(\n      await screen.findByTestId(`${testId}-cell-row-0-col-studentId`),\n    ).toHaveTextContent(\"2\");\n\n    const deleteButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n\n    // act - click the delete button\n    fireEvent.click(deleteButton);\n\n    // assert - check that the delete endpoint was called\n\n    await waitFor(() => expect(axiosMock.history.delete.length).toBe(1));\n    expect(axiosMock.history.delete[0].params).toEqual({ id: 3 });\n  });\n});\ntest(\"tooltips for Team column name\", async () => {\n  const currentUser = currentUserFixtures.adminUser;\n  render(\n    <"+"QueryClientProvider client={queryClient}>\n      <"+"MemoryRouter>\n        <"+"RosterStudentTable\n          students={rosterStudentFixtures.studentsWithEachStatus}\n          currentUser={currentUser}\n        />\n      <"+"/MemoryRouter>\n    <"+"/QueryClientProvider>,\n  );\n\n  fireEvent.mouseOver(screen.getByText(\"Teams\"));\n\n  await waitFor(() => {\n    expect(\n      screen.getByText(\"A list of teams that the student is a member of.\"),\n    ).toBeInTheDocument();\n  });\n  expect(screen.getByRole(\"tooltip\")).toHaveAttribute(\n    \"id\",\n    \"tooltip-teams-header\",\n  );\n});\ntest(\"tooltips for PENDING status\", async () => {\n  const currentUser = currentUserFixtures.adminUser;\n  render(\n    <"+"QueryClientProvider client={queryClient}>\n      <"+"MemoryRouter>\n        <"+"RosterStudentTable\n          students={rosterStudentFixtures.studentsWithEachStatus}\n          currentUser={currentUser}\n        />\n      <"+"/MemoryRouter>\n    <"+"/QueryClientProvider>,\n  );\n\n  fireEvent.mouseOver(screen.getByText(\"Pending\"));\n\n  await waitFor(() => {\n    expect(\n      screen.getByText(\n        \"Student cannot join the course until it has been completely set up.\",\n      ),\n    ).toBeInTheDocument();\n  });\n});\ntest(\"tooltips for JOINCOURSE status\", async () => {\n  const currentUser = currentUserFixtures.adminUser;\n  render(\n    <"+"QueryClientProvider client={queryClient}>\n      <"+"MemoryRouter>\n        <"+"RosterStudentTable\n          students={rosterStudentFixtures.studentsWithEachStatus}\n          currentUser={currentUser}\n        />\n      <"+"/MemoryRouter>\n    <"+"/QueryClientProvider>,\n  );\n\n  fireEvent.mouseOver(screen.getByText(\"Join Course\"));\n\n  await waitFor(() => {\n    expect(\n      screen.getByText(\n        \"Student has been prompted to join, but hasn't yet clicked the 'Join Course' button to generate an invite to the organization.\",\n      ),\n    ).toBeInTheDocument();\n  });\n});\ntest(\"tooltips for INVITED status\", async () => {\n  const currentUser = currentUserFixtures.adminUser;\n  render(\n    <"+"QueryClientProvider client={queryClient}>\n      <"+"MemoryRouter>\n        <"+"RosterStudentTable\n          students={rosterStudentFixtures.studentsWithEachStatus}\n          currentUser={currentUser}\n        />\n      <"+"/MemoryRouter>\n    <"+"/QueryClientProvider>,\n  );\n\n  fireEvent.mouseOver(screen.getByText(\"Invited\"));\n  await waitFor(() => {\n    expect(\n      screen.getByText(\n        \"Student has generated an invite, but has not yet accepted or declined the invitation.\",\n      ),\n    ).toBeInTheDocument();\n  });\n});\ntest(\"tooltips for OWNER status\", async () => {\n  const currentUser = currentUserFixtures.adminUser;\n  render(\n    <"+"QueryClientProvider client={queryClient}>\n      <"+"MemoryRouter>\n        <"+"RosterStudentTable\n          students={rosterStudentFixtures.studentsWithEachStatus}\n          currentUser={currentUser}\n        />\n      <"+"/MemoryRouter>\n    <"+"/QueryClientProvider>,\n  );\n\n  fireEvent.mouseOver(screen.getByText(\"Owner\"));\n  await waitFor(() => {\n    expect(\n      screen.getByText(\n        \"Student is an owner of the GitHub organization associated with this course.\",\n      ),\n    ).toBeInTheDocument();\n  });\n});\ntest(\"tooltips for MEMBER status\", async () => {\n  const currentUser = currentUserFixtures.adminUser;\n  render(\n    <"+"QueryClientProvider client={queryClient}>\n      <"+"MemoryRouter>\n        <"+"RosterStudentTable\n          students={rosterStudentFixtures.studentsWithEachStatus}\n          currentUser={currentUser}\n        />\n      <"+"/MemoryRouter>\n    <"+"/QueryClientProvider>,\n  );\n\n  fireEvent.mouseOver(screen.getByText(\"Member\"));\n\n  await waitFor(() => {\n    expect(\n      screen.getByText(\n        \"Student is a member of the GitHub organization associated with this course.\",\n      ),\n    ).toBeInTheDocument();\n  });\n});\ntest(\"tooltips for an illegal status\", async () => {\n  const currentUser = currentUserFixtures.adminUser;\n\n  render(\n    <"+"QueryClientProvider client={queryClient}>\n      <"+"MemoryRouter>\n        <"+"RosterStudentTable\n          students={rosterStudentFixtures.studentsWithEachStatus}\n          currentUser={currentUser}\n        />\n      <"+"/MemoryRouter>\n    <"+"/QueryClientProvider>,\n  );\n\n  fireEvent.mouseOver(screen.getByText(\"Illegal status that will never occur\"));\n\n  await waitFor(() => {\n    expect(\n      screen.getByText(\"Tooltip for illegal status that will never occur\"),\n    ).toBeInTheDocument();\n  });\n});\ntest(\"expect the correct tooltip ID\", async () => {\n  const currentUser = currentUserFixtures.adminUser;\n\n  render(\n    <"+"QueryClientProvider client={queryClient}>\n      <"+"MemoryRouter>\n        <"+"RosterStudentTable\n          students={rosterStudentFixtures.studentsWithEachStatus}\n          currentUser={currentUser}\n        />\n      <"+"/MemoryRouter>\n    <"+"/QueryClientProvider>,\n  );\n\n  fireEvent.mouseOver(screen.getByText(\"Member\"));\n\n  const tooltip = await screen.findByRole(\"tooltip\");\n  expect(tooltip).toHaveAttribute(\"id\", \"member-tooltip\");\n});\ntest(\"if teams is null, shows empty string\", async () => {\n  const currentUser = currentUserFixtures.adminUser;\n  render(\n    <"+"QueryClientProvider client={queryClient}>\n      <"+"MemoryRouter>\n        <"+"RosterStudentTable\n          students={rosterStudentFixtures.studentsWithEachStatus}\n          currentUser={currentUser}\n        />\n      <"+"/MemoryRouter>\n    <"+"/QueryClientProvider>,\n  );\n\n  expect(\n    screen.getByTestId(\"RosterStudentTable-cell-row-0-col-teams\"),\n  ).toHaveTextContent(\"\");\n});\n"},"src/tests/components/CourseStaff/CourseStaffTable.test.jsx":{"tests":[{"id":"115","name":"CourseStaffTable tests renders empty table correctly"},{"id":"116","name":"CourseStaffTable tests Has the expected column headers, content and buttons for admin user"},{"id":"117","name":"CourseStaffTable tests Has the expected column headers, content for ordinary user"},{"id":"118","name":"CourseStaffTable tests Edit button navigates to the edit modal"},{"id":"119","name":"CourseStaffTable tests Delete button calls delete callback"},{"id":"120","name":"CourseStaffTable tests tooltips for PENDING status"},{"id":"121","name":"CourseStaffTable tests tooltips for JOINCOURSE status"},{"id":"122","name":"CourseStaffTable tests tooltips for INVITED status"},{"id":"123","name":"CourseStaffTable tests tooltips for OWNER status"},{"id":"124","name":"CourseStaffTable tests tooltips for MEMBER status"},{"id":"125","name":"CourseStaffTable tests tooltips for an illegal status"},{"id":"126","name":"CourseStaffTable tests onEditSuccess calls toast and hideModal"},{"id":"127","name":"CourseStaffTable tests expect the correct tooltip ID"}],"source":"import { fireEvent, render, waitFor, screen } from \"@testing-library/react\";\nimport { courseStaffFixtures } from \"fixtures/courseStaffFixtures\";\nimport CourseStaffTable from \"main/components/CourseStaff/CourseStaffTable\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { vi } from \"vitest\";\n\nconst queryClient = new QueryClient();\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async (importOriginal) => {\n  return {\n    ...(await importOriginal()),\n    toast: (x) => mockToast(x),\n  };\n});\n\nconst axiosMock = new AxiosMockAdapter(axios);\ndescribe(\"CourseStaffTable tests\", () => {\n  const expectedHeaders = [\n    \"id\",\n    \"First Name\",\n    \"Last Name\",\n    \"Email\",\n    \"Status\",\n    \"GitHub Login\",\n  ];\n  const expectedFields = [\n    \"id\",\n    \"firstName\",\n    \"lastName\",\n    \"email\",\n    \"orgStatus\",\n    \"githubLogin\",\n  ];\n  const testId = \"CourseStaffTable\";\n\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    queryClient.clear();\n    mockToast.mockClear();\n  });\n\n  test(\"renders empty table correctly\", () => {\n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseStaffTable staff={[]} currentUser={currentUser} courseId=\"7\" />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n\n    const courseIdHiddenElement = screen.getByTestId(`${testId}-courseId`);\n    expect(courseIdHiddenElement).toBeInTheDocument();\n    expect(courseIdHiddenElement).toHaveAttribute(\"data-course-id\", \"7\");\n    // Expect it to have style display:none\n    expect(courseIdHiddenElement).toHaveStyle(\"display: none\");\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const fieldElement = screen.queryByTestId(\n        `${testId}-cell-row-0-col-${field}`,\n      );\n      expect(fieldElement).not.toBeInTheDocument();\n    });\n  });\n  test(\"Has the expected column headers, content and buttons for admin user\", () => {\n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseStaffTable\n            staff={courseStaffFixtures.staffWithEachStatus}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(\n      screen.getByTestId(\"CourseStaffTable-cell-row-0-col-Edit-button\"),\n    ).toBeInTheDocument();\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\n      \"1\",\n    );\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-firstName`),\n    ).toHaveTextContent(\"Dr. John\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-lastName`),\n    ).toHaveTextContent(\"Professor\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-email`),\n    ).toHaveTextContent(\"johnprof@ucsb.edu\");\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-3-col-githubLogin`),\n    ).toHaveTextContent(\"sarahlead\");\n\n    const pending = screen.getByText(\"Pending\");\n    expect(pending).toBeInTheDocument();\n    expect(pending).toHaveClass(\"text-warning\");\n\n    const joinCourse = screen.getByText(\"Join Course\");\n    expect(joinCourse).toBeInTheDocument();\n    expect(joinCourse).toHaveClass(\"text-primary\");\n\n    const members = screen.getAllByText(\"Member\");\n    members.forEach((x) => expect(x).toHaveClass(\"text-primary\"));\n\n    const owner = screen.getByText(\"Owner\");\n    expect(owner).toBeInTheDocument();\n    expect(owner).toHaveClass(\"text-info\");\n\n    const invited = screen.getByText(\"Invited\");\n    expect(invited).toBeInTheDocument();\n    expect(invited).toHaveClass(\"text-primary\");\n\n    const editButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Edit-button`,\n    );\n    expect(editButton).toBeInTheDocument();\n    expect(editButton).toHaveClass(\"btn-primary\");\n\n    const deleteButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n    expect(deleteButton).toHaveClass(\"btn-danger\");\n  });\n\n  test(\"Has the expected column headers, content for ordinary user\", () => {\n    // arrange\n    const currentUser = currentUserFixtures.userOnly;\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseStaffTable\n            staff={courseStaffFixtures.threeStaff}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-firstName`),\n    ).toHaveTextContent(\"Dr. John\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-lastName`),\n    ).toHaveTextContent(\"Professor\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-email`),\n    ).toHaveTextContent(\"johnprof@ucsb.edu\");\n\n    expect(screen.queryByText(\"Delete\")).not.toBeInTheDocument();\n    expect(screen.queryByText(\"Edit\")).not.toBeInTheDocument();\n  });\n\n  test(\"Edit button navigates to the edit modal\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n    const queryClientSpecific = new QueryClient({\n      defaultOptions: {\n        queries: {\n          retry: false,\n          staleTime: Infinity,\n        },\n      },\n    });\n    queryClientSpecific.setQueryData(\n      [\"/api/coursestaff/course?courseId=7\"],\n      courseStaffFixtures.threeStaff,\n    );\n    queryClientSpecific.setQueryData([\"mock queryData\"], null);\n    axiosMock.onPut(/\\/api\\/coursestaff?courseId=7.*/).reply(200);\n    render(\n      <"+"QueryClientProvider client={queryClientSpecific}>\n        <"+"MemoryRouter>\n          <"+"CourseStaffTable\n            staff={courseStaffFixtures.threeStaff}\n            currentUser={currentUser}\n            courseId={7}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const editButton = screen.getByTestId(\n      \"CourseStaffTable-cell-row-0-col-Edit-button\",\n    );\n    fireEvent.click(editButton);\n    await screen.findByText(\"Edit Staff Member\");\n    expect(screen.getByTestId(\"CourseStaffTable-modal-body\")).toHaveClass(\n      \"pb-3\",\n    );\n    expect(screen.queryByText(\"Cancel\")).not.toBeInTheDocument();\n    expect(screen.getByText(\"Update\")).toBeInTheDocument();\n    fireEvent.click(screen.getByText(\"Update\"));\n    await waitFor(() => axiosMock.history.put.length === 1);\n  });\n\n  test(\"Delete button calls delete callback\", async () => {\n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    axiosMock\n      .onDelete(\"/api/coursestaff/delete\")\n      .reply(200, { message: \"Staff member deleted\" });\n\n    // act - render the component\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseStaffTable\n            staff={courseStaffFixtures.threeStaff}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert - check that the expected content is rendered\n    expect(\n      await screen.findByTestId(`${testId}-cell-row-0-col-id`),\n    ).toHaveTextContent(\"1\");\n\n    const deleteButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n\n    // act - click the delete button\n    fireEvent.click(deleteButton);\n\n    // assert - check that the delete endpoint was called\n\n    await waitFor(() => expect(axiosMock.history.delete.length).toBe(1));\n    expect(axiosMock.history.delete[0].params).toEqual({ id: 1 });\n  });\n\n  test(\"tooltips for PENDING status\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseStaffTable\n            staff={courseStaffFixtures.staffWithEachStatus}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    fireEvent.mouseOver(screen.getByText(\"Pending\"));\n\n    await waitFor(() => {\n      expect(\n        screen.getByText(\n          \"Staff member cannot join the course until it has been completely set up.\",\n        ),\n      ).toBeInTheDocument();\n    });\n  });\n  test(\"tooltips for JOINCOURSE status\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseStaffTable\n            staff={courseStaffFixtures.staffWithEachStatus}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    fireEvent.mouseOver(screen.getByText(\"Join Course\"));\n\n    await waitFor(() => {\n      expect(\n        screen.getByText(\n          \"Staff member has been prompted to join, but hasn't yet clicked the 'Join Course' button to generate an invite to the organization.\",\n        ),\n      ).toBeInTheDocument();\n    });\n  });\n  test(\"tooltips for INVITED status\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseStaffTable\n            staff={courseStaffFixtures.staffWithEachStatus}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    fireEvent.mouseOver(screen.getByText(\"Invited\"));\n    await waitFor(() => {\n      expect(\n        screen.getByText(\n          \"Staff member has generated an invite, but has not yet accepted or declined the invitation.\",\n        ),\n      ).toBeInTheDocument();\n    });\n  });\n  test(\"tooltips for OWNER status\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseStaffTable\n            staff={courseStaffFixtures.staffWithEachStatus}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    fireEvent.mouseOver(screen.getByText(\"Owner\"));\n    await waitFor(() => {\n      expect(\n        screen.getByText(\n          \"Staff member is an owner of the GitHub organization associated with this course.\",\n        ),\n      ).toBeInTheDocument();\n    });\n  });\n  test(\"tooltips for MEMBER status\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseStaffTable\n            staff={courseStaffFixtures.staffWithEachStatus}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const members = screen.getAllByText(\"Member\");\n    fireEvent.mouseOver(members[0]);\n\n    await waitFor(() => {\n      expect(\n        screen.getByText(\n          \"Staff member is a member of the GitHub organization associated with this course.\",\n        ),\n      ).toBeInTheDocument();\n    });\n  });\n\n  test(\"tooltips for an illegal status\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseStaffTable\n            staff={courseStaffFixtures.staffWithUndefinedStatus}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    fireEvent.mouseOver(screen.getByText(\"Floating in Space\"));\n\n    await waitFor(() => {\n      expect(\n        screen.getByText(\"Tooltip for illegal status that will never occur\"),\n      ).toBeInTheDocument();\n    });\n  });\n\n  test(\"onEditSuccess calls toast and hideModal\", async () => {\n    axiosMock.onPut(\"/api/coursestaff\").reply(200, []);\n    // Arrange\n    const currentUser = currentUserFixtures.adminUser;\n    // Render the component\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseStaffTable\n            staff={courseStaffFixtures.threeStaff}\n            currentUser={currentUser}\n            courseId={7}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Access the component instance via screen (simulate edit success)\n    // Find and click the Edit button to open modal\n    const editButton = screen.getByTestId(\n      \"CourseStaffTable-cell-row-0-col-Edit-button\",\n    );\n    fireEvent.click(editButton);\n\n    // The modal should be open\n    expect(screen.getByText(\"Edit Staff Member\")).toBeInTheDocument();\n\n    // Simulate successful edit by clicking Update\n    fireEvent.click(screen.getByText(\"Update\"));\n\n    await waitFor(() => expect(mockToast).toHaveBeenCalled());\n    expect(mockToast).toHaveBeenCalledWith(\n      \"Staff member updated successfully.\",\n    );\n\n    // Modal should be closed after success\n    await waitFor(() => {\n      expect(screen.queryByText(\"Edit Staff Member\")).not.toBeInTheDocument();\n    });\n  });\n\n  test(\"expect the correct tooltip ID\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseStaffTable\n            staff={courseStaffFixtures.staffWithEachStatus}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const members = screen.getAllByText(\"Member\");\n\n    fireEvent.mouseOver(members[0]);\n\n    const tooltip = await screen.findByRole(\"tooltip\");\n    expect(tooltip).toHaveAttribute(\"id\", \"member-tooltip\");\n  });\n});\n"},"src/tests/components/TabComponent/StaffTabComponent.test.jsx":{"tests":[{"id":"128","name":"StaffTabComponent Tests StaffTabComponent Renders"},{"id":"129","name":"StaffTabComponent Tests Table Renders with no students"},{"id":"130","name":"StaffTabComponent Tests StaffForm submit works and clears search filter"},{"id":"131","name":"StaffTabComponent Tests Search filter works correctly Placeholder, initial check"},{"id":"132","name":"StaffTabComponent Tests Search filter works correctly First Name, Email"},{"id":"133","name":"StaffTabComponent Tests Search filter works correctly GitHub Login, Student ID"},{"id":"134","name":"StaffTabComponent Tests for coming soon tooltip on disabled upload CSV button"},{"id":"135","name":"StaffTabComponent Tests for coming soon tooltip on disabled download CSV button"},{"id":"136","name":"StaffTabComponent Tests Create Staff Member Modals closes on close button"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport axios from \"axios\";\nimport {\n  QueryClient,\n  QueryClientProvider,\n  useQuery,\n} from \"@tanstack/react-query\";\nimport StaffTabComponent from \"main/components/TabComponent/StaffTabComponent\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { courseStaffFixtures } from \"fixtures/courseStaffFixtures\";\nimport { vi } from \"vitest\";\n\nconst queryClient = new QueryClient();\nconst testId = \"InstructorCourseShowPage\";\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async (importOriginal) => {\n  return {\n    ...(await importOriginal()),\n    toast: (x) => mockToast(x),\n  };\n});\n\nconst mockedNavigate = vi.fn();\nvi.mock(\"react-router\", async (importOriginal) => ({\n  ...(await importOriginal()),\n  useNavigate: () => mockedNavigate,\n}));\n\nconst ArbitraryTestQueryComponent = () => {\n  const _arbitraryQuery = useQuery({\n    queryKey: [\"arbitraryQuery\"],\n    queryFn: () => \"banana\",\n  });\n  return <"+"><"+"/>;\n};\n\nlet axiosMock;\n\ndescribe(\"StaffTabComponent Tests\", () => {\n  beforeEach(() => {\n    axiosMock = new AxiosMockAdapter(axios);\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    queryClient.clear();\n  });\n\n  afterEach(() => {\n    axiosMock.restore();\n  });\n\n  test(\"StaffTabComponent Renders\", async () => {\n    axiosMock\n      .onGet(\"/api/coursestaff/course?courseId=1\")\n      .reply(200, courseStaffFixtures.threeStaff);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"StaffTabComponent\n          courseId={1}\n          testIdPrefix={testId}\n          currentUser={currentUserFixtures.instructorUser}\n        />\n      <"+"/QueryClientProvider>,\n    );\n\n    const rsTestId = \"InstructorCourseShowPage-CourseStaffTable\";\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-0-col-id`),\n      ).toBeInTheDocument();\n    });\n\n    expect(\n      screen.getByTestId(`InstructorCourseShowPage-StaffTabComponent`),\n    ).toBeInTheDocument();\n\n    expect(\n      screen.getByTestId(`${rsTestId}-cell-row-0-col-id`),\n    ).toHaveTextContent(courseStaffFixtures.threeStaff[0].id);\n\n    const staffFirstName0 = screen.getByText(\n      courseStaffFixtures.threeStaff[0].firstName,\n    );\n    expect(staffFirstName0).toBeInTheDocument();\n\n    const staffId0 = screen.getByTestId(`${rsTestId}-cell-row-0-col-id`);\n    expect(staffId0).toHaveTextContent(courseStaffFixtures.threeStaff[0].id);\n  });\n\n  test(\"Table Renders with no students\", async () => {\n    axiosMock.onGet(\"/api/coursestaff/course?courseId=7\").reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"StaffTabComponent\n          courseId={7}\n          testIdPrefix={testId}\n          currentUser={currentUserFixtures.instructorUser}\n        />\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\n          \"InstructorCourseShowPage-CourseStaffTable-header-id\",\n        ),\n      ).toBeInTheDocument();\n    });\n\n    expect(\n      screen.queryByTestId(`${testId}-cell-row-0-col-id`),\n    ).not.toBeInTheDocument();\n\n    const expectedHeaders = [\"id\", \"First Name\", \"Last Name\", \"Email\"];\n    const expectedFields = [\"id\", \"firstName\", \"lastName\", \"email\"];\n\n    // assert\n    expectedHeaders.forEach((headerText, index) => {\n      const header = screen.getByTestId(\n        `InstructorCourseShowPage-CourseStaffTable-header-${expectedFields[index]}`,\n      );\n      expect(header).toHaveTextContent(headerText);\n    });\n\n    expectedFields.forEach((field) => {\n      const fieldElement = screen.queryByTestId(\n        `${testId}-cell-row-0-col-${field}`,\n      );\n      expect(fieldElement).not.toBeInTheDocument();\n    });\n    expect(screen.queryByTestId(`${testId}-csv-modal`)).not.toBeInTheDocument();\n    expect(\n      screen.queryByTestId(`${testId}-post-modal`),\n    ).not.toBeInTheDocument();\n  });\n\n  test(\"StaffForm submit works and clears search filter\", async () => {\n    const queryClientSpecific = new QueryClient({\n      defaultOptions: {\n        queries: {\n          retry: false,\n          staleTime: Infinity,\n        },\n      },\n    });\n    axiosMock\n      .onGet(\"/api/coursestaff/course?courseId=7\")\n      .reply(200, courseStaffFixtures.threeStaff);\n\n    axiosMock.onPost(\"/api/coursestaff/post\").reply(200);\n    render(\n      <"+"QueryClientProvider client={queryClientSpecific}>\n        <"+"ArbitraryTestQueryComponent />\n        <"+"StaffTabComponent\n          courseId={7}\n          testIdPrefix={testId}\n          currentUser={currentUserFixtures.instructorUser}\n        />\n      <"+"/QueryClientProvider>,\n    );\n\n    //Great time to check initial values\n    expect(\n      queryClientSpecific.getQueryData([\"/api/coursestaff/course?courseId=7\"]),\n    ).toStrictEqual([]);\n\n    const openModal = await screen.findByTestId(`${testId}-post-button`);\n    const arbitraryUpdateCount = queryClientSpecific.getQueryState([\n      \"arbitraryQuery\",\n    ]).dataUpdateCount;\n    const updateCountStudent = queryClientSpecific.getQueryState([\n      \"/api/coursestaff/course?courseId=7\",\n    ]).dataUpdateCount;\n\n    fireEvent.click(openModal);\n    await screen.findByLabelText(\"First Name\");\n    expect(screen.getByTestId(`${testId}-post-modal`)).toHaveClass(\n      \"modal-dialog modal-dialog-centered\",\n    );\n\n    // Get the search input and set a search term\n    const searchInput = screen.getByTestId(\"InstructorCourseShowPage-search\");\n    fireEvent.change(searchInput, { target: { value: \"test search\" } });\n    expect(searchInput.value).toBe(\"test search\");\n\n    expect(screen.queryByText(\"Cancel\")).not.toBeInTheDocument();\n    fireEvent.change(screen.getByLabelText(\"First Name\"), {\n      target: { value: \"Chris\" },\n    });\n    fireEvent.change(screen.getByLabelText(\"Last Name\"), {\n
