     target: { value: \"Gaucho\" },\n    });\n    fireEvent.change(screen.getByLabelText(\"Email\"), {\n      target: { value: \"cgaucho@ucsb.edu\" },\n    });\n    fireEvent.click(screen.getByTestId(\"CourseStaffForm-submit\"));\n    await waitFor(() => expect(axiosMock.history.post.length).toEqual(1));\n    expect(axiosMock.history.post[0].params).toEqual({\n      courseId: 7,\n      firstName: \"Chris\",\n      lastName: \"Gaucho\",\n      email: \"cgaucho@ucsb.edu\",\n    });\n    await waitFor(() => expect(mockToast).toBeCalled());\n    expect(mockToast).toBeCalledWith(\"Staff roster successfully updated.\");\n    expect(\n      queryClientSpecific.getQueryState([\"arbitraryQuery\"]).dataUpdateCount,\n    ).toBe(arbitraryUpdateCount);\n    expect(\n      queryClientSpecific.getQueryState([\"/api/coursestaff/course?courseId=7\"])\n        .dataUpdateCount,\n    ).toEqual(updateCountStudent + 1);\n\n    // Verify that the search filter is cleared\n    await waitFor(() => {\n      expect(searchInput.value).toBe(\"\");\n    });\n    expect(\n      screen.queryByTestId(`${testId}-post-modal`),\n    ).not.toBeInTheDocument();\n  });\n\n  describe(\"Search filter works correctly\", () => {\n    const testId = \"InstructorCourseShowPage\";\n    const rsTestId = \"InstructorCourseShowPage-CourseStaffTable\";\n    const staffList = [\n      ...courseStaffFixtures.staffWithEachStatus,\n      {\n        id: 7,\n        firstName: \"Fake\",\n        lastName: \"Name\",\n        email: \"fakename@ucsb.edu\",\n        githubLogin: \"DifferingGitHub\",\n        orgStatus: \"JOINCOURSE\",\n      },\n    ];\n\n    beforeEach(() => {\n      axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.reset();\n      axiosMock.resetHistory();\n      axiosMock\n        .onGet(\"/api/coursestaff/course?courseId=1\")\n        .reply(200, staffList);\n      queryClient.clear();\n    });\n\n    test(\"Placeholder, initial check\", async () => {\n      render(\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"StaffTabComponent\n            courseId={1}\n            testIdPrefix={testId}\n            currentUser={currentUserFixtures.instructorUser}\n          />\n        <"+"/QueryClientProvider>,\n      );\n      await waitFor(() => {\n        expect(\n          screen.getByTestId(`${rsTestId}-cell-row-0-col-id`),\n        ).toBeInTheDocument();\n      });\n\n      const searchInput = screen.getByTestId(`${testId}-search`);\n      expect(searchInput).toBeInTheDocument();\n      expect(searchInput).toHaveAttribute(\n        \"placeholder\",\n        \"Search by name, email, or Github Login\",\n      );\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-0-col-firstName`),\n      ).toBeInTheDocument();\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-1-col-firstName`),\n      ).toBeInTheDocument();\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-2-col-firstName`),\n      ).toBeInTheDocument();\n    });\n\n    test(\"First Name, Email\", async () => {\n      render(\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"StaffTabComponent\n            courseId={1}\n            testIdPrefix={testId}\n            currentUser={currentUserFixtures.instructorUser}\n          />\n        <"+"/QueryClientProvider>,\n      );\n\n      await waitFor(() => {\n        expect(\n          screen.getByTestId(`${rsTestId}-cell-row-0-col-id`),\n        ).toBeInTheDocument();\n      });\n\n      // Verify search input is rendered\n      const searchInput = screen.getByTestId(`${testId}-search`);\n\n      const fullNameStaff = courseStaffFixtures.staffWithEachStatus[2]; // Emma Watson\n      fireEvent.change(searchInput, {\n        target: {\n          value:\n            `${fullNameStaff.firstName} ${fullNameStaff.lastName}`.toUpperCase(),\n        },\n      });\n\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-0-col-firstName`),\n      ).toHaveTextContent(fullNameStaff.firstName);\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-0-col-lastName`),\n      ).toHaveTextContent(fullNameStaff.lastName);\n      expect(\n        screen.queryByTestId(`${rsTestId}-cell-row-1-col-firstName`),\n      ).not.toBeInTheDocument();\n\n      fireEvent.change(searchInput, { target: { value: \"\" } });\n\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-0-col-firstName`),\n      ).toBeInTheDocument();\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-1-col-firstName`),\n      ).toBeInTheDocument();\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-2-col-firstName`),\n      ).toBeInTheDocument();\n\n      fireEvent.change(searchInput, {\n        target: {\n          value: courseStaffFixtures.staffWithEachStatus[1].email.toUpperCase(),\n        },\n      });\n\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-0-col-email`),\n      ).toHaveTextContent(courseStaffFixtures.staffWithEachStatus[1].email);\n      expect(\n        screen.queryByTestId(`${rsTestId}-cell-row-1-col-email`),\n      ).not.toBeInTheDocument();\n    });\n\n    test(\"GitHub Login, Student ID\", async () => {\n      render(\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"StaffTabComponent\n            courseId={1}\n            testIdPrefix={testId}\n            currentUser={currentUserFixtures.instructorUser}\n          />\n        <"+"/QueryClientProvider>,\n      );\n      await waitFor(() => {\n        expect(\n          screen.getByTestId(`${rsTestId}-cell-row-0-col-id`),\n        ).toBeInTheDocument();\n      });\n\n      const searchInput = screen.getByTestId(`${testId}-search`);\n      const staffWithGithub = staffList[6].githubLogin;\n      fireEvent.change(searchInput, {\n        target: { value: staffWithGithub.toUpperCase() },\n      });\n\n      expect(\n        screen.getByTestId(`${rsTestId}-cell-row-0-col-githubLogin`),\n      ).toHaveTextContent(staffWithGithub);\n      expect(\n        screen.queryByTestId(`${rsTestId}-cell-row-1-col-firstName`),\n      ).not.toBeInTheDocument();\n    });\n  });\n\n  test(\"for coming soon tooltip on disabled upload CSV button\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"StaffTabComponent\n          courseId={1}\n          testIdPrefix={testId}\n          currentUser={currentUserFixtures.instructorUser}\n        />\n      <"+"/QueryClientProvider>,\n    );\n\n    // Wait for table to render\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(`${testId}-CourseStaffTable`),\n      ).toBeInTheDocument();\n    });\n\n    // Find the disabled buttons\n    const uploadCsvButton = screen.getByTestId(`${testId}-csv-button`);\n    expect(uploadCsvButton).toBeDisabled();\n    expect(uploadCsvButton).toHaveStyle({ pointerEvents: \"none\" });\n\n    // Simulate mouse over to trigger tooltip\n    fireEvent.mouseOver(uploadCsvButton);\n\n    // Tooltip should appear\n    await waitFor(() => {\n      expect(screen.getByText(\"Coming Soon\")).toBeInTheDocument();\n    });\n  });\n\n  test(\"for coming soon tooltip on disabled download CSV button\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"StaffTabComponent\n          courseId={1}\n          testIdPrefix={testId}\n          currentUser={currentUserFixtures.instructorUser}\n        />\n      <"+"/QueryClientProvider>,\n    );\n\n    // Wait for table to render\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(`${testId}-CourseStaffTable`),\n      ).toBeInTheDocument();\n    });\n\n    // Download CSV button (no testId, but can find by text)\n    const downloadCsvButton = screen.getByText(\"Download Staff CSV\");\n    expect(downloadCsvButton).toBeDisabled();\n    expect(downloadCsvButton).toHaveStyle(\"pointerEvents: none\");\n    fireEvent.mouseOver(downloadCsvButton);\n\n    await waitFor(() => {\n      expect(screen.getByText(\"Coming Soon\")).toBeInTheDocument();\n    });\n  });\n\n  test(\"Create Staff Member Modals closes on close button\", async () => {\n    const download = vi.fn();\n    window.open = (a, b) => download(a, b);\n    axiosMock\n      .onGet(\"/api/coursestaff/course?courseId=1\")\n      .reply(200, courseStaffFixtures.threeStaff);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"ArbitraryTestQueryComponent />\n        <"+"StaffTabComponent\n          courseId={7}\n          testIdPrefix={testId}\n          currentUser={currentUserFixtures.instructorUser}\n        />\n      <"+"/QueryClientProvider>,\n    );\n\n    const openModalPost = await screen.findByTestId(`${testId}-post-button`);\n    fireEvent.click(openModalPost);\n    let closeButton = await screen.findByRole(\"button\", { name: \"Close\" });\n    fireEvent.click(closeButton);\n    await waitFor(() =>\n      expect(\n        screen.queryByTestId(`${testId}-post-modal`),\n      ).not.toBeInTheDocument(),\n    );\n  });\n});\n"},"src/tests/components/Teams/TeamsTable.test.jsx":{"tests":[{"id":"137","name":"TeamsTable tests table renders corretly when there are teams"},{"id":"138","name":"TeamsTable tests nothing renders when teams are empty"},{"id":"139","name":"TeamsTable tests If the user is not an instructor/admin, remove buttons are not rendered"},{"id":"140","name":"TeamsTable tests delete team calls correct API endpoint with correct params"},{"id":"141","name":"TeamsTable tests delete member calls correct API endpoint with correct params"},{"id":"142","name":"TeamsTable tests add member calls correct API endpoint with correct params"},{"id":"143","name":"TeamsTable tests add member returns 409 error modal when member is already in the team"},{"id":"144","name":"TeamsTable tests add member returns generic error modal an unexpected error occurs"},{"id":"145","name":"TeamsTable tests modal closes when onHide is triggered"},{"id":"146","name":"TeamsTable tests TeamsForm submit works and clears search filter"}],"source":"import { render, screen, fireEvent, waitFor } from \"@testing-library/react\";\nimport { teamsFixtures } from \"fixtures/TeamsFixtures\";\nimport TeamsTable from \"main/components/Teams/TeamsTable\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { expect, test, vi } from \"vitest\";\n\nconst queryClient = new QueryClient();\nconst axiosMock = new AxiosMockAdapter(axios);\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async (importOriginal) => {\n  return {\n    ...(await importOriginal()),\n    toast: (x) => mockToast(x),\n  };\n});\ndescribe(\"TeamsTable tests\", () => {\n  let invalidateQueriesSpy;\n\n  const expectedHeaders = [\n    \"rosterStudent.firstName\",\n    \"rosterStudent.lastName\",\n    \"rosterStudent.email\",\n    \"rosterStudent.githubLogin\",\n    \"rosterStudent.id\",\n  ];\n  const expectedFields = [\n    \"Roster Student ID\",\n    \"First Name\",\n    \"Last Name\",\n    \"Email\",\n    \"GitHub Login\",\n  ];\n\n  const testId = \"TeamsTable\";\n\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    queryClient.clear();\n    mockToast.mockClear();\n\n    invalidateQueriesSpy = vi.spyOn(queryClient, \"invalidateQueries\");\n  });\n  test(\"table renders corretly when there are teams\", () => {\n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"TeamsTable\n            teams={[teamsFixtures.teams[0]]}\n            currentUser={currentUser}\n            courseId=\"12\"\n            testIdPrefix={testId}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.getByText(\"team1\")).toBeInTheDocument();\n\n    // assert\n    expectedHeaders.forEach((headerText) => {\n      expect(\n        screen.getByTestId(`${testId}-3-members-table-header-${headerText}`),\n      ).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((expectedField) => {\n      const header = screen.getByText(expectedField);\n      expect(header).toBeInTheDocument();\n    });\n  });\n  test(\"nothing renders when teams are empty\", () => {\n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"TeamsTable\n            teams={[]}\n            currentUser={currentUser}\n            courseId=\"12\"\n            testIdPrefix={testId}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    // assert\n    expectedHeaders.forEach((headerText) => {\n      expect(\n        screen.queryByText(`${testId}-3-members-table-header-${headerText}`),\n      ).not.toBeInTheDocument();\n    });\n  });\n  test(\"If the user is not an instructor/admin, remove buttons are not rendered\", async () => {\n    // arrange\n    const currentUser = currentUserFixtures.studentUser;\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"TeamsTable\n            teams={[teamsFixtures.teams[0]]}\n            currentUser={currentUser}\n            courseId=\"12\"\n            testIdPrefix={testId}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Expand the accordion\n    const teamAccordion = screen.getByTestId(\"TeamsTable-3-name\");\n    fireEvent.click(teamAccordion);\n\n    expect(\n      screen.queryByTestId(\"TeamsTable-3-cell-row-0-col-Remove-button\"),\n    ).not.toBeInTheDocument();\n  });\n  test(\"delete team calls correct API endpoint with correct params\", async () => {\n    const successMessage = \"Team removed successfully\";\n    axiosMock.onDelete(\"/api/teams\").reply(200, { successMessage });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"TeamsTable\n            teams={teamsFixtures.teams}\n            currentUser={currentUserFixtures.adminUser}\n            courseId=\"12\"\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const deleteButton = screen.getByTestId(\"TeamsTable-3-delete-button\");\n    fireEvent.click(deleteButton);\n\n    await waitFor(() => {\n      expect(axiosMock.history.delete.length).toBe(1);\n    });\n\n    // This verifies cellToAxiosParamDeleteTeam worked correctly\n    expect(axiosMock.history.delete[0].url).toBe(\"/api/teams\");\n    expect(axiosMock.history.delete[0].params).toEqual({\n      id: 3,\n      courseId: \"12\",\n    });\n\n    expect(invalidateQueriesSpy).toHaveBeenCalledTimes(1);\n    expect(invalidateQueriesSpy).toHaveBeenCalledWith({\n      queryKey: [\"/api/teams/all?courseId=12\"],\n    });\n\n    expect(mockToast).toHaveBeenCalledWith(successMessage);\n  });\n  test(\"delete member calls correct API endpoint with correct params\", async () => {\n    const successMessage = \"Member removed successfully\";\n    axiosMock\n      .onDelete(\"/api/teams/removeMember\")\n      .reply(200, { successMessage });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"TeamsTable\n            teams={teamsFixtures.teams}\n            currentUser={currentUserFixtures.instructorUser}\n            courseId=\"12\"\n            testIdPrefix=\"TeamsTable\"\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Expand the accordion\n    const teamAccordion = screen.getByTestId(\"TeamsTable-3-name\");\n    fireEvent.click(teamAccordion);\n\n    // Wait for the remove button to appear and get the element\n    const deleteButton = await screen.findByTestId(\n      \"TeamsTable-3-cell-row-0-col-Remove-button\",\n    );\n\n    expect(deleteButton).toHaveClass(\"btn-danger\");\n\n    fireEvent.click(deleteButton);\n\n    await waitFor(() => {\n      expect(axiosMock.history.delete.length).toBe(1);\n    });\n\n    expect(axiosMock.history.delete[0].url).toBe(\"/api/teams/removeMember\");\n    expect(axiosMock.history.delete[0].params).toEqual({\n      teamMemberId: 4,\n      courseId: \"12\",\n    });\n\n    expect(invalidateQueriesSpy).toHaveBeenCalledTimes(1);\n    expect(invalidateQueriesSpy).toHaveBeenCalledWith({\n      queryKey: [\"/api/teams/all?courseId=12\"],\n    });\n\n    expect(mockToast).toHaveBeenCalledWith(successMessage);\n  });\n  test(\"add member calls correct API endpoint with correct params\", async () => {\n    const successMessage = \"Member added successfully\";\n    axiosMock.onPost(\"/api/teams/addMember\").reply(200, { successMessage });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"TeamsTable\n            teams={teamsFixtures.teams}\n            currentUser={currentUserFixtures.instructorUser}\n            courseId=\"12\"\n            testIdPrefix=\"TeamsTable\"\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Wait for the add button to appear and get the element\n    const addButton = await screen.findByTestId(\n      \"TeamsTable-3-add-member-button\",\n    );\n\n    expect(addButton).toHaveClass(\"me-3\");\n\n    expect(\n      screen.queryByTestId(\"TeamsTable-post-modal\"),\n    ).not.toBeInTheDocument();\n\n    fireEvent.click(addButton);\n\n    const input = await screen.findByTestId(\"TeamMemberForm-rosterStudentId\");\n    fireEvent.change(input, { target: { value: 4 } });\n\n    expect(screen.queryByTestId(\"TeamsTable-post-modal\")).toBeInTheDocument();\n\n    const submitButton = screen.getByTestId(\"TeamMemberForm-submit\");\n    fireEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(axiosMock.history.post.length).toBe(1);\n    });\n\n    expect(axiosMock.history.post[0].url).toBe(\"/api/teams/addMember\");\n    expect(axiosMock.history.post[0].params).toEqual({\n      rosterStudentId: \"4\",\n      courseId: \"12\",\n      teamId: 3,\n    });\n\n    expect(invalidateQueriesSpy).toHaveBeenCalledTimes(1);\n    expect(invalidateQueriesSpy).toHaveBeenCalledWith({\n      queryKey: [\"/api/teams/all?courseId=12\"],\n    });\n\n    expect(mockToast).toHaveBeenCalledWith(successMessage);\n\n    await waitFor(() => {\n      expect(\n        screen.queryByTestId(\"TeamsTable-post-modal\"),\n      ).not.toBeInTheDocument();\n    });\n  });\n  test(\"add member returns 409 error modal when member is already in the team\", async () => {\n    axiosMock.onPost(\"/api/teams/addMember\").reply(409);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"TeamsTable\n            teams={teamsFixtures.teams}\n            currentUser={currentUserFixtures.instructorUser}\n            courseId=\"12\"\n            testIdPrefix=\"TeamsTable\"\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Wait for the add button to appear and get the element\n    const addButton = await screen.findByTestId(\n      \"TeamsTable-3-add-member-button\",\n    );\n\n    expect(addButton).toHaveClass(\"me-3\");\n\n    expect(\n      screen.queryByTestId(\"TeamsTable-post-modal\"),\n    ).not.toBeInTheDocument();\n\n    fireEvent.click(addButton);\n\n    const input = await screen.findByTestId(\"TeamMemberForm-rosterStudentId\");\n    fireEvent.change(input, { target: { value: 4 } });\n\n    expect(screen.queryByTestId(\"TeamsTable-post-modal\")).toBeInTheDocument();\n\n    const submitButton = screen.getByTestId(\"TeamMemberForm-submit\");\n    fireEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(\n        screen.queryByTestId(\"TeamsTable-post-modal\"),\n      ).not.toBeInTheDocument();\n    });\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(`${testId}-error-post-member-modal`),\n      ).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-error-post-member-modal`)).toHaveClass(\n      \"modal-dialog modal-dialog-centered\",\n    );\n\n    expect(\n      screen.getByTestId(`${testId}-error-post-member-modal`),\n    ).toHaveTextContent(\"This member is already in this team.\");\n\n    const closeButton = screen.getByLabelText(\"Close\");\n    fireEvent.click(closeButton);\n\n    await waitFor(() => {\n      expect(\n        screen.queryByTestId(`${testId}-error-post-member-modal`),\n      ).not.toBeInTheDocument();\n    });\n  });\n  test(\"add member returns generic error modal an unexpected error occurs\", async () => {\n    axiosMock.onPost(\"/api/teams/addMember\").reply(500);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"TeamsTable\n            teams={teamsFixtures.teams}\n            currentUser={currentUserFixtures.instructorUser}\n            courseId=\"12\"\n            testIdPrefix=\"TeamsTable\"\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Wait for the add button to appear and get the element\n    const addButton = await screen.findByTestId(\n      \"TeamsTable-3-add-member-button\",\n    );\n\n    expect(addButton).toHaveClass(\"me-3\");\n\n    expect(\n      screen.queryByTestId(\"TeamsTable-post-modal\"),\n    ).not.toBeInTheDocument();\n\n    fireEvent.click(addButton);\n\n    const input = await screen.findByTestId(\"TeamMemberForm-rosterStudentId\");\n    fireEvent.change(input, { target: { value: 4 } });\n\n    expect(screen.queryByTestId(\"TeamsTable-post-modal\")).toBeInTheDocument();\n\n    const submitButton = screen.getByTestId(\"TeamMemberForm-submit\");\n    fireEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(\n        screen.queryByTestId(\"TeamsTable-post-modal\"),\n      ).not.toBeInTheDocument();\n    });\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(`${testId}-error-post-member-modal`),\n      ).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-error-post-member-modal`)).toHaveClass(\n      \"modal-dialog modal-dialog-centered\",\n    );\n\n    expect(\n      screen.getByTestId(`${testId}-error-post-member-modal`),\n    ).toHaveTextContent(\"500 error occurred while adding member to the team.\");\n\n    const closeButton = screen.getByLabelText(\"Close\");\n    fireEvent.click(closeButton);\n\n    await waitFor(() => {\n      expect(\n        screen.queryByTestId(`${testId}-error-post-member-modal`),\n      ).not.toBeInTheDocument();\n    });\n  });\n  test(\"modal closes when onHide is triggered\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"TeamsTable\n            teams={teamsFixtures.teams}\n            currentUser={currentUserFixtures.instructorUser}\n            courseId=\"12\"\n            testIdPrefix=\"TeamsTable\"\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const addButton = await screen.findByTestId(\n      \"TeamsTable-3-add-member-button\",\n    );\n\n    expect(addButton).toHaveClass(\"me-3\");\n\n    expect(\n      screen.queryByTestId(\"TeamsTable-post-modal\"),\n    ).not.toBeInTheDocument();\n\n    fireEvent.click(addButton);\n\n    // modal should be visible\n    expect(screen.getByTestId(\"TeamsTable-post-modal\")).toBeInTheDocument();\n\n    // trigger the bootstrap onHide\n    fireEvent.click(screen.getByLabelText(\"Close\"));\n\n    await waitFor(() => {\n      expect(\n        screen.queryByTestId(\"TeamsTable-post-modal\"),\n      ).not.toBeInTheDocument();\n    });\n  });\n  test(\"TeamsForm submit works and clears search filter\", async () => {\n    axiosMock.onPost(\"/api/teams/post\").reply(200);\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"TeamsTable\n            teams={teamsFixtures.teams}\n            currentUser={currentUserFixtures.instructorUser}\n            courseId=\"12\"\n            testIdPrefix=\"TeamsTable\"\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const addButton = await screen.findByTestId(\n      \"TeamsTable-3-add-member-button\",\n    );\n    expect(addButton).toHaveClass(\"me-3\");\n\n    expect(\n      screen.queryByTestId(`${testId}-post-modal`),\n    ).not.toBeInTheDocument();\n\n    fireEvent.click(addButton);\n    await screen.findByLabelText(\"Roster Student ID\");\n\n    expect(screen.getByTestId(`${testId}-post-modal`)).toHaveClass(\n      \"modal-dialog modal-dialog-centered\",\n    );\n  });\n});\n"},"src/tests/pages/Instructor/InstructorCourseShowPage.test.jsx":{"tests":[{"id":"147","name":"InstructorCourseShowPage tests renders correctly for instructor user"},{"id":"148","name":"InstructorCourseShowPage tests Returns to course page on timeout"},{"id":"149","name":"InstructorCourseShowPage tests Cleans up correctly on unmount"},{"id":"150","name":"InstructorCourseShowPage tests Tab assertions"},{"id":"151","name":"InstructorCourseShowPage tests Tab Components are Present"},{"id":"152","name":"InstructorCourseShowPage tests header displays correct info when course is loaded without an installationId"},{"id":"153","name":"InstructorCourseShowPage tests header displays correct info when course is loaded"},{"id":"154","name":"InstructorCourseShowPage tests expect the correct URL to the organization for the course"},{"id":"155","name":"InstructorCourseShowPage tests expect the correct tooltip ID and message for the github icon (that redirects to github installation settings)"},{"id":"156","name":"InstructorCourseShowPage tests does not show error modal on initial render"}],"source":"import {\n  act,\n  fireEvent,\n  render,\n  screen,\n  waitFor,\n  within,\n} from \"@testing-library/react\";\nimport InstructorCourseShowPage from \"main/pages/Instructor/InstructorCourseShowPage\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter, Route, Routes } from \"react-router\";\nimport coursesFixtures from \"fixtures/coursesFixtures\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { rosterStudentFixtures } from \"fixtures/rosterStudentFixtures\";\nimport { vi } from \"vitest\";\n\nconst mockedNavigate = vi.fn();\nvi.mock(\"react-router\", async (importOriginal) => ({\n  ...(await importOriginal()),\n  useNavigate: () => mockedNavigate,\n}));\nconst axiosMock = new AxiosMockAdapter(axios);\nconst queryClient = new QueryClient();\n\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async (importOriginal) => {\n  return {\n    ...(await importOriginal()),\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"InstructorCourseShowPage tests\", () => {\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    queryClient.clear();\n  });\n\n  const setupInstructorUser = () => {\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.instructorUser);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  };\n\n  test(\"renders correctly for instructor user\", async () => {\n    vi.useFakeTimers({\n      shouldAdvanceTime: true,\n      toFake: [\"setTimeout\", \"clearTimeout\"],\n    });\n    setupInstructorUser();\n    const theCourse = {\n      ...coursesFixtures.oneCourseWithEachStatus[0],\n      id: 1,\n      createdByEmail: \"phtcon@ucsb.edu\",\n    };\n    axiosMock.onGet(\"/api/courses/1\").reply(200, theCourse);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter initialEntries={[\"/instructor/courses/1\"]}>\n          <"+"Routes>\n            <"+"Route\n              path=\"/instructor/courses/:id\"\n              element={<"+"InstructorCourseShowPage />}\n            />\n          <"+"/Routes>\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const testId = \"InstructorCourseShowPage\";\n\n    await waitFor(() => {\n      expect(screen.getByTestId(`${testId}-title`)).toHaveTextContent(\n        \"CMPSC 156\",\n      );\n    });\n\n    expect(screen.queryByText(\"ucsb-cs156-s25\")).not.toBeInTheDocument();\n\n    expect(screen.queryByText(\"Course Not Found\")).not.toBeInTheDocument();\n    vi.advanceTimersByTime(3000);\n    expect(mockedNavigate).not.toHaveBeenCalled();\n    vi.useRealTimers();\n  });\n\n  test(\"Returns to course page on timeout\", async () => {\n    vi.useFakeTimers({\n      shouldAdvanceTime: true,\n      toFake: [\"setTimeout\", \"clearTimeout\"],\n    });\n    axiosMock.onGet(\"/api/courses/7\").timeout();\n    axiosMock.onGet(\"/api/rosterstudents/course/7\").timeout();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter initialEntries={[\"/instructor/courses/7\"]}>\n          <"+"Routes>\n            <"+"Route\n              path=\"/instructor/courses/:id\"\n              element={<"+"InstructorCourseShowPage />}\n            />\n          <"+"/Routes>\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    //Great time to also check initial values\n    expect(queryClient.getQueryData([\"/api/courses/7\"])).toBe(null);\n    const testId = \"InstructorCourseShowPage\";\n\n    await screen.findByTestId(`${testId}-title`);\n\n    const courseName = screen.getByTestId(`${testId}-title`);\n    expect(courseName).toHaveTextContent(\"Course: Loading...\");\n\n    await screen.findByText(\n      \"Course not found. You will be returned to the course list in 3 seconds.\",\n    );\n    expect(mockToast).not.toHaveBeenCalled();\n    expect(screen.getByText(\"Course Not Found\")).toBeInTheDocument();\n    expect(screen.getByText(\"Close\")).toHaveClass(\"btn-primary\");\n    fireEvent.click(screen.getByText(\"Close\"));\n    await waitFor(() =>\n      expect(screen.queryByText(\"Course Not Found\")).not.toBeInTheDocument(),\n    );\n    act(() => {\n      vi.advanceTimersByTime(5000);\n    });\n    expect(mockedNavigate).toHaveBeenCalledWith(\"/\", {\n      replace: true,\n    });\n    expect(mockedNavigate).toHaveBeenCalledTimes(1);\n    vi.useRealTimers();\n  });\n\n  test(\"Cleans up correctly on unmount\", async () => {\n    vi.useFakeTimers({\n      shouldAdvanceTime: true,\n      toFake: [\"setTimeout\", \"clearTimeout\"],\n    });\n    axiosMock.onGet(\"/api/courses/7\").timeout();\n    axiosMock.onGet(\"/api/rosterstudents/course/7\").timeout();\n    const specificQueryClient = new QueryClient({\n      defaultOptions: {\n        queries: {\n          retry: false,\n        },\n      },\n    });\n    const setTimeoutSpy = vi.spyOn(globalThis, \"setTimeout\");\n    const clearTimeoutSpy = vi.spyOn(globalThis, \"clearTimeout\");\n    render(\n      <"+"QueryClientProvider client={specificQueryClient}>\n        <"+"MemoryRouter initialEntries={[\"/instructor/courses/7\"]}>\n          <"+"Routes>\n            <"+"Route\n              path=\"/instructor/courses/:id\"\n              element={<"+"InstructorCourseShowPage />}\n            />\n          <"+"/Routes>\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\n      \"Course not found. You will be returned to the course list in 3 seconds.\",\n    );\n    expect(\n      screen.queryByTestId(`InstructorCourseShowPage-cell-row-0-col-id`),\n    ).not.toBeInTheDocument();\n    fireEvent.keyPress(screen.getByText(\"Course Not Found\"), {\n      key: \"Escape\",\n      code: 27,\n      charCode: 27,\n    });\n    fireEvent.click(\n      within(screen.getByTestId(\"AppNavbar\")).getByText(\"Frontiers\"),\n    );\n    await waitFor(() =>\n      expect(clearTimeoutSpy.mock.results.length).toBeGreaterThanOrEqual(12),\n    );\n    setTimeoutSpy.mockRestore();\n    clearTimeoutSpy.mockRestore();\n    vi.useRealTimers();\n    specificQueryClient.clear();\n  });\n\n  test(\"Tab assertions\", () => {\n    setupInstructorUser();\n\n    const theCourse = {\n      ...coursesFixtures.oneCourseWithEachStatus[0],\n      id: 1,\n      createdByEmail: \"phtcon@ucsb.edu\",\n    };\n\n    axiosMock.onGet(\"/api/courses/7\").reply(200, theCourse);\n\n    axiosMock\n      .onGet(\"/api/rosterstudents/course/7\")\n      .reply(200, rosterStudentFixtures.threeStudents);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter initialEntries={[\"/instructor/courses/7\"]}>\n          <"+"Routes>\n            <"+"Route\n              path=\"/instructor/courses/:id\"\n              element={<"+"InstructorCourseShowPage />}\n            />\n          <"+"/Routes>\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.getByText(\"Students\")).toHaveAttribute(\n      \"data-rr-ui-event-key\",\n      \"students\",\n    );\n    expect(screen.getByRole(\"tab\", { name: \"Staff\" })).toHaveAttribute(\n      \"data-rr-ui-event-key\",\n      \"staff\",\n    );\n    expect(screen.getByRole(\"tab\", { name: \"Teams\" })).toHaveAttribute(\n      \"data-rr-ui-event-key\",\n      \"teams\",\n    );\n    expect(screen.getByText(\"Assignments\")).toHaveAttribute(\n      \"data-rr-ui-event-key\",\n      \"default\",\n    );\n    expect(screen.getByText(\"Assignments\")).toHaveAttribute(\n      \"aria-selected\",\n      \"true\",\n    );\n    const changeTabs = screen.getByText(\"Students\");\n    fireEvent.click(changeTabs);\n  });\n\n  test(\"Tab Components are Present\", async () => {\n    const queryClientSpecific = new QueryClient({\n      defaultOptions: {\n        queries: {\n          retry: false,\n          staleTime: Infinity,\n        },\n      },\n    });\n    setupInstructorUser();\n    const theCourse = {\n      ...coursesFixtures.oneCourseWithEachStatus[0],\n      id: 1,\n      createdByEmail: \"phtcon@ucsb.edu\",\n    };\n\n    axiosMock.onGet(\"/api/courses/7\").reply(200, theCourse);\n    render(\n      <"+"QueryClientProvider client={queryClientSpecific}>\n        <"+"MemoryRouter initialEntries={[\"/instructor/courses/7\"]}>\n          <"+"Routes>\n            <"+"Route\n              path=\"/instructor/courses/:id\"\n              element={<"+"InstructorCourseShowPage />}\n            />\n          <"+"/Routes>\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByTestId(\"AssignmentTabComponent\");\n    expect(\n      screen.getByTestId(\"InstructorCourseShowPage-EnrollmentTabComponent\"),\n    ).toBeInTheDocument();\n  });\n  test(\"header displays correct info when course is loaded without an installationId\", async () => {\n    setupInstructorUser();\n\n    axiosMock\n      .onGet(\"/api/courses/7\")\n      .reply(200, coursesFixtures.severalCourses[2]);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter initialEntries={[\"/instructor/courses/7\"]}>\n          <"+"Routes>\n            <"+"Route\n              path=\"/instructor/courses/:id\"\n              element={<"+"InstructorCourseShowPage />}\n            />\n          <"+"/Routes>\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"CMPSC 156 Fall 2025\");\n\n    expect(\n      screen.getByTestId(\"InstructorCourseShowPage-title\"),\n    ).toBeInTheDocument();\n    expect(\n      screen.queryByTestId(\"InstructorCourseShowPage-github-org-link\"),\n    ).not.toBeInTheDocument();\n    expect(\n      screen.queryByTestId(\"InstructorCourseShowPage-tooltip-github-settings\"),\n    ).not.toBeInTheDocument();\n  });\n  test(\"header displays correct info when course is loaded\", async () => {\n    setupInstructorUser();\n\n    axiosMock\n      .onGet(\"/api/courses/7\")\n      .reply(200, coursesFixtures.severalCourses[0]);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter initialEntries={[\"/instructor/courses/7\"]}>\n          <"+"Routes>\n            <"+"Route\n              path=\"/instructor/courses/:id\"\n              element={<"+"InstructorCourseShowPage />}\n            />\n          <"+"/Routes>\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"CMPSC 156\");\n\n    expect(\n      screen.getByTestId(\"InstructorCourseShowPage-title\"),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByTestId(\"InstructorCourseShowPage-github-org-link\"),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByTestId(\"InstructorCourseShowPage-github-org-link\"),\n    ).toHaveAttribute(\"href\", \"https://github.com/ucsb-cs156-s25\");\n    expect(screen.getByText(\"Spring 2025\")).toBeInTheDocument();\n  });\n  test(\"expect the correct URL to the organization for the course\", async () => {\n    setupInstructorUser();\n\n    axiosMock\n      .onGet(\"/api/courses/7\")\n      .reply(200, coursesFixtures.severalCourses[0]);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter initialEntries={[\"/instructor/courses/7\"]}>\n          <"+"Routes>\n            <"+"Route\n              path=\"/instructor/courses/:id\"\n              element={<"+"InstructorCourseShowPage />}\n            />\n          <"+"/Routes>\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"CMPSC 156\");\n\n    const githubLink = screen.getByTestId(\n      `InstructorCourseShowPage-github-settings-link`,\n    );\n    expect(githubLink).toBeInTheDocument();\n    expect(githubLink).toHaveAttribute(\n      \"href\",\n      \"https://github.com/organizations/ucsb-cs156-s25/settings/installations/123456\",\n    );\n  });\n  test(\"expect the correct tooltip ID and message for the github icon (that redirects to github installation settings)\", async () => {\n    setupInstructorUser();\n\n    axiosMock\n      .onGet(\"/api/courses/7\")\n      .reply(200, coursesFixtures.severalCourses[0]);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter initialEntries={[\"/instructor/courses/7\"]}>\n          <"+"Routes>\n            <"+"Route\n              path=\"/instructor/courses/:id\"\n              element={<"+"InstructorCourseShowPage />}\n            />\n          <"+"/Routes>\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"CMPSC 156\");\n\n    expect(\n      screen.getByTestId(\"InstructorCourseShowPage-github-settings-icon\"),\n    ).toBeInTheDocument();\n\n    fireEvent.mouseOver(\n      screen.getByTestId(`InstructorCourseShowPage-github-settings-icon`),\n    );\n\n    const tooltip = await screen.findByRole(\"tooltip\");\n    expect(tooltip).toHaveAttribute(\n      \"id\",\n      \"InstructorCourseShowPage-tooltip-github-settings\",\n    );\n    expect(tooltip).toHaveTextContent(\n      \"Manage settings for association between your GitHub organization and this web application.\",\n    );\n  });\n  test(\"does not show error modal on initial render\", async () => {\n    setupInstructorUser();\n\n    axiosMock\n      .onGet(\"/api/courses/7\")\n      .reply(200, coursesFixtures.severalCourses[0]);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter initialEntries={[\"/instructor/courses/7\"]}>\n          <"+"Routes>\n            <"+"Route\n              path=\"/instructor/courses/:id\"\n              element={<"+"InstructorCourseShowPage />}\n            />\n          <"+"/Routes>\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"CMPSC 156\");\n\n    expect(screen.queryByRole(\"dialog\")).not.toBeInTheDocument();\n  });\n});\n"},"src/tests/components/Courses/CoursesTable.test.jsx":{"tests":[{"id":"157","name":"CoursesTable tests Has the expected column headers and content"},{"id":"158","name":"CoursesTable tests the loading render"},{"id":"159","name":"CoursesTable tests Calls joinCallback when the button is pressed"},{"id":"160","name":"CoursesTable tests Does not call joinCallback in default case for button'View Invite'"},{"id":"161","name":"CoursesTable tests Does not call joinCallback when storybook is explicitly false for button 'View Invite'"},{"id":"162","name":"CoursesTable tests tooltips for PENDING status"},{"id":"163","name":"CoursesTable tests tooltips for JOINCOURSE status"},{"id":"164","name":"CoursesTable tests tooltips for INVITED status"},{"id":"165","name":"CoursesTable tests tooltips for OWNER status"},{"id":"166","name":"CoursesTable tests tooltips for MEMBER status"},{"id":"167","name":"CoursesTable tests tooltips for an illegal status"},{"id":"168","name":"CoursesTable tests expect the correct tooltip ID"}],"source":"import {\n  render,\n  screen,\n  waitFor,\n  fireEvent,\n  within,\n} from \"@testing-library/react\";\nimport coursesFixtures from \"fixtures/coursesFixtures\";\nimport CoursesTable from \"main/components/Courses/CoursesTable\";\nimport { BrowserRouter } from \"react-router\";\nimport { vi } from \"vitest\";\n\nconst joinCallback = vi.fn();\nconst isLoading = vi.fn(() => false);\n\ndescribe(\"CoursesTable tests\", () => {\n  beforeEach(() => {\n    vi.clearAllMocks();\n  });\n  test(\"Has the expected column headers and content\", () => {\n    render(\n      <"+"BrowserRouter>\n        <"+"CoursesTable\n          courses={coursesFixtures.oneCourseWithEachStatus}\n          testId={\"CoursesTable\"}\n          joinCallback={joinCallback}\n          isLoading={isLoading}\n        />\n      <"+"/BrowserRouter>,\n    );\n\n    const expectedHeaders = [\"id\", \"Course Name\", \"Term\", \"School\", \"Status\"];\n    const expectedFields = [\n      \"id\",\n      \"courseName\",\n      \"term\",\n      \"school\",\n      \"studentStatus\",\n    ];\n    const testId = \"CoursesTable\";\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\n      \"1\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-courseName`),\n    ).toHaveTextContent(\"CMPSC 156\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-term`),\n    ).toHaveTextContent(\"Spring 2025\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-school`),\n    ).toHaveTextContent(\"UCSB\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-studentStatus`),\n    ).toHaveTextContent(\"Pending\");\n\n    const pending = screen.getByText(\"Pending\");\n    expect(pending).toBeInTheDocument();\n    expect(pending).toHaveClass(\"text-warning\");\n\n    const joinCourse = screen.getByText(\"Join Course\");\n    expect(joinCourse).toBeInTheDocument();\n    expect(joinCourse).toHaveAttribute(\"class\", \"btn btn-primary\");\n\n    const member = screen.getByText(\"Member\");\n    expect(member).toBeInTheDocument();\n    expect(member).toHaveClass(\"text-primary\");\n\n    const owner = screen.getByText(\"Owner\");\n    expect(owner).toBeInTheDocument();\n    expect(owner).toHaveClass(\"text-info\");\n\n    const unexpected = screen.getByText(\"Illegal status that will never occur\");\n    expect(unexpected).toBeInTheDocument();\n    expect(unexpected).not.toHaveClass(\"text-danger\");\n\n    // expect that the mocked joinCallback function is not called\n    expect(joinCallback).not.toHaveBeenCalled();\n  });\n\n  test(\"the loading render\", async () => {\n    const loadingMocks = [\n      {\n        id: 1,\n        courseName: \"CMPSC 156\",\n        term: \"Spring 2025\",\n        school: \"UCSB\",\n        orgName: \"ucsb-cs156-s25\",\n        studentStatus: \"JOINCOURSE\",\n      },\n      {\n        id: 2,\n        courseName: \"CPTS 489\",\n        term: \"Fall 2020\",\n        school: \"WSU\",\n        orgName: \"wsu-cpts489-f20\",\n        studentStatus: \"JOINCOURSE\",\n      },\n    ];\n\n    const determineLoading = (cell) => {\n      return cell.row.index === 1;\n    };\n\n    render(\n      <"+"BrowserRouter>\n        <"+"CoursesTable\n          courses={loadingMocks}\n          testId={\"CoursesTable\"}\n          joinCallback={joinCallback}\n          isLoading={determineLoading}\n        />\n      <"+"/BrowserRouter>,\n    );\n\n    const button = screen.getByText(\"Join Course\");\n    expect(button).toHaveAttribute(\"class\", \"btn btn-primary\");\n    const loadingButton = screen.getByText(\"Joining...\");\n    expect(within(loadingButton).getByRole(\"status\")).toHaveClass(\n      \"spinner-grow\",\n      \"spinner-grow-sm\",\n    );\n  });\n  //tests for button 'Join Course'\n  test(\"Calls joinCallback when the button is pressed\", async () => {\n    render(\n      <"+"BrowserRouter>\n        <"+"CoursesTable\n          courses={coursesFixtures.oneCourseWithEachStatus}\n          testId={\"CoursesTable\"}\n          joinCallback={joinCallback}\n          isLoading={isLoading}\n        />\n      <"+"/BrowserRouter>,\n    );\n\n    const button = screen.getByTestId(\n      \"CoursesTable-cell-row-1-col-studentStatus-button\",\n    );\n    expect(button).toBeInTheDocument();\n    expect(button).toHaveTextContent(\"Join Course\");\n    expect(button).toHaveAttribute(\"class\", \"btn btn-primary\");\n    fireEvent.click(button);\n    await waitFor(() => {\n      expect(joinCallback).toHaveBeenCalledTimes(1);\n    });\n  });\n  //tests for button 'View Invite'\n  test(\"Does not call joinCallback in default case for button'View Invite'\", () => {\n    render(\n      <"+"BrowserRouter>\n        <"+"CoursesTable\n          courses={coursesFixtures.oneCourseWithEachStatus}\n          testId={\"CoursesTable\"}\n          joinCallback={joinCallback}\n          isLoading={isLoading}\n        />\n      <"+"/BrowserRouter>,\n    );\n\n    const button = screen.getByTestId(\n      \"CoursesTable-cell-row-2-col-studentStatus-button\",\n    );\n    expect(button).toBeInTheDocument();\n    expect(button).toHaveTextContent(\"View Invite\");\n    expect(button).toHaveAttribute(\"class\", \"btn btn-primary\");\n\n    fireEvent.click(button);\n    expect(joinCallback).not.toHaveBeenCalled();\n  });\n  test(\"Does not call joinCallback when storybook is explicitly false for button 'View Invite'\", () => {\n    const openMock = vi.fn();\n    window.open = (a, b) => openMock(a, b);\n    render(\n      <"+"BrowserRouter>\n        <"+"CoursesTable\n          courses={coursesFixtures.oneCourseWithEachStatus}\n          testId={\"CoursesTable\"}\n          joinCallback={joinCallback}\n          isLoading={isLoading}\n        />\n      <"+"/BrowserRouter>,\n    );\n\n    const button = screen.getByTestId(\n      \"CoursesTable-cell-row-2-col-studentStatus-button\",\n    );\n    expect(button).toBeInTheDocument();\n    expect(button).toHaveTextContent(\"View Invite\");\n    expect(button).toHaveAttribute(\"class\", \"btn btn-primary\");\n\n    fireEvent.click(button);\n    expect(joinCallback).not.toHaveBeenCalled();\n\n    expect(openMock).toHaveBeenCalledWith(\n      \"https://github.com/orgs/ucsb-cs156-f25/invitation\",\n      \"_blank\",\n    );\n  });\n  test(\"tooltips for PENDING status\", async () => {\n    render(\n      <"+"BrowserRouter>\n        <"+"CoursesTable\n          courses={coursesFixtures.oneCourseWithEachStatus}\n          testId={\"CoursesTable\"}\n          joinCallback={joinCallback}\n          isLoading={isLoading}\n        />\n      <"+"/BrowserRouter>,\n    );\n\n    fireEvent.mouseOver(screen.getByText(\"Pending\"));\n\n    await waitFor(() => {\n      expect(\n        screen.getByText(\n          \"This course has not been completely set up by your instructor yet.\",\n        ),\n      ).toBeInTheDocument();\n    });\n  });\n  test(\"tooltips for JOINCOURSE status\", async () => {\n    render(\n      <"+"BrowserRouter>\n        <"+"CoursesTable\n          courses={coursesFixtures.oneCourseWithEachStatus}\n          testId={\"CoursesTable\"}\n          joinCallback={joinCallback}\n          isLoading={isLoading}\n        />\n      <"+"/BrowserRouter>,\n    );\n\n    fireEvent.mouseOver(screen.getByText(\"Join Course\"));\n\n    await waitFor(() => {\n      expect(\n        screen.getByText(\n          \"Clicking this button will generate an invitation to the GitHub organization associated with this course.\",\n        ),\n      ).toBeInTheDocument();\n    });\n  });\n  test(\"tooltips for INVITED status\", async () => {\n    render(\n      <"+"BrowserRouter>\n        <"+"CoursesTable\n          courses={coursesFixtures.oneCourseWithEachStatus}\n          testId={\"CoursesTable\"}\n          joinCallback={joinCallback}\n          isLoading={isLoading}\n        />\n      <"+"/BrowserRouter>,\n    );\n\n    fireEvent.mouseOver(screen.getByText(\"View Invite\"));\n    await waitFor(() => {\n      expect(\n        screen.getByText(\n          \"You have been invited to the GitHub organization associated with this course, but you still need to accept or decline the invitation. Please accept it if you plan to stay enrolled, and decline only if you plan to withdraw from the course.\",\n        ),\n      ).toBeInTheDocument();\n    });\n  });\n  test(\"tooltips for OWNER status\", async () => {\n    render(\n      <"+"BrowserRouter>\n        <"+"CoursesTable\n          courses={coursesFixtures.oneCourseWithEachStatus}\n          testId={\"CoursesTable\"}\n          joinCallback={joinCallback}\n          isLoading={isLoading}\n        />\n      <"+"/BrowserRouter>,\n    );\n\n    fireEvent.mouseOver(screen.getByText(\"Owner\"));\n    await waitFor(() => {\n      expect(\n        screen.getByText(\n          \"You are an owner of the GitHub organization associated with this course.\",\n        ),\n      ).toBeInTheDocument();\n    });\n  });\n  test(\"tooltips for MEMBER status\", async () => {\n    render(\n      <"+"BrowserRouter>\n        <"+"CoursesTable\n          courses={coursesFixtures.oneCourseWithEachStatus}\n          testId={\"CoursesTable\"}\n          joinCallback={joinCallback}\n          isLoading={isLoading}\n        />\n      <"+"/BrowserRouter>,\n    );\n\n    fireEvent.mouseOver(screen.getByText(\"Member\"));\n\n    await waitFor(() => {\n      expect(\n        screen.getByText(\n          \"You are a member of the GitHub organization associated with this course.\",\n        ),\n      ).toBeInTheDocument();\n    });\n  });\n  test(\"tooltips for an illegal status\", async () => {\n    render(\n      <"+"BrowserRouter>\n        <"+"CoursesTable\n          courses={coursesFixtures.oneCourseWithEachStatus}\n          testId={\"CoursesTable\"}\n          joinCallback={joinCallback}\n          isLoading={isLoading}\n        />\n      <"+"/BrowserRouter>,\n    );\n\n    fireEvent.mouseOver(\n      screen.getByText(\"Illegal status that will never occur\"),\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByText(\"Tooltip for illegal status that will never occur\"),\n      ).toBeInTheDocument();\n    });\n  });\n  test(\"expect the correct tooltip ID\", async () => {\n    render(\n      <"+"BrowserRouter>\n        <"+"CoursesTable\n          courses={coursesFixtures.oneCourseWithEachStatus}\n          testId={\"CoursesTable\"}\n          joinCallback={joinCallback}\n          isLoading={isLoading}\n        />\n      <"+"/BrowserRouter>,\n    );\n\n    fireEvent.mouseOver(screen.getByText(\"Member\"));\n\n    const tooltip = await screen.findByRole(\"tooltip\");\n    expect(tooltip).toHaveAttribute(\"id\", \"member-tooltip\");\n  });\n});\n"},"src/tests/components/Common/OurPagination.test.jsx":{"tests":[{"id":"169","name":"OurPagination tests renders correctly for totalPages = 5 (less than or equal to 7)"},{"id":"170","name":"OurPagination tests renders correctly when we take the default of 10)"},{"id":"171","name":"OurPagination tests renders correctly for totalPages = 7 (less than or equal to 7)"},{"id":"172","name":"OurPagination tests renders correctly for totalPages = 12 (greater than 7), initial state (activePage=1)"},{"id":"173","name":"OurPagination tests renders correctly for totalPages = 12, activePage = 4"},{"id":"174","name":"OurPagination tests renders correctly for totalPages = 12, activePage = 5 (middle range)"},{"id":"175","name":"OurPagination tests renders correctly for totalPages = 12, activePage = 8 (middle range, next clicks)"},{"id":"176","name":"OurPagination tests renders correctly for totalPages = 12, activePage = 9 (near end)"},{"id":"177","name":"OurPagination tests renders correctly for totalPages = 12, activePage = 12 (end)"},{"id":"178","name":"OurPagination tests navigation: prev button works correctly"},{"id":"179","name":"OurPagination tests navigation: clicking page 1 from a middle page"},{"id":"180","name":"OurPagination tests checks active class on buttons"}],"source":"import { fireEvent, render, screen, within } from \"@testing-library/react\";\nimport OurPagination from \"main/components/Common/OurPagination\";\nimport { useState } from \"react\";\nimport { vi } from \"vitest\";\n\nconst checkTestIdsInOrder = (testIds) => {\n  const links = screen.getAllByTestId(/OurPagination-/);\n  expect(links.length).toBe(testIds.length);\n\n  for (var i = 0; i <"+" links.length; i++) {\n    expect(screen.getByTestId(testIds[i])).toBe(links[i]);\n  }\n};\n\nconst mockStateWrapper = vi.fn();\n\nconst PaginationWrapper = ({ beginActivePage, args }) => {\n  const [activePage, setActivePage] = useState(beginActivePage);\n  const aliasActivePage = (x) => {\n    mockStateWrapper(x);\n    setActivePage(x);\n  };\n  return (\n    <"+"OurPagination\n      currentActivePage={activePage}\n      updateActivePage={aliasActivePage}\n      {...args}\n    />\n  );\n};\n\ndescribe(\"OurPagination tests\", () => {\n  test(\"renders correctly for totalPages = 5 (less than or equal to 7)\", async () => {\n    render(<"+"PaginationWrapper beginActivePage={1} args={{ totalPages: 5 }} />);\n\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-2\",\n      \"OurPagination-3\",\n      \"OurPagination-4\",\n      \"OurPagination-5\",\n      \"OurPagination-next\",\n    ]);\n  });\n\n  test(\"renders correctly when we take the default of 10)\", async () => {\n    render(<"+"PaginationWrapper beginActivePage={1} args={{}} />);\n\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-2\",\n      \"OurPagination-3\",\n      \"OurPagination-4\",\n      \"OurPagination-5\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-10\",\n      \"OurPagination-next\",\n    ]);\n  });\n\n  test(\"renders correctly for totalPages = 7 (less than or equal to 7)\", async () => {\n    render(<"+"PaginationWrapper beginActivePage={1} args={{ totalPages: 7 }} />);\n\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-2\",\n      \"OurPagination-3\",\n      \"OurPagination-4\",\n      \"OurPagination-5\",\n      \"OurPagination-6\",\n      \"OurPagination-7\",\n      \"OurPagination-next\",\n    ]);\n  });\n\n  test(\"renders correctly for totalPages = 12 (greater than 7), initial state (activePage=1)\", async () => {\n    render(<"+"PaginationWrapper beginActivePage={1} args={{ totalPages: 12 }} />);\n    // Expected: 1, 2, 3, 4, 5, ..., 12\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-2\",\n      \"OurPagination-3\",\n      \"OurPagination-4\",\n      \"OurPagination-5\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n  });\n\n  test(\"renders correctly for totalPages = 12, activePage = 4\", async () => {\n    render(<"+"PaginationWrapper beginActivePage={4} args={{ totalPages: 12 }} />);\n\n    // Click to page 4\n    fireEvent.click(screen.getByTestId(\"OurPagination-4\"));\n\n    // Expected: 1, 2, 3, 4, 5, ..., 12 (activePage <"+" 5)\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-2\",\n      \"OurPagination-3\",\n      \"OurPagination-4\",\n      \"OurPagination-5\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n  });\n\n  test(\"renders correctly for totalPages = 12, activePage = 5 (middle range)\", async () => {\n    render(<"+"PaginationWrapper beginActivePage={5} args={{ totalPages: 12 }} />);\n    fireEvent.click(screen.getByTestId(\"OurPagination-5\"));\n    // Expected: 1, ..., 4, 5, 6, ..., 12\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-left-ellipsis\",\n      \"OurPagination-4\",\n      \"OurPagination-5\",\n      \"OurPagination-6\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n  });\n\n  test(\"renders correctly for totalPages = 12, activePage = 8 (middle range, next clicks)\", async () => {\n    render(<"+"PaginationWrapper beginActivePage={1} args={{ totalPages: 12 }} />);\n\n    const nextButton = screen.getByTestId(\"OurPagination-next\");\n    fireEvent.click(nextButton); // page 2\n    fireEvent.click(nextButton); // page 3\n    fireEvent.click(nextButton); // page 4\n    fireEvent.click(nextButton); // page 5\n    // Expected: 1, ..., 4, 5, 6, ..., 12\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-left-ellipsis\",\n      \"OurPagination-4\",\n      \"OurPagination-5\",\n      \"OurPagination-6\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n    fireEvent.click(nextButton); // page 6\n    // Expected: 1, ..., 5, 6, 7, ..., 12\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-left-ellipsis\",\n      \"OurPagination-5\",\n      \"OurPagination-6\",\n      \"OurPagination-7\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n    fireEvent.click(nextButton); // page 7\n    // Expected: 1, ..., 6, 7, 8, ..., 12\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-left-ellipsis\",\n      \"OurPagination-6\",\n      \"OurPagination-7\",\n      \"OurPagination-8\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n    fireEvent.click(nextButton); // page 8\n    // Expected: 1, ..., 7, 8, 9, ..., 12\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-left-ellipsis\",\n      \"OurPagination-7\",\n      \"OurPagination-8\",\n      \"OurPagination-9\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n  });\n\n  test(\"renders correctly for totalPages = 12, activePage = 9 (near end)\", async () => {\n    render(<"+"PaginationWrapper beginActivePage={9} args={{ totalPages: 12 }} />);\n    // Click to page 9 (totalPages - 3)\n    // This requires multiple clicks on next or direct jump if available.\n    // For simplicity, we'll simulate state by clicking next multiple times\n    for (let i = 0; i <"+" 8; i++) {\n      // 1 -> 2 -> ... -> 9\n      fireEvent.click(screen.getByTestId(\"OurPagination-next\"));\n    }\n    // Expected: 1, ..., 8, 9, 10, 11, 12\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-left-ellipsis\",\n      \"OurPagination-8\",\n      \"OurPagination-9\",\n      \"OurPagination-10\",\n      \"OurPagination-11\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n    expect(screen.queryByText(\"stryker was here\")).not.toBeInTheDocument();\n  });\n\n  test(\"renders correctly for totalPages = 12, activePage = 12 (end)\", async () => {\n    render(\n      <"+"PaginationWrapper beginActivePage={12} args={{ totalPages: 12 }} />,\n    );\n    fireEvent.click(screen.getByTestId(\"OurPagination-12\"));\n    // Expected: 1, ..., 8, 9, 10, 11, 12\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-left-ellipsis\",\n      \"OurPagination-8\",\n      \"OurPagination-9\",\n      \"OurPagination-10\",\n      \"OurPagination-11\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n  });\n\n  test(\"navigation: prev button works correctly\", async () => {\n    render(<"+"PaginationWrapper beginActivePage={1} args={{ totalPages: 12 }} />);\n    // Go to page 5\n    fireEvent.click(screen.getByTestId(\"OurPagination-5\"));\n    expect(\n      within(screen.getByTestId(\"OurPagination-5\")).getByText(\"(current)\"),\n    ).toBeInTheDocument();\n\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-left-ellipsis\",\n      \"OurPagination-4\",\n      \"OurPagination-5\",\n      \"OurPagination-6\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n\n    const prevButton = screen.getByTestId(\"OurPagination-prev\");\n    fireEvent.click(prevButton); // Go to page 4\n\n    // Assert that page 4 is now active\n    expect(\n      within(screen.getByTestId(\"OurPagination-4\")).getByText(\"(current)\"),\n    ).toBeInTheDocument();\n    expect(\n      within(screen.getByTestId(\"OurPagination-5\")).queryByText(\"(current)\"),\n    ).not.toBeInTheDocument();\n\n    // Expected: 1, 2, 3, 4, 5, ..., 12\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-2\",\n      \"OurPagination-3\",\n      \"OurPagination-4\",\n      \"OurPagination-5\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n  });\n\n  test(\"navigation: clicking page 1 from a middle page\", async () => {\n    render(<"+"PaginationWrapper beginActivePage={1} args={{ totalPages: 12 }} />);\n    // Go to page 5\n    fireEvent.click(screen.getByTestId(\"OurPagination-5\"));\n    checkTestIdsInOrder([\n      // Page 5\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-left-ellipsis\",\n      \"OurPagination-4\",\n      \"OurPagination-5\",\n      \"OurPagination-6\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n\n    fireEvent.click(screen.getByTestId(\"OurPagination-1\"));\n    // Expected: 1, 2, 3, 4, 5, ..., 12\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-2\",\n      \"OurPagination-3\",\n      \"OurPagination-4\",\n      \"OurPagination-5\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n  });\n\n  test(\"checks active class on buttons\", async () => {\n    render(<"+"PaginationWrapper beginActivePage={1} args={{ totalPages: 5 }} />);\n\n    // Initial state: page 1 is active\n    expect(\n      within(screen.getByTestId(\"OurPagination-1\")).getByText(\"(current)\"),\n    ).toBeInTheDocument();\n    expect(\n      within(screen.getByTestId(\"OurPagination-2\")).queryByText(\"(current)\"),\n    ).not.toBeInTheDocument();\n\n    fireEvent.click(screen.getByTestId(\"OurPagination-next\")); // page 2\n\n    // After re-render: page 2 should be active. Re-query elements.\n    expect(\n      within(screen.getByTestId(\"OurPagination-1\")).queryByText(\"(current)\"),\n    ).not.toBeInTheDocument();\n    expect(\n      within(screen.getByTestId(\"OurPagination-2\")).getByText(\"(current)\"),\n    ).toBeInTheDocument();\n  });\n});\n"},"src/tests/components/Courses/CourseModal.test.jsx":{"tests":[{"id":"181","name":"CourseModal Tests Validation works correctly"},{"id":"182","name":"CourseModal Tests Can see initialContents"},{"id":"183","name":"CourseModal Tests Can submit successfully"},{"id":"184","name":"CourseModal Tests Can click close"},{"id":"185","name":"CourseModal Tests Form starts empty without initialContents"},{"id":"186","name":"CourseModal Tests Form gets populated when initialContents change from empty to filled"},{"id":"187","name":"CourseModal Tests Form updates when initialContents change from one course to another"},{"id":"188","name":"CourseModal Tests useEffect handles undefined initialContents correctly"},{"id":"189","name":"CourseModal Tests defaultValues prop works correctly with initialContents"},{"id":"190","name":"CourseModal Tests defaultValues uses empty object when initialContents is null"}],"source":"import CourseModal from \"main/components/Courses/CourseModal\";\nimport React from \"react\";\nimport { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport coursesFixtures from \"fixtures/coursesFixtures\";\nimport { vi } from \"vitest\";\n\nconst mockSubmit = vi.fn();\nconst showModal = vi.fn();\nconst toggleShowModal = vi.fn();\n\ndescribe(\"CourseModal Tests\", () => {\n  test(\"Validation works correctly\", async () => {\n    render(\n      <"+"div\n        className=\"modal show\"\n        style={{ display: \"block\", position: \"initial\" }}\n      >\n        <"+"CourseModal\n          showModal={showModal}\n          toggleShowModal={toggleShowModal}\n          onSubmitAction={mockSubmit}\n        />\n      <"+"/div>,\n    );\n\n    const modalTitle = screen.getByText(\"Create Course\");\n    expect(modalTitle).toBeInTheDocument();\n\n    const submitButton = screen.getByTestId(/CourseModal-submit/);\n    fireEvent.click(submitButton);\n\n    expect(mockSubmit).toHaveBeenCalledTimes(0);\n\n    await screen.findByText(/Course Name is required./);\n    expect(screen.getByText(/Course Term is required./)).toBeInTheDocument();\n    expect(screen.getByText(/School is required./)).toBeInTheDocument();\n  });\n\n  test(\"Can see initialContents\", async () => {\n    render(\n      <"+"div\n        className=\"modal show\"\n        style={{ display: \"block\", position: \"initial\" }}\n      >\n        <"+"CourseModal\n          showModal={showModal}\n          toggleShowModal={toggleShowModal}\n          onSubmitAction={mockSubmit}\n          initialContents={coursesFixtures.severalCourses[0]}\n          buttonText={\"Edit\"}\n          modalTitle={\"Edit Course\"}\n        />\n      <"+"/div>,\n    );\n\n    const modalTitle = screen.getByText(\"Edit Course\");\n    expect(modalTitle).toBeInTheDocument();\n\n    expect(screen.getByDisplayValue(\"CMPSC 156\")).toBeInTheDocument();\n    expect(screen.getByDisplayValue(\"Spring 2025\")).toBeInTheDocument();\n    expect(screen.getByDisplayValue(\"UCSB\")).toBeInTheDocument();\n    expect(screen.getByText(\"Edit\")).toBeInTheDocument();\n  });\n\n  test(\"Can submit successfully\", async () => {\n    render(\n      <"+"div\n        className=\"modal show\"\n        style={{ display: \"block\", position: \"initial\" }}\n      >\n        <"+"CourseModal\n          showModal={showModal}\n          toggleShowModal={toggleShowModal}\n          onSubmitAction={mockSubmit}\n        />\n      <"+"/div>,\n    );\n\n    const courseName = screen.getByLabelText(\"Course Name\");\n    const courseTerm = screen.getByLabelText(\"Term\");\n    const school = screen.getByLabelText(\"School\");\n    fireEvent.change(courseName, { target: { value: \"CMPSC 156\" } });\n    fireEvent.change(courseTerm, { target: { value: \"Spring 2025\" } });\n    fireEvent.change(school, { target: { value: \"UCSB\" } });\n    expect(screen.getByTestId(\"CourseModal-courseName\")).toBeInTheDocument();\n    expect(screen.getByTestId(\"CourseModal-term\")).toBeInTheDocument();\n    expect(screen.getByTestId(\"CourseModal-school\")).toBeInTheDocument();\n    expect(screen.getByTestId(\"CourseModal-base\")).toHaveClass(\n      \"modal-dialog-centered\",\n    );\n    const submitButton = screen.getByText(\"Create\");\n    fireEvent.click(submitButton);\n\n    await waitFor(() => expect(mockSubmit).toHaveBeenCalledTimes(1));\n  });\n\n  test(\"Can click close\", async () => {\n    render(\n      <"+"div\n        className=\"modal show\"\n        style={{ display: \"block\", position: \"initial\" }}\n      >\n        <"+"CourseModal\n          showModal={showModal}\n          toggleShowModal={toggleShowModal}\n          onSubmitAction={mockSubmit}\n        />\n      <"+"/div>,\n    );\n\n    const closeButton = screen.getByTestId(\"CourseModal-closeButton\");\n    fireEvent.click(closeButton);\n    await waitFor(() => expect(toggleShowModal).toHaveBeenCalledTimes(1));\n    expect(toggleShowModal).toHaveBeenCalledWith(false);\n  });\n\n  test(\"Form starts empty without initialContents\", async () => {\n    render(\n      <"+"div\n        className=\"modal show\"\n        style={{ display: \"block\", position: \"initial\" }}\n      >\n        <"+"CourseModal\n          showModal={showModal}\n          toggleShowModal={toggleShowModal}\n          onSubmitAction={mockSubmit}\n        />\n      <"+"/div>,\n    );\n\n    const courseNameInput = screen.getByTestId(\"CourseModal-courseName\");\n    const termInput = screen.getByTestId(\"CourseModal-term\");\n    const schoolInput = screen.getByTestId(\"CourseModal-school\");\n\n    expect(courseNameInput.value).toBe(\"\");\n    expect(termInput.value).toBe(\"\");\n    expect(schoolInput.value).toBe(\"\");\n  });\n\n  test(\"Form gets populated when initialContents change from empty to filled\", async () => {\n    const MockCourseModal = ({ initialContents }) => (\n      <"+"div\n        className=\"modal show\"\n        style={{ display: \"block\", position: \"initial\" }}\n      >\n        <"+"CourseModal\n          showModal={showModal}\n          toggleShowModal={toggleShowModal}\n          onSubmitAction={mockSubmit}\n          initialContents={initialContents}\n        />\n      <"+"/div>\n    );\n\n    // Start with no initial contents\n    const { rerender } = render(<"+"MockCourseModal initialContents={null} />);\n\n    const courseNameInput = screen.getByTestId(\"CourseModal-courseName\");\n    const termInput = screen.getByTestId(\"CourseModal-term\");\n    const schoolInput = screen.getByTestId(\"CourseModal-school\");\n\n    // Verify form starts empty\n    expect(courseNameInput.value).toBe(\"\");\n    expect(termInput.value).toBe(\"\");\n    expect(schoolInput.value).toBe(\"\");\n\n    // Change to have initial contents\n    rerender(\n      <"+"MockCourseModal initialContents={coursesFixtures.severalCourses[0]} />,\n    );\n\n    // Verify form gets populated\n    await waitFor(() => {\n      expect(courseNameInput.value).toBe(\"CMPSC 156\");\n      expect(termInput.value).toBe(\"Spring 2025\");\n      expect(schoolInput.value).toBe(\"UCSB\");\n    });\n  });\n\n  test(\"Form updates when initialContents change from one course to another\", async () => {\n    const MockCourseModal = ({ initialContents }) => (\n      <"+"div\n        className=\"modal show\"\n        style={{ display: \"block\", position: \"initial\" }}\n      >\n        <"+"CourseModal\n          showModal={showModal}\n          toggleShowModal={toggleShowModal}\n          onSubmitAction={mockSubmit}\n          initialContents={initialContents}\n        />\n      <"+"/div>\n    );\n\n    // Start with first course\n    const { rerender } = render(\n      <"+"MockCourseModal initialContents={coursesFixtures.severalCourses[0]} />,\n    );\n\n    const courseNameInput = screen.getByTestId(\"CourseModal-courseName\");\n    const termInput = screen.getByTestId(\"CourseModal-term\");\n    const schoolInput = screen.getByTestId(\"CourseModal-school\");\n\n    // Verify first course data\n    expect(courseNameInput.value).toBe(\"CMPSC 156\");\n    expect(termInput.value).toBe(\"Spring 2025\");\n    expect(schoolInput.value).toBe(\"UCSB\");\n\n    // Change to second course\n    rerender(\n      <"+"MockCourseModal initialContents={coursesFixtures.severalCourses[1]} />,\n    );\n\n    // Verify form updates to second course data\n    await waitFor(() => {\n      expect(courseNameInput.value).toBe(\"CPTS 489\");\n      expect(termInput.value).toBe(\"Fall 2020\");\n      expect(schoolInput.value).toBe(\"WSU\");\n    });\n  });\n\n  test(\"useEffect handles undefined initialContents correctly\", async () => {\n    const MockCourseModal = ({ initialContents }) => (\n      <"+"div\n        className=\"modal show\"\n        style={{ display: \"block\", position: \"initial\" }}\n      >\n        <"+"CourseModal\n          showModal={showModal}\n          toggleShowModal={toggleShowModal}\n          onSubmitAction={mockSubmit}\n          initialContents={initialContents}\n        />\n      <"+"/div>\n    );\n\n    // Start with undefined initial contents\n    const { rerender } = render(\n      <"+"MockCourseModal initialContents={undefined} />,\n    );\n\n    const courseNameInput = screen.getByTestId(\"CourseModal-courseName\");\n    const termInput = screen.getByTestId(\"CourseModal-term\");\n    const schoolInput = screen.getByTestId(\"CourseModal-school\");\n\n    // Verify form starts empty\n    expect(courseNameInput.value).toBe(\"\");\n    expect(termInput.value).toBe(\"\");\n    expect(schoolInput.value).toBe(\"\");\n\n    // Change to have course data\n    rerender(\n      <"+"MockCourseModal initialContents={coursesFixtures.severalCourses[0]} />,\n    );\n\n    // Verify form gets populated\n    await waitFor(() => {\n      expect(courseNameInput.value).toBe(\"CMPSC 156\");\n      expect(termInput.value).toBe(\"Spring 2025\");\n      expect(schoolInput.value).toBe(\"UCSB\");\n    });\n  });\n\n  test(\"defaultValues prop works correctly with initialContents\", async () => {\n    // This test verifies that the defaultValues prop in useForm works\n    render(\n      <"+"div\n        className=\"modal show\"\n        style={{ display: \"block\", position: \"initial\" }}\n      >\n        <"+"CourseModal\n          showModal={showModal}\n          toggleShowModal={toggleShowModal}\n          onSubmitAction={mockSubmit}\n          initialContents={coursesFixtures.severalCourses[0]}\n        />\n      <"+"/div>,\n    );\n\n    // The form should be immediately populated due to defaultValues\n    const courseNameInput = screen.getByTestId(\"CourseModal-courseName\");\n    const termInput = screen.getByTestId(\"CourseModal-term\");\n    const schoolInput = screen.getByTestId(\"CourseModal-school\");\n\n    expect(courseNameInput.value).toBe(\"CMPSC 156\");\n    expect(termInput.value).toBe(\"Spring 2025\");\n    expect(schoolInput.value).toBe(\"UCSB\");\n  });\n\n  test(\"defaultValues uses empty object when initialContents is null\", async () => {\n    render(\n      <"+"div\n        className=\"modal show\"\n        style={{ display: \"block\", position: \"initial\" }}\n      >\n        <"+"CourseModal\n          showModal={showModal}\n          toggleShowModal={toggleShowModal}\n          onSubmitAction={mockSubmit}\n          initialContents={null}\n        />\n      <"+"/div>,\n    );\n\n    const courseNameInput = screen.getByTestId(\"CourseModal-courseName\");\n    const termInput = screen.getByTestId(\"CourseModal-term\");\n    const schoolInput = screen.getByTestId(\"CourseModal-school\");\n\n    expect(courseNameInput.value).toBe(\"\");\n    expect(termInput.value).toBe(\"\");\n    expect(schoolInput.value).toBe(\"\");\n  });\n});\n"},"src/tests/utils/currentUser.test.jsx":{"tests":[{"id":"191","name":"utils/currentUser tests useCurrentUser tests useCurrentUser retrieves initial data"},{"id":"192","name":"utils/currentUser tests useCurrentUser tests useCurrentUser retrieves data from API"},{"id":"193","name":"utils/currentUser tests useCurrentUser tests useCurrentUser when API unreachable"},{"id":"194","name":"utils/currentUser tests useCurrentUser tests useCurrentUser when API returns 403 (not logged in)"},{"id":"195","name":"utils/currentUser tests useCurrentUser tests useCurrentUser handles missing roles correctly"},{"id":"196","name":"utils/currentUser tests useLogout tests useLogout"},{"id":"197","name":"utils/currentUser tests hasRole tests hasRole(x,\"ROLE_ADMIN\") return falsy when currentUser ill-defined"},{"id":"198","name":"utils/currentUser tests hasRole tests hasRole(x,\"ROLE_ADMIN\") returns correct values when currentUser properly defined"},{"id":"199","name":"utils/currentUser tests hasRole tests hasRole(x,\"ROLE_USER\") returns correct values when currentUser properly defined"}],"source":"import { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { useCurrentUser, useLogout, hasRole } from \"main/utils/currentUser\";\nimport { renderHook, waitFor, act } from \"@testing-library/react\";\nimport {\n  apiCurrentUserFixtures,\n  currentUserFixtures,\n} from \"fixtures/currentUserFixtures\";\nimport mockConsole from \"tests/testutils/mockConsole\";\nimport { useNavigate } from \"react-router\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { vi } from \"vitest\";\n\nvi.mock(\"react-router\");\nconst { MemoryRouter } = await vi.importActual(\"react-router\");\n\nconst axiosMock = new AxiosMockAdapter(axios);\n\ndescribe(\"utils/currentUser tests\", () => {\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n  });\n  describe(\"useCurrentUser tests\", () => {\n    test(\"useCurrentUser retrieves initial data\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      axiosMock.onGet(\"/api/currentUser\").timeoutOnce();\n      axiosMock\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingNeither);\n\n      const restoreConsole = mockConsole();\n\n      const { result } = renderHook(() => useCurrentUser(), { wrapper });\n      await waitFor(() =>\n        expect(queryClient.getQueryState([\"current user\"]).status).toBe(\n          \"success\",\n        ),\n      );\n\n      expect(result.current).toEqual({\n        loggedIn: false,\n        root: null,\n        initialData: true,\n      });\n\n      const queryState = queryClient.getQueryState([\"current user\"]);\n      expect(queryState).toBeDefined();\n\n      queryClient.clear();\n\n      await waitFor(() => expect(console.error).toHaveBeenCalled());\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(/Error invoking axios.get:/);\n      restoreConsole();\n    });\n\n    test(\"useCurrentUser retrieves data from API\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      axiosMock\n        .onGet(\"/api/currentUser\")\n        .reply(200, apiCurrentUserFixtures.userOnly);\n      axiosMock
