\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingNeither);\n\n      const { result } = renderHook(() => useCurrentUser(), { wrapper });\n\n      await waitFor(() =>\n        expect(\n          queryClient.getQueryState([\"current user\"]).dataUpdateCount,\n        ).toBe(1),\n      );\n\n      expect(result.current).toEqual(currentUserFixtures.userOnly);\n      queryClient.clear();\n    });\n\n    test(\"useCurrentUser when API unreachable\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      axiosMock.onGet(\"/api/currentUser\").reply(404);\n\n      const restoreConsole = mockConsole();\n      const { result } = renderHook(() => useCurrentUser(), { wrapper });\n\n      await waitFor(() =>\n        expect(queryClient.getQueryState([\"current user\"]).status).toBe(\n          \"success\",\n        ),\n      );\n      expect(console.error).toHaveBeenCalled();\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(/Error invoking axios.get:/);\n      restoreConsole();\n\n      expect(result.current).toEqual({\n        initialData: true,\n        loggedIn: false,\n        root: null,\n      });\n      queryClient.clear();\n    });\n\n    test(\"useCurrentUser when API returns 403 (not logged in)\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      axiosMock.onGet(\"/api/currentUser\").reply(403);\n\n      const restoreConsole = mockConsole();\n      const { result } = renderHook(() => useCurrentUser(), { wrapper });\n\n      await waitFor(() =>\n        expect(\n          queryClient.getQueryState([\"current user\"]).dataUpdateCount,\n        ).toBe(1),\n      );\n      expect(console.error).not.toHaveBeenCalled();\n      restoreConsole();\n\n      expect(result.current).toEqual({\n        loggedIn: false,\n        root: {},\n      });\n      queryClient.clear();\n    });\n\n    test(\"useCurrentUser handles missing roles correctly\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      const apiResult = apiCurrentUserFixtures.missingRolesToTestErrorHandling;\n      axiosMock.onGet(\"/api/currentUser\").reply(200, apiResult);\n\n      const restoreConsole = mockConsole();\n      const { result } = renderHook(() => useCurrentUser(), { wrapper });\n\n      await waitFor(() =>\n        expect(\n          queryClient.getQueryState([\"current user\"]).dataUpdateCount,\n        ).toBe(1),\n      );\n      expect(console.error).toHaveBeenCalled();\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(/Error getting roles: /);\n      restoreConsole();\n\n      let expectedResult = {\n        loggedIn: true,\n        root: { ...apiResult, rolesList: [\"ERROR_GETTING_ROLES\"] },\n      };\n      expect(result.current).toEqual(expectedResult);\n      queryClient.clear();\n    });\n  });\n  describe(\"useLogout tests\", () => {\n    test(\"useLogout\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"MemoryRouter>{children}<"+"/MemoryRouter>\n        <"+"/QueryClientProvider>\n      );\n\n      axiosMock.onPost(\"/logout\").reply(200);\n\n      const navigateSpy = vi.fn();\n      useNavigate.mockImplementation(() => navigateSpy);\n\n      const resetQueriesSpy = vi.spyOn(queryClient, \"resetQueries\");\n\n      const { result } = renderHook(() => useLogout(), { wrapper });\n\n      act(() => {\n        expect(useNavigate).toHaveBeenCalled();\n        result.current.mutate();\n      });\n      await waitFor(() => expect(navigateSpy).toHaveBeenCalledWith(\"/\"));\n\n      await waitFor(() =>\n        expect(resetQueriesSpy).toHaveBeenCalledWith({\n          queryKey: [\"current user\"],\n        }),\n      );\n\n      queryClient.clear();\n    });\n  });\n  describe(\"hasRole tests\", () => {\n    test('hasRole(x,\"ROLE_ADMIN\") return falsy when currentUser ill-defined', async () => {\n      expect(hasRole(null, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(hasRole({}, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(hasRole({ loggedIn: null }, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(hasRole({ loggedIn: true }, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(hasRole({ loggedIn: true, root: null }, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(hasRole({ loggedIn: true, root: {} }, \"ROLE_ADMIN\")).toBeFalsy();\n      expect(\n        hasRole({ loggedIn: true, root: { rolesList: null } }, \"ROLE_ADMIN\"),\n      ).toBeFalsy();\n    });\n\n    test('hasRole(x,\"ROLE_ADMIN\") returns correct values when currentUser properly defined', async () => {\n      expect(\n        hasRole({ loggedIn: true, root: { rolesList: [] } }, \"ROLE_ADMIN\"),\n      ).toBeFalsy();\n      expect(\n        hasRole(\n          { loggedIn: true, root: { rolesList: [\"ROLE_USER\"] } },\n          \"ROLE_ADMIN\",\n        ),\n      ).toBeFalsy();\n      expect(\n        hasRole(\n          { loggedIn: true, root: { rolesList: [\"ROLE_USER\", \"ROLE_ADMIN\"] } },\n          \"ROLE_ADMIN\",\n        ),\n      ).toBeTruthy();\n    });\n\n    test('hasRole(x,\"ROLE_USER\") returns correct values when currentUser properly defined', async () => {\n      expect(\n        hasRole({ loggedIn: true, root: { rolesList: [] } }, \"ROLE_USER\"),\n      ).toBeFalsy();\n      expect(\n        hasRole(\n          { loggedIn: true, root: { rolesList: [\"ROLE_USER\"] } },\n          \"ROLE_USER\",\n        ),\n      ).toBeTruthy();\n      expect(\n        hasRole(\n          { loggedIn: true, root: { rolesList: [\"ROLE_USER\", \"ROLE_ADMIN\"] } },\n          \"ROLE_USER\",\n        ),\n      ).toBeTruthy();\n    });\n  });\n});\n"},"src/tests/utils/useBackend.test.jsx":{"tests":[{"id":"200","name":"utils/useBackend tests utils/useBackend useBackend tests useBackend handles 404 error correctly"},{"id":"201","name":"utils/useBackend tests utils/useBackend useBackend tests useBackend handles error correctly with suppressed toast"},{"id":"202","name":"utils/useBackend tests utils/useBackend useBackend tests useBackend handles disabled correctly"},{"id":"203","name":"utils/useBackend tests utils/useBackend useBackendMutation tests useBackendMutation handles success correctly"},{"id":"204","name":"utils/useBackend tests utils/useBackend useBackendMutation tests useBackendMutation handles error correctly"}],"source":"import { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { renderHook, waitFor, act } from \"@testing-library/react\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { useBackend, useBackendMutation } from \"main/utils/useBackend\";\nimport { vi } from \"vitest\";\n\nvi.mock(\"react-router\");\n\nconst axiosMock = new AxiosMockAdapter(axios);\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async (importOriginal) => {\n  return {\n    ...(await importOriginal()),\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"utils/useBackend tests\", () => {\n  beforeEach(() => {\n    vi.spyOn(console, \"error\");\n    console.error.mockImplementation(() => null);\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    mockToast.mockReset();\n  });\n\n  afterEach(() => {\n    console.error.mockRestore();\n  });\n\n  describe(\"utils/useBackend useBackend tests\", () => {\n    test(\"useBackend handles 404 error correctly\", async () => {\n      // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n      const queryClient = new QueryClient({\n        defaultOptions: {\n          queries: {\n            // ✅ turns retries off\n            retry: false,\n          },\n        },\n      });\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      axiosMock.onGet(\"/api/admin/users\").reply(404, {});\n\n      const { result } = renderHook(\n        () =>\n          useBackend(\n            [\"/api/admin/users\"],\n            { method: \"GET\", url: \"/api/admin/users\" },\n            [\"initialData\"],\n          ),\n        { wrapper },\n      );\n\n      await waitFor(() => result.current.isError);\n\n      expect(result.current.data).toEqual([\"initialData\"]);\n      await waitFor(() => expect(console.error).toHaveBeenCalled());\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(\n        \"Error communicating with backend via GET on /api/admin/users\",\n      );\n      expect(mockToast).toHaveBeenCalledWith(\n        \"Error communicating with backend via GET on /api/admin/users\",\n      );\n    });\n    test(\"useBackend handles error correctly with suppressed toast\", async () => {\n      // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n      const queryClient = new QueryClient({\n        defaultOptions: {\n          queries: {\n            // ✅ turns retries off\n            retry: false,\n          },\n        },\n      });\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      axiosMock.onGet(\"/api/admin/users\").reply(404, {});\n\n      const { result } = renderHook(\n        () =>\n          useBackend(\n            [\"/api/admin/users\"],\n            { method: \"GET\", url: \"/api/admin/users\" },\n            [\"initialData\"],\n            true,\n          ),\n        { wrapper },\n      );\n\n      await waitFor(() => result.current.isError);\n\n      expect(result.current.data).toEqual([\"initialData\"]);\n      await waitFor(() => expect(console.error).toHaveBeenCalled());\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(\n        \"Error communicating with backend via GET on /api/admin/users\",\n      );\n      expect(mockToast).not.toHaveBeenCalled();\n    });\n    test(\"useBackend handles disabled correctly\", async () => {\n      // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n      const queryClient = new QueryClient({\n        defaultOptions: {\n          queries: {\n            // ✅ turns retries off\n            retry: false,\n          },\n        },\n      });\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      axiosMock.onGet(\"/api/admin/users\").reply(404, {});\n\n      const { result } = renderHook(\n        () =>\n          useBackend(\n            [\"/api/admin/users\"],\n            { method: \"GET\", url: \"/api/admin/users\" },\n            [\"initialData\"],\n            false,\n            { enabled: false },\n          ),\n        { wrapper },\n      );\n\n      expect(result.current.isLoading).toBe(false);\n    });\n  });\n  describe(\"utils/useBackend useBackendMutation tests\", () => {\n    test(\"useBackendMutation handles success correctly\", async () => {\n      // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n      const queryClient = new QueryClient({\n        defaultOptions: {\n          queries: {\n            // ✅ turns retries off\n            retry: false,\n          },\n        },\n      });\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      axiosMock.onPost(\"/api/ucsbdates/post\").reply(202, {\n        id: 17,\n        quarterYYYYQ: \"20221\",\n        name: \"Groundhog Day\",\n        localDateTime: \"2022-02-02T12:00\",\n      });\n\n      const objectToAxiosParams = (ucsbDate) => ({\n        url: \"/api/ucsbdates/post\",\n        method: \"POST\",\n        params: {\n          quarterYYYYQ: ucsbDate.quarterYYYYQ,\n          name: ucsbDate.name,\n          localDateTime: ucsbDate.localDateTime,\n        },\n      });\n\n      const onSuccess = vi.fn().mockImplementation((ucsbDate) => {\n        mockToast(\n          `New ucsbDate Created - id: ${ucsbDate.id} name: ${ucsbDate.name}`,\n        );\n      });\n\n      const { result } = renderHook(\n        () =>\n          useBackendMutation(objectToAxiosParams, { onSuccess }, [\n            \"/api/ucsbdates/all\",\n          ]),\n        { wrapper },\n      );\n\n      const mutation = result.current;\n      act(() =>\n        mutation.mutate({\n          quarterYYYYQ: \"20221\",\n          name: \"Groundhog Day\",\n          localDateTime: \"2022-02-02T12:00\",\n        }),\n      );\n\n      await waitFor(() => expect(onSuccess).toHaveBeenCalled());\n      expect(mockToast).toHaveBeenCalledWith(\n        \"New ucsbDate Created - id: 17 name: Groundhog Day\",\n      );\n    });\n    test(\"useBackendMutation handles error correctly\", async () => {\n      // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n      const queryClient = new QueryClient({\n        defaultOptions: {\n          queries: {\n            // ✅ turns retries off\n            retry: false,\n          },\n        },\n      });\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n      axiosMock.onPost(\"/api/ucsbdates/post\").reply(404);\n\n      const objectToAxiosParams = (ucsbDate) => ({\n        url: \"/api/ucsbdates/post\",\n        method: \"POST\",\n        params: {\n          quarterYYYYQ: ucsbDate.quarterYYYYQ,\n          name: ucsbDate.name,\n          localDateTime: ucsbDate.localDateTime,\n        },\n      });\n\n      const onSuccess = vi.fn().mockImplementation((ucsbDate) => {\n        mockToast(\n          `New ucsbDate Created - id: ${ucsbDate.id} name: ${ucsbDate.name}`,\n        );\n      });\n\n      const { result } = renderHook(\n        () => useBackendMutation(objectToAxiosParams, { onSuccess }),\n        { wrapper },\n      );\n\n      const mutation = result.current;\n\n      mutation.mutate(\n        {\n          quarterYYYYQ: \"20221\",\n          name: \"Bastille Day\",\n          localDateTime: \"2022-06-14T12:00\",\n        },\n        {\n          onError: (e) =>\n            console.error(\n              \"onError from mutation.mutate called!\",\n              String(e).substring(0, 199),\n            ),\n        },\n      );\n\n      await waitFor(() => expect(mockToast).toHaveBeenCalled());\n      expect(mockToast).toHaveBeenCalledTimes(1);\n      expect(mockToast).toHaveBeenCalledWith(\n        \"Error: Request failed with status code 404\",\n      );\n\n      console.log(console.error.mock.calls);\n      expect(console.error).toHaveBeenCalledTimes(1);\n      const errorMessage1 = console.error.mock.calls[0][1];\n      expect(errorMessage1).toMatch(/Request failed with status code 404/);\n      const errorMessage2 = console.error.mock.calls[0][0];\n      expect(errorMessage2).toMatch(/onError from mutation.mutate called!/);\n    });\n  });\n});\n"},"src/tests/components/Nav/AppNavbar.test.jsx":{"tests":[{"id":"205","name":"AppNavbar tests renders correctly for regular logged in user"},{"id":"206","name":"AppNavbar tests renders correctly for admin user"},{"id":"207","name":"AppNavbar tests renders correctly for instructor user"},{"id":"208","name":"AppNavbar tests renders H2Console and Swagger links correctly"},{"id":"209","name":"AppNavbar tests renders the AppNavbarLocalhost when on http://localhost:3000"},{"id":"210","name":"AppNavbar tests renders the AppNavbarLocalhost when on http://127.0.0.1:3000"},{"id":"211","name":"AppNavbar tests does NOT render the AppNavbarLocalhost when on localhost:8080"},{"id":"212","name":"AppNavbar tests onclick navigates to login"},{"id":"213","name":"AppNavbar tests If user does have ROLE_GITHUB, it does renders the connected to github"},{"id":"214","name":"AppNavbar tests renders Help dropdown for all users"},{"id":"215","name":"AppNavbar tests renders Help dropdown for admin users"},{"id":"216","name":"AppNavbar tests renders Help dropdown for logged out users"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport {\n  currentUserFixtures,\n  currentUserFixturesWithGithub,\n} from \"fixtures/currentUserFixtures\";\n\nimport AppNavbar from \"main/components/Nav/AppNavbar\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { vi } from \"vitest\";\n\nconst mockedNavigate = vi.fn();\nvi.mock(\"react-router\", async (importOriginal) => ({\n  ...(await importOriginal()),\n  useNavigate: () => mockedNavigate,\n}));\n\ndescribe(\"AppNavbar tests\", () => {\n  const queryClient = new QueryClient();\n  const doLogin = vi.fn();\n\n  beforeEach(() => {\n    vi.clearAllMocks();\n  });\n\n  test(\"renders correctly for regular logged in user\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n    const doLogin = vi.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar currentUser={currentUser} doLogin={doLogin} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Welcome, pconrad.cis@gmail.com\");\n  });\n\n  test(\"renders correctly for admin user\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar currentUser={currentUser} doLogin={doLogin} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Welcome, phtcon@ucsb.edu\");\n    const adminMenu = screen.getByTestId(\"appnavbar-admin-dropdown\");\n    expect(adminMenu).toBeInTheDocument();\n  });\n\n  test(\"renders correctly for instructor user\", async () => {\n    const currentUser = currentUserFixtures.instructorUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar currentUser={currentUser} doLogin={doLogin} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Welcome, diba@ucsb.edu\");\n\n    // Admin menu should not be present for instructor\n    const adminMenu = screen.queryByTestId(\"appnavbar-admin-dropdown\");\n    expect(adminMenu).not.toBeInTheDocument();\n  });\n\n  test(\"renders H2Console and Swagger links correctly\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n    const systemInfo = systemInfoFixtures.showingBoth;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"H2Console\");\n    const swaggerMenu = screen.getByText(\"Swagger\");\n    expect(swaggerMenu).toBeInTheDocument();\n  });\n\n  test(\"renders the AppNavbarLocalhost when on http://localhost:3000\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n    const systemInfo = systemInfoFixtures.showingBoth;\n\n    delete window.location;\n    window.location = new URL(\"http://localhost:3000\");\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByTestId(\"AppNavbarLocalhost\");\n    expect(screen.getByTestId(\"AppNavbarLocalhost-message1\").textContent).toBe(\n      \"Running on http://localhost:3000/ with no backend.\",\n    );\n    expect(screen.getByTestId(\"AppNavbarLocalhost-message2\").textContent).toBe(\n      \"You probably want http://localhost:8080 instead.\",\n    );\n  });\n\n  test(\"renders the AppNavbarLocalhost when on http://127.0.0.1:3000\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n    const systemInfo = systemInfoFixtures.showingBoth;\n\n    delete window.location;\n    window.location = new URL(\"http://127.0.0.1:3000\");\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByTestId(\"AppNavbarLocalhost\");\n  });\n\n  test(\"does NOT render the AppNavbarLocalhost when on localhost:8080\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n    const systemInfo = systemInfoFixtures.showingBoth;\n\n    delete window.location;\n    window.location = new URL(\"http://localhost:8080\");\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByTestId(\"AppNavbar\");\n    expect(screen.queryByTestId(/AppNavbarLocalhost/i)).toBeNull();\n  });\n\n  test(\"onclick navigates to login\", async () => {\n    const currentUser = currentUserFixtures.notLoggedIn;\n    const systemInfo = systemInfoFixtures.oauthLoginUndefined;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter initialEntries={[\"/example/return\"]}>\n          <"+"AppNavbar currentUser={currentUser} systemInfo={systemInfo} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Log In\");\n    fireEvent.click(screen.getByText(\"Log In\"));\n    await waitFor(() => expect(mockedNavigate).toHaveBeenCalledWith(\"/login\"));\n    expect(sessionStorage.getItem(\"redirect\")).toBe(\"/example/return\");\n    sessionStorage.clear();\n  });\n  test(\"If user does have ROLE_GITHUB, it does renders the connected to github\", async () => {\n    const currentUser = currentUserFixturesWithGithub.userOnly;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.getByText(\"Github: cgaucho-github\")).toBeInTheDocument();\n  });\n\n  test(\"renders Help dropdown for all users\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar currentUser={currentUser} doLogin={doLogin} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const helpMenu = screen.getByTestId(\"appnavbar-help-dropdown\");\n    expect(helpMenu).toBeInTheDocument();\n    expect(screen.getByText(\"Help\")).toBeInTheDocument();\n  });\n\n  test(\"renders Help dropdown for admin users\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar currentUser={currentUser} doLogin={doLogin} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const helpMenu = screen.getByTestId(\"appnavbar-help-dropdown\");\n    expect(helpMenu).toBeInTheDocument();\n    expect(screen.getByText(\"Help\")).toBeInTheDocument();\n  });\n\n  test(\"renders Help dropdown for logged out users\", async () => {\n    const currentUser = currentUserFixtures.notLoggedIn;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AppNavbar currentUser={currentUser} doLogin={doLogin} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const helpMenu = screen.getByTestId(\"appnavbar-help-dropdown\");\n    expect(helpMenu).toBeInTheDocument();\n    expect(screen.getByText(\"Help\")).toBeInTheDocument();\n  });\n});\n"},"src/tests/components/Users/RoleEmailTable.test.jsx":{"tests":[{"id":"217","name":"RoleEmailTable renders empty table correctly when data is null"},{"id":"218","name":"RoleEmailTable renders table with email data"},{"id":"219","name":"RoleEmailTable renders table with email data plus isInAdminEmails"},{"id":"220","name":"RoleEmailTable calls deleteCallback when Delete button clicked"},{"id":"221","name":"RoleEmailTable renders Delete button with correct label"},{"id":"222","name":"RoleEmailTable renders table with correct testid"},{"id":"223","name":"RoleEmailTable Delete button has correct Bootstrap class"},{"id":"224","name":"RoleEmailTable Delete button has correct data-testid using table ID prefix"},{"id":"225","name":"RoleEmailTable Check defaults for api endpoints"},{"id":"226","name":"RoleEmailTable Check that api endpoint overrides work"}],"source":"import React from \"react\";\nimport { render, screen, fireEvent, waitFor } from \"@testing-library/react\";\nimport RoleEmailTable from \"main/components/Users/RoleEmailTable\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { roleEmailFixtures } from \"fixtures/roleEmailFixtures\";\nimport { vi } from \"vitest\";\n\nconst testData = [\n  { email: \"user1@example.org\" },\n  { email: \"user2@example.org\" },\n];\n\nconst mockDeleteCallback = vi.fn();\n\nconst axiosMock = new AxiosMockAdapter(axios);\n\ndescribe(\"RoleEmailTable\", () => {\n  let queryClient;\n  let invalidateQueriesSpy;\n\n  beforeEach(() => {\n    queryClient = new QueryClient({\n      defaultOptions: {\n        queries: {\n          retry: false,\n          refetchOnWindowFocus: false,\n        },\n      },\n    });\n    invalidateQueriesSpy = vi.spyOn(queryClient, \"invalidateQueries\");\n    axiosMock.reset();\n    axiosMock.resetHistory();\n  });\n\n  // After each test, restore the original implementation and clean up.\n  afterEach(() => {\n    invalidateQueriesSpy.mockRestore(); // Restore original implementation of the spy\n    queryClient.clear(); // Clear the React Query cache\n  });\n\n  test(\"renders empty table correctly when data is null\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RoleEmailTable data={null} deleteCallback={mockDeleteCallback} />,\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.getByText(\"Email\")).toBeInTheDocument();\n    expect(screen.queryByRole(\"button\")).not.toBeInTheDocument();\n    expect(\n      screen.queryByTestId(\"RoleEmailTable-cell-row-0-col-email\"),\n    ).not.toBeInTheDocument();\n  });\n\n  test(\"renders table with email data\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RoleEmailTable data={testData} deleteCallback={mockDeleteCallback} />\n          ,\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.getByText(\"Email\")).toBeInTheDocument();\n    expect(screen.getByText(\"user1@example.org\")).toBeInTheDocument();\n    expect(screen.getByText(\"user2@example.org\")).toBeInTheDocument();\n\n    const deleteButtons = screen.getAllByRole(\"button\", { name: /delete/i });\n    expect(deleteButtons.length).toBe(testData.length);\n  });\n\n  test(\"renders table with email data plus isInAdminEmails\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RoleEmailTable\n            data={roleEmailFixtures.threeItemsWithIsInAdminEmailField}\n            deleteCallback={mockDeleteCallback}\n          />\n          ,\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.getByText(\"Email\")).toBeInTheDocument();\n    const deleteHeader = screen.getByTestId(\n      \"RoleEmailTable-header-isInAdminEmails\",\n    );\n    expect(deleteHeader).toBeInTheDocument();\n    expect(deleteHeader).toHaveTextContent(\"Delete\");\n    expect(\n      screen.getByTestId(\"RoleEmailTable-cell-row-0-cannot-delete\"),\n    ).toBeInTheDocument();\n  });\n\n  test(\"calls deleteCallback when Delete button clicked\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RoleEmailTable\n            data={testData}\n            customDeleteCallback={mockDeleteCallback}\n          />\n          ,\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const buttons = screen.getAllByRole(\"button\");\n    expect(buttons.length).toBe(testData.length);\n\n    fireEvent.click(buttons[0]);\n\n    expect(mockDeleteCallback).toHaveBeenCalledTimes(1);\n  });\n\n  test(\"renders Delete button with correct label\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RoleEmailTable data={testData} deleteCallback={mockDeleteCallback} />\n          ,\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const deleteButtons = screen.getAllByRole(\"button\", { name: /delete/i });\n    expect(deleteButtons.length).toBe(testData.length);\n    deleteButtons.forEach((btn) => {\n      expect(btn).toHaveTextContent(/delete/i);\n    });\n  });\n\n  test(\"renders table with correct testid\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RoleEmailTable data={testData} deleteCallback={mockDeleteCallback} />\n          ,\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    expect(\n      screen.getByTestId(\"RoleEmailTable-header-email\"),\n    ).toBeInTheDocument();\n  });\n\n  test(\"Delete button has correct Bootstrap class\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RoleEmailTable data={testData} deleteCallback={mockDeleteCallback} />\n          ,\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const deleteButtons = screen.getAllByRole(\"button\", { name: /delete/i });\n    deleteButtons.forEach((btn) => {\n      expect(btn).toHaveClass(\"btn-danger\");\n    });\n  });\n\n  test(\"Delete button has correct data-testid using table ID prefix\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RoleEmailTable data={testData} deleteCallback={mockDeleteCallback} />\n          ,\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const deleteButton = screen.getByTestId(\n      \"RoleEmailTable-cell-row-0-col-delete-button\",\n    );\n    expect(deleteButton).toBeInTheDocument();\n  });\n\n  test(\"Check defaults for api endpoints\", async () => {\n    axiosMock.onDelete(\"/api/admin/delete\").reply(200, {});\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RoleEmailTable data={testData} />,\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const deleteButton = screen.getByTestId(\n      \"RoleEmailTable-cell-row-0-col-delete-button\",\n    );\n    expect(deleteButton).toBeInTheDocument();\n    fireEvent.click(deleteButton);\n    await waitFor(() => {\n      expect(axiosMock.history.delete.length).toBe(1);\n    });\n    expect(axiosMock.history.delete[0].url).toBe(\"/api/admin/delete\");\n    expect(axiosMock.history.delete[0].params).toEqual({\n      email: \"user1@example.org\",\n    });\n    expect(invalidateQueriesSpy).toHaveBeenCalledTimes(1);\n    expect(invalidateQueriesSpy).toHaveBeenCalledWith({\n      queryKey: [\"/api/admin/all\"],\n    });\n  });\n\n  test(\"Check that api endpoint overrides work\", async () => {\n    axiosMock.onDelete(\"/api/admin/instructor/delete\").reply(200, {});\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RoleEmailTable\n            data={testData}\n            deleteEndpoint=\"/api/admin/instructor/delete\"\n            getEndpoint=\"/api/admin/instructor/all\"\n          />\n          ,\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const deleteButton = screen.getByTestId(\n      \"RoleEmailTable-cell-row-0-col-delete-button\",\n    );\n    expect(deleteButton).toBeInTheDocument();\n    fireEvent.click(deleteButton);\n    await waitFor(() => {\n      expect(axiosMock.history.delete.length).toBe(1);\n    });\n    expect(axiosMock.history.delete[0].url).toBe(\n      \"/api/admin/instructor/delete\",\n    );\n    expect(axiosMock.history.delete[0].params).toEqual({\n      email: \"user1@example.org\",\n    });\n\n    expect(invalidateQueriesSpy).toHaveBeenCalledTimes(1);\n    expect(invalidateQueriesSpy).toHaveBeenCalledWith({\n      queryKey: [\"/api/admin/instructor/all\"],\n    });\n  });\n});\n"},"src/tests/pages/Admin/AdminJobsPage.test.jsx":{"tests":[{"id":"227","name":"AdminJobsPage tests renders without crashing"},{"id":"228","name":"AdminJobsPage tests renders job launchers correctly"},{"id":"229","name":"AdminJobsPage tests renders job table with data"},{"id":"230","name":"AdminJobsPage tests clicking Update All Users button calls the correct API"},{"id":"231","name":"AdminJobsPage tests clicking Audit All Courses button calls the correct API"},{"id":"232","name":"AdminJobsPage tests clicking Purge Job Log button calls the correct API"}],"source":"import { render, screen, waitFor, fireEvent } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport AdminJobsPage from \"main/pages/Admin/AdminJobsPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\ndescribe(\"AdminJobsPage tests\", () => {\n  const queryClient = new QueryClient();\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    queryClient.clear();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.adminUser);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  });\n\n  test(\"renders without crashing\", async () => {\n    axiosMock.onGet(\"/api/jobs/all\").timeout();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(\"Launch Jobs\")).toBeInTheDocument();\n    expect(screen.getByText(\"Job Status\")).toBeInTheDocument();\n    expect(screen.getByText(\"Purge Job Log\")).toBeInTheDocument();\n    expect(queryClient.getQueryData([\"/api/jobs/all\"])).toEqual([]);\n  });\n\n  test(\"renders job launchers correctly\", async () => {\n    axiosMock.onGet(\"/api/jobs/all\").reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Update All Users\");\n    expect(screen.getByText(\"Audit All Courses\")).toBeInTheDocument();\n  });\n\n  test(\"renders job table with data\", async () => {\n    const jobsFixture = [\n      {\n        id: 1,\n        createdAt: \"2023-01-01T10:00:00\",\n        updatedAt: \"2023-01-01T10:05:00\",\n        status: \"complete\",\n        log: \"Job completed successfully\",\n      },\n    ];\n\n    axiosMock.onGet(\"/api/jobs/all\").reply(200, jobsFixture);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(\"id\")).toBeInTheDocument();\n    expect(screen.getByText(\"Created\")).toBeInTheDocument();\n    expect(screen.getByText(\"Updated\")).toBeInTheDocument();\n    expect(screen.getByText(\"Status\")).toBeInTheDocument();\n    expect(screen.getByText(\"Log\")).toBeInTheDocument();\n    expect(await screen.findByText(\"complete\")).toBeInTheDocument();\n    expect(queryClient.getQueryData([\"/api/jobs/all\"])).toEqual(jobsFixture);\n  });\n\n  test(\"clicking Update All Users button calls the correct API\", async () => {\n    axiosMock.onGet(\"/api/jobs/all\").reply(200, []);\n    axiosMock.onPost(\"/api/jobs/launch/updateAll\").reply(200, {\n      id: 1,\n      status: \"running\",\n    });\n    const queryClientSpecific = new QueryClient({\n      defaultOptions: {\n        queries: {\n          retry: false,\n          staleTime: Infinity,\n        },\n      },\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClientSpecific}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const currentUserUpdateCount = queryClientSpecific.getQueryState([\n      \"current user\",\n    ]).dataUpdateCount;\n    const updateAllUpdateCount = queryClientSpecific.getQueryState([\n      \"/api/jobs/all\",\n    ]).dataUpdateCount;\n    // Find and click the button inside the accordion\n    const updateAllUsersButton = await screen.findByTestId(\n      \"updateAllJob-job-submit\",\n    );\n    expect(updateAllUsersButton).toHaveTextContent(\"Start\");\n    fireEvent.click(updateAllUsersButton);\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n    expect(axiosMock.history.post[0].url).toBe(\"/api/jobs/launch/updateAll\");\n    expect(\n      queryClientSpecific.getQueryState([\"current user\"]).dataUpdateCount,\n    ).toBe(currentUserUpdateCount);\n    expect(\n      queryClientSpecific.getQueryState([\"/api/jobs/all\"]).dataUpdateCount,\n    ).toBe(updateAllUpdateCount + 1);\n  });\n\n  test(\"clicking Audit All Courses button calls the correct API\", async () => {\n    axiosMock.onGet(\"/api/jobs/all\").reply(200, []);\n    axiosMock.onPost(\"/api/jobs/launch/auditAllCourses\").reply(200, {\n      id: 2,\n      status: \"running\",\n    });\n    const queryClientSpecific = new QueryClient({\n      defaultOptions: {\n        queries: {\n          retry: false,\n          staleTime: Infinity,\n        },\n      },\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClientSpecific}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const currentUserUpdateCount = queryClientSpecific.getQueryState([\n      \"current user\",\n    ]).dataUpdateCount;\n    const updateAllUpdateCount = queryClientSpecific.getQueryState([\n      \"/api/jobs/all\",\n    ]).dataUpdateCount;\n    // Find and click the button inside the accordion\n    const auditAllCoursesButton = await screen.findByTestId(\n      \"auditAllCoursesJob-job-submit\",\n    );\n    expect(auditAllCoursesButton).toHaveTextContent(\"Start\");\n    fireEvent.click(auditAllCoursesButton);\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n    expect(axiosMock.history.post[0].url).toBe(\n      \"/api/jobs/launch/auditAllCourses\",\n    );\n    expect(\n      queryClientSpecific.getQueryState([\"current user\"]).dataUpdateCount,\n    ).toBe(currentUserUpdateCount);\n    expect(\n      queryClientSpecific.getQueryState([\"/api/jobs/all\"]).dataUpdateCount,\n    ).toBe(updateAllUpdateCount + 1);\n  });\n\n  test(\"clicking Purge Job Log button calls the correct API\", async () => {\n    axiosMock.onGet(\"/api/jobs/all\").reply(200, []);\n    axiosMock.onDelete(\"/api/jobs/all\").reply(200, {\n      message: \"All jobs deleted\",\n    });\n    const queryClientSpecific = new QueryClient({\n      defaultOptions: {\n        queries: {\n          retry: false,\n          staleTime: Infinity,\n        },\n      },\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClientSpecific}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const currentUserUpdateCount = queryClientSpecific.getQueryState([\n      \"current user\",\n    ]).dataUpdateCount;\n    const updateAllUpdateCount = queryClientSpecific.getQueryState([\n      \"/api/jobs/all\",\n    ]).dataUpdateCount;\n    const purgeJobLogButton = await screen.findByTestId(\"purgeJobLog\");\n    fireEvent.click(purgeJobLogButton);\n\n    await waitFor(() => expect(axiosMock.history.delete.length).toBe(1));\n    expect(axiosMock.history.delete[0].url).toBe(\"/api/jobs/all\");\n    expect(\n      queryClientSpecific.getQueryState([\"current user\"]).dataUpdateCount,\n    ).toBe(currentUserUpdateCount);\n    expect(\n      queryClientSpecific.getQueryState([\"/api/jobs/all\"]).dataUpdateCount,\n    ).toBe(updateAllUpdateCount + 1);\n  });\n});\n"},"src/tests/pages/Instructors/CoursesIndexPage.test.jsx":{"tests":[{"id":"233","name":"CoursesIndexPage tests Renders empty table for admin user correctly"},{"id":"234","name":"CoursesIndexPage tests Renders course data correctly for admin user"},{"id":"235","name":"CoursesIndexPage tests renders empty table when backend unavailable, admin only"},{"id":"236","name":"CoursesIndexPage tests Can submit new course"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport CoursesIndexPage from \"main/pages/Admin/CoursesIndexPage\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport mockConsole from \"tests/testutils/mockConsole\";\nimport coursesFixtures from \"fixtures/coursesFixtures\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { vi } from \"vitest\";\n\nconst mockToast = vi.fn();\n\nlet axiosMock;\nvi.mock(\"react-toastify\", async (importOriginal) => {\n  return {\n    ...(await importOriginal()),\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"CoursesIndexPage tests\", () => {\n  const testId = \"InstructorCoursesTable\";\n\n  beforeEach(() => {\n    axiosMock = new AxiosMockAdapter(axios);\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    queryClient.clear();\n  });\n\n  const setupAdminUser = () => {\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.adminUser);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  };\n\n  const queryClient = new QueryClient();\n\n  test(\"Renders empty table for admin user correctly\", async () => {\n    setupAdminUser();\n    axiosMock.onGet(\"/api/courses/allForAdmins\").reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CoursesIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(screen.getByText(/Courses/)).toBeInTheDocument();\n    });\n  });\n\n  test(\"Renders course data correctly for admin user\", async () => {\n    setupAdminUser();\n    axiosMock\n      .onGet(\"/api/courses/allForAdmins\")\n      .reply(200, coursesFixtures.severalCourses);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CoursesIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(`${testId}-cell-row-0-col-id`),\n      ).toHaveTextContent(\"1\");\n    });\n    expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\n      \"2\",\n    );\n    expect(screen.getByTestId(`${testId}-cell-row-2-col-id`)).toHaveTextContent(\n      \"3\",\n    );\n\n    const orgName = screen.getByText(\"wsu-cpts489-fa20\");\n    expect(orgName).toBeInTheDocument();\n\n    // For an admin user, the next two courses should have a button, not an org name\n    const button3 = screen.queryByTestId(\n      `${testId}-cell-row-2-col-orgName-button`,\n    );\n    expect(button3).toBeInTheDocument();\n    expect(button3).toHaveTextContent(\"Install GitHub App\");\n\n    const button4 = screen.queryByTestId(\n      `${testId}-cell-row-3-col-orgName-button`,\n    );\n    expect(button4).toBeInTheDocument();\n    expect(button4).toHaveTextContent(\"Install GitHub App\");\n\n    const instructorEmailButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-instructorEmail-button`,\n    );\n    expect(instructorEmailButton).toBeInTheDocument();\n    expect(instructorEmailButton).toHaveTextContent(\"diba@ucsb.edu\");\n    expect(instructorEmailButton).toHaveClass(\"btn-link\");\n  });\n\n  test(\"renders empty table when backend unavailable, admin only\", async () => {\n    setupAdminUser();\n\n    axiosMock.onGet(\"/api/courses/allForAdmins\").timeout();\n\n    const restoreConsole = mockConsole();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CoursesIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    const errorMessage = console.error.mock.calls[0][0];\n    expect(errorMessage).toMatch(\n      \"Error communicating with backend via GET on /api/courses/allForAdmins\",\n    );\n    restoreConsole();\n  });\n\n  test(\"Can submit new course\", async () => {\n    setupAdminUser();\n    axiosMock\n      .onPost(\"/api/courses/post\")\n      .reply(200, coursesFixtures.severalCourses[0]);\n    axiosMock\n      .onGet(\"/api/courses/allForAdmins\")\n      .reply(200, coursesFixtures.severalCourses);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CoursesIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const createCourse = screen.getByText(\"Create Course\");\n    expect(createCourse).toHaveClass(\"btn btn-primary\");\n    expect(createCourse).toHaveStyle(\"float: right; margin-bottom: 10px;\");\n    fireEvent.click(createCourse);\n\n    await screen.findByLabelText(\"Course Name\");\n    const courseName = screen.getByLabelText(\"Course Name\");\n    const courseTerm = screen.getByLabelText(\"Term\");\n    const school = screen.getByLabelText(\"School\");\n    fireEvent.change(courseName, { target: { value: \"CMPSC 156\" } });\n    fireEvent.change(courseTerm, { target: { value: \"Spring 2025\" } });\n    fireEvent.change(school, { target: { value: \"UCSB\" } });\n    fireEvent.click(screen.getByText(\"Create\"));\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n    expect(axiosMock.history.post[0].url).toBe(\"/api/courses/post\");\n    expect(axiosMock.history.post[0].params).toEqual({\n      courseName: \"CMPSC 156\",\n      term: \"Spring 2025\",\n      school: \"UCSB\",\n    });\n    await waitFor(() =>\n      expect(mockToast).toBeCalledWith(\"Course CMPSC 156 created\"),\n    );\n    expect(\n      queryClient.getQueryState([\"/api/courses/allForAdmins\"]),\n    ).toBeTruthy();\n    expect(screen.queryByTestId(\"CourseModal-base\")).not.toBeInTheDocument();\n  });\n});\n"},"src/tests/components/Nav/GithubLogin.test.jsx":{"tests":[{"id":"237","name":"GithubLogin tests renders correctly when not logged in to Google"},{"id":"238","name":"GithubLogin tests default link is the correct value"},{"id":"239","name":"GithubLogin tests link can be overridden via systemInfo"},{"id":"240","name":"GithubLogin tests renders correctly for user logged into Google but not Github"},{"id":"241","name":"GithubLogin tests renders correctly for admin logged into Google but not Github"},{"id":"242","name":"GithubLogin tests renders correctly for user logged into Google and Github"},{"id":"243","name":"GithubLogin tests renders correctly for admin logged into Google and Github"},{"id":"244","name":"GithubLogin tests If systemInfo is not available, use the default githubOauthLogin"}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport {\n  currentUserFixtures,\n  currentUserFixturesWithGithub,\n} from \"fixtures/currentUserFixtures\";\n\nimport GithubLogin from \"main/components/Nav/GithubLogin\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { vi } from \"vitest\";\n\ndescribe(\"GithubLogin tests\", () => {\n  const queryClient = new QueryClient();\n\n  const systemInfo = systemInfoFixtures.showingNeither; // Default system info for tests\n\n  const doLogin = vi.fn();\n\n  beforeEach(() => {\n    vi.clearAllMocks();\n  });\n\n  test(\"renders correctly when not logged in to Google\", async () => {\n    const currentUser = { loggedIn: false };\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GithubLogin\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Check for the login button\n    const loginButton = screen.getByTestId(\"GithubLogin-logged-out\");\n    expect(loginButton).toBeInTheDocument();\n  });\n\n  test(\"default link is the correct value\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GithubLogin\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Connect Github\");\n    // Check if the button is rendered with the overridden link\n    const loginButton = screen.getByRole(\"button\", {\n      name: \"Connect Github\",\n    });\n    expect(loginButton).toBeInTheDocument();\n    // Ensure the login button has the correct href\n    expect(loginButton).toHaveAttribute(\"href\", \"/oauth2/authorization/github\"); // This checks if the overridden URL is used\n  });\n\n  test(\"link can be overridden via systemInfo\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n\n    const overriddenSystemInfo = {\n      ...systemInfo, // Spread the existing system info\n      githubOauthLogin: \"/oauth2/authorization/custom-github\", // Override the oauth login URL\n    };\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GithubLogin\n            currentUser={currentUser}\n            systemInfo={overriddenSystemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Connect Github\");\n    // Check if the button is rendered with the overridden link\n    const loginButton = screen.getByRole(\"button\", {\n      name: \"Connect Github\",\n    });\n    expect(loginButton).toBeInTheDocument();\n    // Ensure the login button has the correct href\n    expect(loginButton).toHaveAttribute(\n      \"href\",\n      \"/oauth2/authorization/custom-github\",\n    ); // This checks if the overridden URL is used\n  });\n\n  test(\"renders correctly for user logged into Google but not Github\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GithubLogin\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Connect Github\");\n  });\n\n  test(\"renders correctly for admin logged into Google but not Github\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GithubLogin\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Connect Github\");\n  });\n\n  test(\"renders correctly for user logged into Google and Github\", async () => {\n    const currentUser = currentUserFixturesWithGithub.userOnly;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GithubLogin\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Github: cgaucho-github\");\n  });\n\n  test(\"renders correctly for admin logged into Google and Github\", async () => {\n    const currentUser = currentUserFixturesWithGithub.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GithubLogin\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Github: phtcon-github\");\n  });\n  test(\"If systemInfo is not available, use the default githubOauthLogin\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GithubLogin\n            currentUser={currentUser}\n            systemInfo={undefined}\n            doLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const loginButton = await screen.findByRole(\"button\", {\n      name: \"Connect Github\",\n    });\n    expect(loginButton).toBeInTheDocument();\n    expect(loginButton).toHaveAttribute(\"href\", \"/oauth2/authorization/github\");\n  });\n});\n"},"src/tests/pages/Admin/AdminsIndexPage.test.jsx":{"tests":[{"id":"245","name":"AdminsIndexPage tests Renders with New Admin Button"},{"id":"246","name":"AdminsIndexPage tests renders three item {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    const errorMessage = console.error.mock.calls[0][0];\n    expect(errorMessage).toMatch(\n      `Error communicating with backend via GET on ${getEndpoint}`,\n    );\n    restoreConsole();\n  });\n\n  test(\"what happens when you click delete\", async () => {\n    setupAdminUser();\n\n    axiosMock.onGet(getEndpoint).reply(200, roleEmailFixtures.threeItems);\n    axiosMock.onDelete(deleteEndpoint).reply(200, \"first instructor deleted\");\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminsIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(`${testId}-cell-row-0-col-email`),\n      ).toBeInTheDocument();\n    });\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-email`),\n    ).toHaveTextContent(\"instructor1@example.com\");\n\n    const deleteButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n\n    fireEvent.click(deleteButton);\n\n    await waitFor(() => {\n      expect(mockToast).toHaveBeenCalledWith(\"first instructor deleted\");\n    });\n\n    await waitFor(() => {\n      expect(axiosMock.history.delete.length).toBe(1);\n    });\n    expect(axiosMock.history.delete[0].url).toBe(deleteEndpoint);\n    expect(axiosMock.history.delete[0].params).toEqual({\n      email: \"instructor1@example.com\",\n    });\n  });\n});\n"},"src/tests/pages/Admin/InstructorsIndexPage.test.jsx":{"tests":[{"id":"249","name":"InstructorsIndexPage tests Renders with New Instructor Button"},{"id":"250","name":"InstructorsIndexPage tests renders three items correctly"},{"id":"251","name":"InstructorsIndexPage tests renders empty table when backend unavailable"},{"id":"252","name":"InstructorsIndexPage tests what happens when you click delet
