le\", \"float: right;\");\n  });\n\n  test(\"renders three items correctly\", async () => {\n    setupAdminUser();\n    axiosMock\n      .onGet(\"/api/admin/instructors/get\")\n      .reply(200, roleEmailFixtures.threeItems);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"InstructorsIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(`${testId}-cell-row-0-col-email`),\n      ).toHaveTextContent(\"instructor1@example.com\");\n    });\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-email`),\n    ).toHaveTextContent(\"admin1@example.com\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-2-col-email`),\n    ).toHaveTextContent(\"instructor2@example.com\");\n\n    // delete button should be visible\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-delete-button`),\n    ).toBeInTheDocument();\n  });\n\n  test(\"renders empty table when backend unavailable\", async () => {\n    setupAdminUser();\n\n    axiosMock.onGet(\"/api/admin/instructors/get\").timeout();\n\n    const restoreConsole = mockConsole();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"InstructorsIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    const errorMessage = console.error.mock.calls[0][0];\n    expect(errorMessage).toMatch(\n      \"Error communicating with backend via GET on /api/admin/instructors/get\",\n    );\n    restoreConsole();\n  });\n\n  test(\"what happens when you click delete\", async () => {\n    setupAdminUser();\n\n    axiosMock\n      .onGet(\"/api/admin/instructors/get\")\n      .reply(200, roleEmailFixtures.threeItems);\n    axiosMock\n      .onDelete(\"/api/admin/instructors/delete\")\n      .reply(200, \"first instructor deleted\");\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"InstructorsIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(`${testId}-cell-row-0-col-email`),\n      ).toBeInTheDocument();\n    });\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-email`),\n    ).toHaveTextContent(\"instructor1@example.com\");\n\n    const deleteButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n\n    fireEvent.click(deleteButton);\n\n    await waitFor(() => {\n      expect(mockToast).toHaveBeenCalledWith(\"first instructor deleted\");\n    });\n\n    await waitFor(() => {\n      expect(axiosMock.history.delete.length).toBe(1);\n    });\n    expect(axiosMock.history.delete[0].url).toBe(\n      \"/api/admin/instructors/delete\",\n    );\n    expect(axiosMock.history.delete[0].params).toEqual({\n      email: \"instructor1@example.com\",\n    });\n  });\n});\n"},"src/tests/pages/ProfilePage.test.jsx":{"tests":[{"id":"253","name":"ProfilePage tests renders correctly for regular logged in user"},{"id":"254","name":"ProfilePage tests renders correctly for admin user"},{"id":"255","name":"ProfilePage tests GitHub disconnect appears"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport {\n  apiCurrentUserFixtures,\n  apiCurrentUserFixturesWithGithub,\n} from \"fixtures/currentUserFixtures\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport ProfilePage from \"main/pages/ProfilePage\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { vi } from \"vitest\";\n\nconst axiosMock = new AxiosMockAdapter(axios);\nconst queryClient = new QueryClient({\n  defaultOptions: {\n    queries: {\n      retry: false,\n    },\n  },\n});\n\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async (importOriginal) => {\n  return {\n    ...(await importOriginal()),\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"ProfilePage tests\", () => {\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    queryClient.clear();\n  });\n  test(\"renders correctly for regular logged in user\", async () => {\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"ProfilePage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(screen.getByText(\"User Profile\")).toBeInTheDocument();\n    });\n\n    const header = screen.getByText(\"Current User Information\");\n    expect(header).toBeInTheDocument();\n    fireEvent.click(header);\n\n    const loggedIn = screen.getByText(\"loggedIn\");\n    expect(loggedIn).toBeInTheDocument();\n  });\n\n  test(\"renders correctly for admin user\", async () => {\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.adminUser);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"ProfilePage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(screen.getByText(\"User Profile\")).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(\"role-badge-user\")).toBeInTheDocument();\n    expect(screen.getByTestId(\"role-badge-admin\")).toBeInTheDocument();\n    expect(screen.getByTestId(\"role-badge-member\")).toBeInTheDocument();\n    expect(\n      screen.queryByTestId(\"ConfirmationModal-base\"),\n    ).not.toBeInTheDocument();\n  });\n\n  test(\"GitHub disconnect appears\", async () => {\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixturesWithGithub.adminUser);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n    axiosMock.onDelete(\"/api/github/disconnect\").reply(200, {\n      message:\n        \"Disconnected from GitHub. You may now log in with a different account.\",\n    });\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"ProfilePage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    await screen.findByText(\"Disconnect GitHub\");\n    const disconnectButton = screen.getByText(\"Disconnect GitHub\");\n    expect(disconnectButton).toHaveClass(\"btn btn-danger\");\n    expect(screen.getByTestId(\"ProfilePage-advancedFeatures\")).toHaveClass(\n      \"mt-3 g-3\",\n    );\n    fireEvent.click(disconnectButton);\n    await screen.findByTestId(\"ConfirmationModal-base\");\n    expect(\n      screen.getByText(\n        \"Are you sure you want to disconnect your Github account?\",\n      ),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByText(\"Please only do so if you know what you're doing.\"),\n    ).toBeInTheDocument();\n    const fire = screen.getByText(\"Yes, I'd like to do this\");\n    const updateCount = queryClient.getQueryState([\n      \"current user\",\n    ]).dataUpdateCount;\n    const systemInfoCount = queryClient.getQueryState([\n      \"systemInfo\",\n    ]).dataUpdateCount;\n    fireEvent.click(fire);\n    await waitFor(() =>\n      expect(\n        screen.queryByTestId(\"ConfirmationModal-base\"),\n      ).not.toBeInTheDocument(),\n    );\n    expect(axiosMock.history.delete.length).toBe(1);\n    expect(axiosMock.history.delete[0].url).toBe(\"/api/github/disconnect\");\n    expect(mockToast).toBeCalledWith(\n      \"Disconnected from GitHub. You may now log in with a different account.\",\n    );\n    expect(queryClient.getQueryState([\"current user\"]).dataUpdateCount).toBe(\n      updateCount + 1,\n    );\n    expect(queryClient.getQueryState([\"systemInfo\"]).dataUpdateCount).toBe(\n      systemInfoCount,\n    );\n  });\n});\n"},"src/tests/components/OurTable.test.jsx":{"tests":[{"id":"256","name":"OurTable tests OurTable helper tests add id when it doesn't exist"},{"id":"257","name":"OurTable tests OurTable component tests renders an empty table without crashing"},{"id":"258","name":"OurTable tests OurTable component tests renders a table with three rows with correct test ids"},{"id":"259","name":"OurTable tests OurTable component tests The button appears in the table"},{"id":"260","name":"OurTable tests OurTable component tests default testid is testid"},{"id":"261","name":"OurTable tests OurTable component tests click on a header and a sort caret should appear"},{"id":"262","name":"OurTable tests OurTable component tests placeholder headers work properly"}],"source":"import { render, waitFor, fireEvent, screen } from \"@testing-library/react\";\nimport OurTable, { ButtonColumn } from \"main/components/OurTable\";\nimport ourTableFixtures from \"fixtures/ourTableFixtures\";\nimport { vi } from \"vitest\";\nimport { convertOldStyleColumnsToNewStyle } from \"main/components/OurTableUtils\";\n\ndescribe(\"OurTable tests\", () => {\n  describe(\"OurTable helper tests\", () => {\n    test(\"add id when it doesn't exist\", () => {\n      const columns = [\n        {\n          Header: \"Column 1\",\n          accessor: \"col1\", // accessor is the \"key\" in the data\n        },\n      ];\n\n      console.log(\"columns\", columns);\n      const newColumns = convertOldStyleColumnsToNewStyle(columns);\n      console.log(\"newColumns\", newColumns);\n      const expected = [\n        {\n          id: \"col1\",\n          header: \"Column 1\",\n          accessorKey: \"col1\",\n          Header: \"Column 1\",\n          accessor: \"col1\", // accessor is the \"key\" in the data\n        },\n      ];\n\n      expect(newColumns).toEqual(expected);\n    });\n  });\n  describe(\"OurTable component tests\", () => {\n    const threeRows = [\n      {\n        col1: \"Hello\",\n        col2: \"World\",\n      },\n      {\n        col1: \"react-table\",\n        col2: \"rocks\",\n      },\n      {\n        col1: \"whatever\",\n        col2: \"you want\",\n      },\n    ];\n\n    const clickMeCallback = vi.fn();\n\n    const columns = [\n      {\n        Header: \"Column 1\",\n        accessor: \"col1\", // accessor is the \"key\" in the data\n      },\n      {\n        Header: \"Column 2\",\n        accessor: \"col2\",\n      },\n      ButtonColumn(\"Click\", \"primary\", clickMeCallback, \"testId\"),\n    ];\n\n    test(\"renders an empty table without crashing\", () => {\n      render(<"+"OurTable columns={columns} data={[]} />);\n    });\n\n    test(\"renders a table with three rows with correct test ids\", async () => {\n      render(<"+"OurTable columns={columns} data={threeRows} testid={\"testid\"} />);\n\n      await waitFor(() => {\n        expect(screen.getByTestId(\"testid-header-group-0\")).toBeInTheDocument();\n      });\n      expect(screen.getByTestId(\"testid-header-col1\")).toBeInTheDocument();\n      expect(screen.getByTestId(\"testid-header-col2\")).toBeInTheDocument();\n      expect(screen.getByTestId(\"testid-row-0\")).toBeInTheDocument();\n      expect(screen.getByTestId(\"testid-row-1\")).toBeInTheDocument();\n      expect(screen.getByTestId(\"testid-row-2\")).toBeInTheDocument();\n    });\n\n    test(\"The button appears in the table\", async () => {\n      render(<"+"OurTable columns={columns} data={threeRows} />);\n\n      await screen.findByTestId(\"testId-cell-row-0-col-Click-button\");\n      const button = screen.getByTestId(\"testId-cell-row-0-col-Click-button\");\n      fireEvent.click(button);\n      await waitFor(() => expect(clickMeCallback).toBeCalledTimes(1));\n    });\n\n    test(\"default testid is testid\", async () => {\n      render(<"+"OurTable columns={columns} data={threeRows} />);\n      await screen.findByTestId(\"testid-header-col1\");\n    });\n\n    test(\"click on a header and a sort caret should appear\", async () => {\n      render(\n        <"+"OurTable columns={columns} data={threeRows} testid={\"sampleTestId\"} />,\n      );\n\n      await screen.findByTestId(\"sampleTestId-header-col1\");\n      const col1Header = screen.getByTestId(\"sampleTestId-header-col1\");\n      expect(col1Header).toBeInTheDocument();\n\n      const col1SortCarets = screen.getByTestId(\n        \"sampleTestId-header-col1-sort-carets\",\n      );\n      expect(col1SortCarets).toBeEmptyDOMElement();\n\n      const col1Row0 = screen.getByTestId(\"sampleTestId-cell-row-0-col-col1\");\n      expect(col1Row0).toHaveTextContent(\"Hello\");\n    });\n\n    test(\"placeholder headers work properly\", async () => {\n      render(\n        <"+"OurTable\n          columns={ourTableFixtures.placeholderExample.columns}\n          data={ourTableFixtures.placeholderExample.data}\n          testid={\"placeholderHeadersTest\"}\n        />,\n      );\n      await waitFor(() => {\n        expect(\n          screen.getByTestId(\"placeholderHeadersTest-header-group-0\"),\n        ).toBeInTheDocument();\n      });\n      const firstNameHeader = screen.getByTestId(\n        \"placeholderHeadersTest-header-firstName-sort-header\",\n      );\n      expect(firstNameHeader).toBeInTheDocument();\n      expect(firstNameHeader).toHaveTextContent(\"First Name\");\n      expect(firstNameHeader).toHaveAttribute(\"style\", \"cursor: pointer;\");\n    });\n  });\n});\n"},"src/tests/pages/Admin/InstructorsCreatePage.test.jsx":{"tests":[{"id":"263","name":"InstructorsCreatePage tests renders without crashing"},{"id":"264","name":"InstructorsCreatePage tests on submit, makes request to backend, and redirects to /admin/instructors"},{"id":"265","name":"InstructorsCreatePage tests on storybook, no redirect"}],"source":"import { render, screen, fireEvent, waitFor } from \"@testing-library/react\";\nimport InstructorsCreatePage from \"main/pages/Admin/InstructorsCreatePage\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter } from \"react-router\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { vi } from \"vitest\";\n\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async (importOriginal) => {\n  return {\n    ...(await importOriginal()),\n    toast: (x) => mockToast(x),\n  };\n});\n\nconst mockedNavigate = vi.fn();\nvi.mock(\"react-router\", async (importOriginal) => ({\n  ...(await importOriginal()),\n  useNavigate: () => mockedNavigate,\n}));\n\ndescribe(\"InstructorsCreatePage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    vi.clearAllMocks();\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  });\n\n  const queryClient = new QueryClient();\n  test(\"renders without crashing\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"InstructorsCreatePage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(screen.getByLabelText(\"Email\")).toBeInTheDocument();\n    });\n  });\n\n  test(\"on submit, makes request to backend, and redirects to /admin/instructors\", async () => {\n    const queryClient = new QueryClient();\n    const instructor = {\n      email: \"testemailone@ucsb.edu\",\n    };\n\n    axiosMock.onPost(\"/api/admin/instructors/post\").reply(202, instructor);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"InstructorsCreatePage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(screen.getByLabelText(\"Email\")).toBeInTheDocument();\n    });\n\n    const emailInput = screen.getByLabelText(\"Email\");\n    expect(emailInput).toBeInTheDocument();\n\n    const createButton = screen.getByText(\"Create\");\n    expect(createButton).toBeInTheDocument();\n\n    fireEvent.change(emailInput, {\n      target: { value: \"testemailone@ucsb.edu\" },\n    });\n\n    fireEvent.click(createButton);\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n    expect(axiosMock.history.post[0].params).toEqual({\n      email: \"testemailone@ucsb.edu\",\n    });\n\n    // assert - check that the toast was called with the expected message\n    expect(mockToast).toHaveBeenCalledWith(\n      \"New instructor added - email: testemailone@ucsb.edu\",\n    );\n    await waitFor(() => {\n      expect(mockedNavigate).toHaveBeenCalledWith(\"/admin/instructors\");\n    });\n  });\n\n  test(\"on storybook, no redirect\", async () => {\n    const queryClient = new QueryClient();\n    const instructor = {\n      email: \"testemailone@ucsb.edu\",\n    };\n\n    axiosMock.onPost(\"/api/admin/instructors/post\").reply(202, instructor);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"InstructorsCreatePage storybook={true} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(screen.getByLabelText(\"Email\")).toBeInTheDocument();\n    });\n\n    const emailInput = screen.getByLabelText(\"Email\");\n    expect(emailInput).toBeInTheDocument();\n\n    const createButton = screen.getByText(\"Create\");\n    expect(createButton).toBeInTheDocument();\n\n    fireEvent.change(emailInput, {\n      target: { value: \"testemailone@ucsb.edu\" },\n    });\n\n    fireEvent.click(createButton);\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n    expect(axiosMock.history.post[0].params).toEqual({\n      email: \"testemailone@ucsb.edu\",\n    });\n\n    // assert - check that the toast was called with the expected message\n    expect(mockToast).toHaveBeenCalledWith(\n      \"New instructor added - email: testemailone@ucsb.edu\",\n    );\n    await waitFor(() => {\n      expect(mockedNavigate).not.toHaveBeenCalledWith(\"/admin/instructors\");\n    });\n  });\n});\n"},"src/tests/pages/Auth/PromptSignInPage.test.jsx":{"tests":[{"id":"266","name":"SignInPage Tests Renders Google card with oauthLogin present"},{"id":"267","name":"SignInPage Tests Renders Active Directory card with activeDirectoryUrl present"},{"id":"268","name":"SignInPage Tests Base environment test"}],"source":"import AxiosMockAdapter from \"axios-mock-adapter\";\nimport axios from \"axios\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { fireEvent, render, screen, within } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport PromptSignInPage from \"main/pages/Auth/PromptSignInPage\";\n\nconst axiosMock = new AxiosMockAdapter(axios);\nconst queryClient = new QueryClient();\ndescribe(\"SignInPage Tests\", () => {\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    queryClient.clear();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n  });\n\n  test(\"Renders Google card with oauthLogin present\", async () => {\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter initialEntries={[\"/example/return\"]}>\n          <"+"PromptSignInPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Sign in with Google\");\n    expect(screen.getByTestId(\"SignInPage-googleIcon\")).toBeInTheDocument();\n    expect(screen.getByText(\"Sign in with Google\")).toBeInTheDocument();\n    expect(\n      screen.getByText(\n        \"If you have credentials with these schools, sign in with Google\",\n      ),\n    ).toBeInTheDocument();\n    expect(screen.getByText(\"Chico State University\")).toBeInTheDocument();\n    expect(\n      screen.getByText(\"University of California, Santa Barbara\"),\n    ).toBeInTheDocument();\n    expect(\n      within(screen.getByTestId(\"SignInCard-base-google\")).getByText(\"Log In\"),\n    ).toHaveAttribute(\"href\", \"/oauth2/authorization/google\");\n    expect(screen.getByRole(\"img\")).toHaveAttribute(\"height\", \"10em\");\n    expect(screen.getByRole(\"img\")).toHaveAttribute(\"width\", \"10em\");\n    fireEvent.click(\n      within(screen.getByTestId(\"SignInCard-base-google\")).getByText(\"Log In\"),\n    );\n    expect(sessionStorage.getItem(\"redirect\")).toBe(\"/example/return\");\n  });\n\n  test(\"Renders Active Directory card with activeDirectoryUrl present\", async () => {\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.withActiveDirectory);\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PromptSignInPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    await screen.findByText(\"Sign in with Microsoft\");\n    expect(screen.getByTestId(\"SignInPage-microsoftIcon\")).toBeInTheDocument();\n    expect(screen.getByTestId(\"SignInCard-base-microsoft\")).toBeInTheDocument();\n    expect(screen.getByText(\"Sign in with Microsoft\")).toBeInTheDocument();\n    expect(\n      screen.getByText(\n        \"If you have credentials with these schools, sign in with Microsoft\",\n      ),\n    ).toBeInTheDocument();\n    expect(screen.getByText(\"Oregon State University\")).toBeInTheDocument();\n    expect(\n      within(screen.getByTestId(\"SignInCard-base-microsoft\")).getByText(\n        \"Log In\",\n      ),\n    ).toHaveAttribute(\"href\", \"/oauth2/authorization/azure-dev\");\n    expect(screen.getByRole(\"img\")).toHaveAttribute(\"height\", \"10em\");\n    expect(screen.getByRole(\"img\")).toHaveAttribute(\"width\", \"10em\");\n  });\n\n  test(\"Base environment test\", () => {\n    axiosMock.onGet(\"/api/systemInfo\").timeout();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PromptSignInPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.getByTestId(\"SignInPage-cardDisplay\")).toHaveClass(\n      \"g-5 justify-content-center align-items-center\",\n      \"d-flex\",\n      \"gap-5\",\n    );\n    expect(\n      screen.getByText(\"Please sign in before accessing this page.\"),\n    ).toHaveClass(\"alert-danger\");\n  });\n});\n"},"src/tests/components/RosterStudent/RosterStudentForm.test.jsx":{"tests":[{"id":"269","name":"RosterStudentForm tests renders correctly with no initialContents"},{"id":"270","name":"RosterStudentForm tests renders correctly when passing in initialContents"},{"id":"271","name":"RosterStudentForm tests that navigate(-1) is called when Cancel is clicked"},{"id":"272","name":"RosterStudentForm tests that the correct validations are performed"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { BrowserRouter as Router } from \"react-router\";\n\nimport RosterStudentForm from \"main/components/RosterStudent/RosterStudentForm\";\nimport { rosterStudentFixtures } from \"fixtures/rosterStudentFixtures\";\n\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { vi } from \"vitest\";\n\nconst mockedNavigate = vi.fn();\nvi.mock(\"react-router\", async (importOriginal) => ({\n  ...(await importOriginal()),\n  useNavigate: () => mockedNavigate,\n}));\n\ndescribe(\"RosterStudentForm tests\", () => {\n  const queryClient = new QueryClient();\n\n  const expectedHeaders = [\"Student Id\", \"First Name\", \"Last Name\", \"Email\"];\n  const testId = \"RosterStudentForm\";\n\n  test(\"renders correctly with no initialContents\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"RosterStudentForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(/Create/)).toBeInTheDocument();\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n  });\n\n  test(\"renders correctly when passing in initialContents\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"RosterStudentForm\n            initialContents={rosterStudentFixtures.oneStudent}\n          />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(/Create/)).toBeInTheDocument();\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(\n      await screen.findByTestId(`${testId}-studentId`),\n    ).toBeInTheDocument();\n    expect(screen.getByText(`Student Id`)).toBeInTheDocument();\n    expect(\n      await screen.findByTestId(`${testId}-firstName`),\n    ).toBeInTheDocument();\n    expect(screen.getByText(`First Name`)).toBeInTheDocument();\n    expect(await screen.findByTestId(`${testId}-lastName`)).toBeInTheDocument();\n    expect(screen.getByText(`Last Name`)).toBeInTheDocument();\n    expect(await screen.findByTestId(`${testId}-email`)).toBeInTheDocument();\n    expect(screen.getByText(`Email`)).toBeInTheDocument();\n    expect(await screen.findByTestId(`${testId}-submit`)).toBeInTheDocument();\n  });\n\n  test(\"that navigate(-1) is called when Cancel is clicked\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"RosterStudentForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n    expect(await screen.findByTestId(`${testId}-cancel`)).toBeInTheDocument();\n    const cancelButton = screen.getByTestId(`${testId}-cancel`);\n\n    fireEvent.click(cancelButton);\n\n    await waitFor(() => expect(mockedNavigate).toHaveBeenCalledWith(-1));\n  });\n\n  test(\"that the correct validations are performed\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"RosterStudentForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(/Create/)).toBeInTheDocument();\n    const submitButton = screen.getByText(/Create/);\n    fireEvent.click(submitButton);\n\n    await screen.findByText(/Student Id is required/);\n    expect(screen.getByText(/First Name is required/)).toBeInTheDocument();\n    expect(screen.getByText(/Last Name is required/)).toBeInTheDocument();\n    expect(screen.getByText(/Email is required/)).toBeInTheDocument();\n\n    fireEvent.change(screen.getByLabelText(\"Email\"), {\n      target: {\n        value: \"invalidemail\",\n      },\n    });\n\n    fireEvent.click(submitButton);\n    await screen.findByText(/Please enter a valid email/);\n  });\n});\n"},"src/tests/pages/HomePageConnectGithub.test.js lient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      axiosMock.onGet(\"/api/systemInfo\").timeoutOnce();\n      axiosMock\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingNeither);\n\n      const restoreConsole = mockConsole();\n\n      const { result } = renderHook(() => useSystemInfo(), { wrapper });\n      await waitFor(() => result.current.isSuccess);\n\n      expect(result.current.data).toEqual({\n        initialData: true,\n        springH2ConsoleEnabled: false,\n        showSwaggerUILink: false,\n      });\n\n      const queryState = queryClient.getQueryState([\"systemInfo\"]);\n      expect(queryState).toBeDefined();\n\n      queryClient.clear();\n\n      await waitFor(() => expect(console.error).toHaveBeenCalled());\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(/Error invoking axios.get:/);\n      restoreConsole();\n    });\n\n    test(\"useSystemInfo retrieves data from API\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      axiosMock\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingBoth);\n\n      const { result } = renderHook(() => useSystemInfo(), { wrapper });\n\n      await waitFor(() =>\n        expect(result.current.isFetchedAfterMount).toBe(true),\n      );\n\n      expect(result.current.data).toEqual(systemInfoFixtures.showingBoth);\n      queryClient.clear();\n    });\n\n    test(\"systemInfo when API unreachable\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      axiosMock.onGet(\"/api/systemInfo\").reply(404);\n\n      const restoreC r(<"+"SortCaret header={header} testId={testid} />);\n    const expectedTestId = `${testid}-header-${header.column.id}-sort-carets`;\n    await waitFor(() => {\n      expect(screen.getByTestId(expectedTestId)).toBeInTheDocument();\n    });\n    expect(screen.getByTestId(expectedTestId)).toBeEmptyDOMElement();\n  });\n\n  test(\"Down arrow when desc\", async () => {\n    const header = {\n      column: {\n        id: \"testColumn\",\n        getCanSort: () => true,\n        getIsSorted: () => \"desc\",\n      },\n    };\n    const testid = \"customTestId\";\n\n    render(<"+"SortCaret header={header} testId={testid} />);\n    const expectedTestId = `${testid}-header-${header.column.id}-sort-carets`;\n    await waitFor(() => {\n      expect(screen.getByTestId(expectedTestId)).toBeInTheDocument();\n    });\n    expect(screen.getByTestId(expectedTestId)).toHaveTextContent(\"🔽\");\n  });\n});\n"},"src/tests/components/Teams/TeamMemberForm.test.jsx":{"tests":[{"id":"297","name":"TeamMemberForm tests renders correctly with no initialContents"},{"id":"298","name":"TeamMemberForm tests renders correctly when passing in initialContents"},{"id":"299","name":"TeamMemberForm tests that navigate(-1) is called when Cancel is clicked"},{"id":"300","name":"TeamMemberForm tests that the correct validations are performed"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { BrowserRouter as Router } from \"react-router\";\n\nimport { teamsFixtures } from \"fixtures/TeamsFixtures\";\n\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { vi } from \"vitest\";\nimport TeamMemberForm from \"main/components/Teams/TeamMemberForm\";\n\nconst mockedNavigate = vi.fn();\nvi.mock(\"react-router\", async (importOriginal) => ({\n  ...(await importOriginal()),\n  useNavigate: () => mockedNavigate,\n}));\n\ndescribe(\"TeamMemberForm tests\", () => {\n  const queryClient = new QueryClient();\n\n  const expectedHeaders = [\"Roster Student ID\"];\n  const testId = \"TeamMemberForm\";\n\n  test(\"renders correctly with no initialContents\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"TeamMemberForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(/Create/)).toBeInTheDocument();\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n  });\n\n  test(\"renders correctly when passing in initialContents\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"TeamMemberForm\n            initialContents={\n              teamsFixtures.teams[0].teamMembers[0].rosterStudent.id\n            }\n          />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(/Create/)).toBeInTheDocument();\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(\n      await screen.findByTestId(`${testId}-rosterStudentId`),\n    ).toBeInTheDocument();\n    expect(await screen.findByTestId(`${testId}-submit`)).toBeInTheDocument();\n  });\n\n  test(\"that navigate(-1) is called when Cancel is clicked\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"TeamMemberForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n    expect(await screen.findByTestId(`${testId}-cancel`)).toBeInTheDocument();\n    const cancelButton = screen.getByTestId(`${testId}-cancel`);\n\n    fireEvent.click(cancelButton);\n\n    await waitFor(() => expect(mockedNavigate).toHaveBeenCalledWith(-1));\n  });\n\n  test(\"that the correct validations are performed\", async () => {\n    render(\n      <"+"QueryClientProvid QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminUsersPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    await screen.findByText(\"Users\");\n    await screen.findByTestId(\"OurPagination-2\");\n    const filteredMockHistory = axiosMock.history.get.filter(({ url }) =>\n      url.includes(\"/api/admin/users\"),\n    );\n    expect(filteredMockHistory.length).toBe(1);\n    expect(filteredMockHistory[0].url).toBe(\"/api/admin/users\");\n    expect(filteredMockHistory[0].params).toEqual({\n      page: 0,\n      size: 50,\n      sort: \"id\",\n    });\n  });\n\n  test(\"renders empty table when backend unavailable\", async () => {\n    const queryClient = new QueryClient();\n    axiosMock.onGet(\"/api/admin/users\").timeout();\n\n    const restoreConsole = mockConsole();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminUsersPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    const errorMessage = console.error.mock.calls[0][0];\n    expect(errorMessage).toMatch(\n      \"Error communicating with backend via GET on /api/admin/users\",\n    );\n    restoreConsole();\n\n    expect(\n      screen.queryByTestId(`${testId}-cell-row-0-col-id`),\n    ).not.toBeInTheDocument();\n\n    expect(screen.getByTestId(\"OurPagination-1\")).toBeInTheDocument();\n    expect(screen.queryByTestId(\"OurPagination-2\")).not.toBeInTheDocument();\n  });\n});\n"},"src/tests/components/Jobs/JobsTable.test.jsx":{"tests":[{"id":"303","name":"JobsTable tests renders without crashing for empty table"},{"id":"304","name":"JobsTable tests renders correctly with jobs data"}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport JobsTable from \"main/components/Jobs/JobsTable\";\nimport { formatTime } from \"main/utils/dateUtils\";\nimport { vi } from \"vitest\";\n\nvi.mock(\"main/utils/dateUtils\", () => ({\n  formatTime: vi.fn(),\n}));\n\ndescribe(\"JobsTable tests\", () => {\n  const queryClient = new QueryClient();\n\n  beforeEach(() => {\n    formatTime.mockReset();\n  });\n\n  test(\"renders without crashing for empty table\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"JobsTable jobs={[]} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"renders correctly with jobs data\", () => {\n    // Mock the formatTime function to return predictable values\n    formatTime\n      .mockReturnValueOnce(\"2023-01-01 10:00:00\") // for createdAt\n      .mockReturnValueOnce(\"2023-01-01 10:05:00\"); // for updatedAt\n\n    const jobsFixture = [\n      {\n        id: 1,\n        createdAt: \"2023-01-01T10:00:00\",\n        updatedAt: \"2023-01-01T10:05:00\",\n        status: \"complete\",\n        log: \"Job completed successfully\",\n      },\n    ];\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"JobsTable jobs={jobsFixture} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Check that the table headers are rendered\n    expect(screen.getByText(\"id\")).toBeInTheDocument();\n    expect(screen.getByText(\"Created\")).toBeInTheDocument();\n    expect(screen.getByText(\"Updated\")).toBeInTheDocument();\n    expect(screen.getByText(\"Status\")).toBeInTheDocument();\n    expect(screen.getByText(\"Log\")).toBeInTheDocument();\n\n    // Check that the job data is rendered\n    expect(screen.getByText(\"1\")).toBeInTheDocument();\n    expect(screen.getByText(\"2023-01-01 10:00:00\")).toBeInTheDocument();\n    expect(screen.getByText(\"2023-01-01 10:05:00\")).toBeInTheDocument();\n    expect(screen.getByText(\"complete\")).toBeInTheDocument();\n    expect(screen.getByText(\"Job completed successfully\")).toBeInTheDocument();\n    expect(screen.getByTestId(\"JobsTable-header-log\")).toBeInTheDocument();\n    expect(screen.getByText(\"Job completed successfully\")).toHaveStyle({\n      whiteSpace: \"pre-wrap\",\n    });\n    expect(screen.getByTestId(\"JobsTable-cell-row-0-col-log-div\")).toHaveStyle(\n      \"max-width: 450px; max-height: 100px; overflow-y: auto;\",\n    );\n\n    // Verify formatTime was called with the correct arguments\n    expect(formatTime).toHaveBeenCalledTimes(2);\n    expect(formatTime).toHaveBeenNthCalledWith(1, \"2023-01-01T10:00:00\");\n    expect(formatTime).toHaveBeenNthCalledWith(2, \"2023-01-01T10:05:00\");\n  });\n});\n"},"src/tests/pages/Help/HelpCsvPage.test.jsx":{"tests":[{"id":"305","name":"HelpCsvPage tests renders with separate Team Information section and examples"}],"source":"import { render, screen, within } from \"@testing-library/react\";\nimport HelpCsvPage from \"main/pages/Help/HelpCsvPage\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter } from \"react-router\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\ndescribe(\"HelpCsvPage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n  axiosMock\n    .onGet(\"/api/currentUser\")\n    .reply(200, apiCurrentUserFixtures.userOnly);\n  axiosMock\n    .onGet(\"/api/systemInfo\")\n    .reply(200, systemInfoFixtures.showingNeither);\n\n  const queryClient = new QueryClient();\n  test(\"renders with separate Team Information section and examples\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"HelpCsvPage />\n rm\";\n\n  test(\"renders correctly\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"RoleEmailForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(/Create/)).toBeInTheDocument();\n\n    expect(await screen.findByTestId(`${testId}-email`)).toBeInTheDocument();\n    expect(screen.getByText(`Email`)).toBeInTheDocument();\n    expect(await screen.findByTestId(`${testId}-submit`)).toBeInTheDocument();\n  });\n\n  test(\"that navigate(-1) is called when Cancel is clicked\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"RoleEmailForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n    expect(await screen.findByTestId(`${testId}-cancel`)).toBeInTheDocument();\n    const cancelButton = screen.getByTestId(`${testId}-cancel`);\n\n    fireEvent.click(cancelButton);\n\n    await waitFor(() => expect(mockedNavigate).toHaveBeenCalledWith(-1));\n  });\n\n  test(\"that the correct validations are performed\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"RoleEmailForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(/Create/)).toBeInTheDocument();\n    const submitButton = screen.getByText(/Create/);\n    fireEvent.click(submitButton);\n\n    await screen.findByText(/A valid email is required./);\n\n    const endInput = screen.getByTestId(`${testId}-email`);\n    fireEvent.change(endInput, { target: { value: \"email\" } });\n    fireEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(\n        screen.getByText(/A valid email is required./),\n      ).toBeInTheDocument();\n    });\n  });\n});\n"},"src/tests/components/Nav/GoogleLogin.test.jsx":{"tests":[{"id":"313","name":"GoogleLogin tests renders correctly for regular logged in user"},{"id":"314","name":"GoogleLogin tests renders correctly for admin user"},{"id":"315","name":"GoogleLogin tests renders login button when not logged in"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\n\nimport GoogleLogin from \"main/components/Nav/GoogleLogin\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { vi } from \"vitest\";\n\ndescribe(\"GoogleLogin tests\", () => {\n  const queryClient = new QueryClient();\n\n  const systemInfo = systemInfoFixtures.showingNeither; // Default system info for tests\n\n  test(\"renders correctly for regular logged in user\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n\n    const doLogin = vi.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GoogleLogin\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            handleLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Welcome, pconrad.cis@gmail.com\");\n  });\n\n  test(\"renders correctly for admin user\", async () => {\n    const currentUser = currentUserFixtures.adminUser;\n    const doLogin = vi.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GoogleLogin\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            handleLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Welcome, phtcon@ucsb.edu\");\n  });\n\n  test(\"renders login button when not logged in\", async () => {\n    const currentUser = { loggedIn: false };\n    const doLogin = vi.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GoogleLogin\n            currentUser={currentUser}\n            systemInfo={systemInfo}\n            handleLogin={doLogin}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Check for the login button\n    const loginButton = screen.getByText(\"Log In\");\n    fireEvent.click(loginButton);\n    await waitFor(() => {\n      expect(doLogin).toHaveBeenCalledTimes(1);\n    });\n  });\n});\n"},"src/tests/pages/Auth/ProtectedPage.test.jsx":{"tests":[{"id":"316","name":"ProtectedPage tests Renders blank on initialData"},{"id":"317","name":"ProtectedPage tests Renders AccessDenied on missing role"},{"id":"318","name":"ProtectedPage tests Renders ProtectedPage on correct role"},{"id":"319","name":"ProtectedPage tests Renders PromptSignInPage on no user"}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { BrowserRouter } from \"react-router\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport ProtectedPage from \"main/pages/Auth/ProtectedPage\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\n\nconst queryClient = new QueryClient();\n\ndescribe(\"ProtectedPage tests\", () => {\n  beforeEach(() => {\n    queryClient.clear();\n  });\n  test(\"Renders blank on initialData\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"BrowserRouter>\n          <"+"ProtectedPage\n            currentUser={{ root: null, initialData: true, rolesList: [] }}\n            enforceRole={\"ROLE_USER\"}\n          />\n        <"+"/BrowserRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.getByTestId(\"LoadingPage-main-div\")).toBeInTheDocument();\n  });\n  test(\"Renders AccessDenied on missing role\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"BrowserRouter>\n          <"+"ProtectedPage\n            currentUser={currentUserFixtures.instructorUser}\n            enforceRole={\"ROLE_ADMIN\"}\n          />\n        <"+"/BrowserRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"You do not have access to this page.\");\n  });\n\n  test(\"Renders ProtectedPage on correct role\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"BrowserRouter>\n          <"+"ProtectedPage\n            currentUser={currentUserFixtures.instructorUser}\n            enforceRole={\"ROLE_INSTRUCTOR\"}\n            component={<"+"div>Renders successfully.<"+"/div>}\n          />\n        <"+"/BrowserRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Renders successfully.\");\n  });\n\n  test(\"Renders PromptSignInPage on no user\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"BrowserRouter>\n          <"+"ProtectedPage\n            currentUser={currentUserFixtures.notLoggedIn}\n            enforceRole={\"ROLE_USER\"}\n          />\n        <"+"/BrowserRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Please sign in before accessing this page.\");\n  });\n});\n"},"src/tests/components/Auth/SignInCard.test.jsx":{"tests":[{"id":"320","name":"SignInCard Tests Card renders with required properties"},{"id":"321","name":"SignInCard Tests Card renders with default testId"}],"source":"import { FcGoogle } from \"react-icons/fc\";\nimport { render, screen } from \"@testing-library/react\";\nimport SignInCard from \"main/components/Auth/SignInCard\";\n\nconst exampleIcon = () => {\n  return <"+"FcGoogle size={\"10em\"} />;\n};\n\ndescribe(\"SignInCard Tests\", () => {\n  test(\"Card renders with required properties\", () => {\n    render(\n      <"+"SignInCard\n        Icon={exampleIcon}\n        title={\"Sign In with Google\"}\n        description={\"Boilerplate description\"}\n        url={\"/fakeUrl/fakePath\"}\n        testid={\"google\"}\n      />,\n    );\n\n    expect(screen.getByText(\"Sign In with Google\")).toBeInTheDocument();\n    expect(screen.getByText(\"Boilerplate description\")).toBeInTheDocument();\n    expect(screen.getByText(\"Log In\")).toHaveAttribute(\n      \"href\",\n      \"/fakeUrl/fakePath\",\n    );\n    expect(screen.getByTestId(\"SignInCard-footer-google\")).toHaveClass(\n      \"text-center\",\n    );\n    expect(screen.getByTestId(\"SignInCard-header-google\")).toHaveClass(\n      \"text-center\",\n    );\n    expect(screen.getByTestId(\"SignInCard-base-google\")).toHaveStyle(\n      \"width: 18rem\",\n    );\n  });\n\n  test(\"Card renders with default testId\", () => {\n    render(\n      <"+"SignInCard\n        Icon={exampleIcon}\n        title={\"Sign In with Google\"}\n        description={\"Boilerplate description\"}\n        url={\"/fakeUrl/fakePath\"}\n      />,\n    );\n\n    expect(screen.getByText(\"Sign In with Google\")).toBeInTheDocument();\n    expect(screen.getByText(\"Boilerplate description\")).toBeInTheDocument();\n    expect(screen.getByText(\"Log In\")).toHaveAttribute(\n      \"href\",\n      \"/fakeUrl/fakePath\",\n    );\n    expect(screen.getByTestId(\"SignInCard-footer-default\")).toHaveClass(\n      \"text-center\",\n    );\n    expect(screen.getByTestId(\"SignInCard-header-default\")).toHaveClass(\n      \"text-center\",\n    );\n    expect(screen.getByTestId(\"SignInCard-base-default\")).toHaveStyle(\n      \"width: 18rem\",\n    );\n  });\n});\n"},"src/tests/components/Users/UsersTable.test.jsx":{"tests":[{"id":"322","name":"UserTable tests renders without crashing for empty table"},{"id":"323","name":"UserTable tests renders without crashing for three users"},{"id":"324","name":"UserTable tests Has the expected colum headers and content"}],"source":"import { render, screen } from \"@testing-library/react\";\nimport usersFixtures from \"fixtures/usersFixtures\";\nimport UsersTable from \"main/components/Users/UsersTable\";\n\ndescribe(\"UserTable tests\", () => {\n  test(\"renders without crashing for empty table\", () => {\n    render(<"+"UsersTable users={[]} />);\n  });\n\n  test(\"renders without crashing for three users\", () => {\n    render(<"+"UsersTable users={usersFixtures.threeUsers} />);\n  });\n\n  test(\"Has the expected colum headers and content\", () => {\n    render(<"+"UsersTable users={usersFixtures.threeUsers} />);\n\n    const expectedHeaders = [\n      \"id\",\n      \"First Name\",\n      \"Last Name\",\n      \"Email\",\n      \"Admin\",\n      \"Instructor\",\n    ];\n    const expectedFields = [\n      \"id\",\n      \"givenName\",\n      \"familyName\",\n      \"email\",\n      \"admin\",\n      \"instructor\",\n    ];\n    const testId = \"UsersTable\";\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\n      \"1\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-admin`),\n    ).toHaveTextContent(\"true\");\n    expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\n      \"2\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-admin`),\n    ).toHaveTextContent(\"false\");\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-2-col-instructor`),\n    ).toHaveTextContent(\"true\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-instructor`),\n    ).toHaveTextContent(\"false\");\n  });\n});\n"},"src/tests/components/Common/GithubSettingIcon.test.jsx":{"tests":[{"id":"325","name":"GithubSettingIcon tests renders correctly with defaults"},{"id":"326","name":"GithubSettingIcon tests renders correctly with custom props"}],"source":"import { render, screen } from \"@testing-library/react\";\nimport GithubSettingIcon from \"main/components/Common/GithubSettingIcon\";\n\ndescribe(\"GithubSettingIcon tests\", () => {\n  test(\"renders correctly with defaults\", () => {\n    render(<"+"GithubSettingIcon />);\n\n    const container = screen.getByTestId(\"GithubSettingIcon\");\n    expect(container).toBeInTheDocument();\n\n    // Check Github icon\n    const githubIcon = screen.getByTestId(\"GithubSettingIcon-github-icon\");\n    expect(githubIcon).toBeInTheDocument();\n    expect(githubIcon).toHaveAttribute(\"color\", \"black\");\n\n    // Check Gear icon\n    const gearIcon = screen.getByTestId(\"GithubSettingIcon-settings-icon\");\n    expect(gearIcon).toBeInTheDocument();\n    expect(gearIcon).toHaveAttribute(\"color\", \"blue\");\n    expect(\n      screen.getByTestId(\"GithubSettingIcon-github-icon\"),\n    ).toBeInTheDocument();\n    expect(gearIcon).toHaveStyle({\n      position: \"relative\",\n      top: \"0px\",\n    });\n    expect(gearIcon).toHaveStyle({\n      left: \"0px\",\n      transform: \"translate(-15%, 60%)\",\n    });\n  });\n  test(\"renders correctly with custom props\", () => {\n    render(<"+"GithubSettingIcon size={32} gearColor=\"red\" githubColor=\"blue\" />);\n    expect(\n      screen.getByTestId(\"GithubSettingIcon-github-icon\"),\n    ).toBeInTheDocument();\n    const settingsIcon = screen.getByTestId(\"GithubSettingIcon-settings-icon\");\n    expect(settingsIcon).toBeInTheDocument();\n    expect(settingsIcon).toHaveStyle({\n      position: \"relative\",\n      top: \"0px\",\n    });\n    expect(settingsIcon).toHaveStyle({\n      left: \"0px\",\n      transform: \"translate(-15%, 60%)\",\n    });\n  });\n});\n"},"src/tests/components/Common/ConfirmationModal.test.jsx":{"tests":[{"id":"327","name":"Sanity Check Modal works as designed"}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport ConfirmationModal from \"main/components/Common/ConfirmationModal\";\nimport { vi } from \"vitest\";\n\ntest(\"Sanity Check Modal works as designed\", async () => {\n  const mockSubmit = vi.fn();\n  const showModal = vi.fn();\n  const toggleShowModal = vi.fn();\n  render(\n    <"+"div\n      className=\"modal show\"\n      style={{ display: \"block\", position: \"initial\" }}\n    >\n      <"+"ConfirmationModal\n        showModal={showModal}\n        setShowModal={(x) => toggleShowModal(x)}\n        onYes={mockSubmit}\n      >\n        <"+"p>renders child!<"+"/p>\n      <"+"/ConfirmationModal>\n    <"+"/div>,\n  );\n\n  expect(screen.getByText(\"Are You Sure?\")).toBeInTheDocument();\n  expect(screen.getByText(\"No, take me back\")).toBeInTheDocument();\n  expect(screen.getByText(\"Yes, I'd like to do this\")).toHaveClass(\n    \"ms-auto\",\n    \"btn-danger\",\n  );\n  expect(screen.getByText(\"renders child!\")).toBeInTheDocument();\n  fireEvent.click(screen.getByText(\"Yes, I'd like to do this\"));\n  await waitFor(() => expect(toggleShowModal).toHaveBeenCalledTimes(1));\n  expect(toggleShowModal).toHaveBeenCalledWith(false);\n  expect(mockSubmit).toHaveBeenCalledTimes(1);\n  fireEvent.click(screen.getByText(\"No, take me back\"));\n  await waitFor(() => expect(toggleShowModal).toHaveBeenCalledTimes(2));\n  expect(toggleShowModal).toHaveBeenCalledWith(false);\n  expect(screen.getByTestId(\"ConfirmationModal-closeButton\")).toHaveClass(\n    \"btn-close\",\n  );\n  expect(screen.getByTestId(\"ConfirmationModal-base\")).toHaveClass(\n    \"modal-dialog-centered\",\n  );\n});\n"},"src/tests/pages/Auth/SignInSuccessPage.test.jsx":{"tests":[{"id":"328","name":"SignInSuccessPage tests Page redirects correctly on set value"},{"id":"329","name":"SignInSuccessPage tests Page redirects to / on no value"}],"source":"import { render, waitFor, screen } from \"@testing-library/react\";\nimport { BrowserRouter } from \"react-router\";\nimport SignInSuccessPage from \"main/pages/Auth/SignInSuccessPage\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport mockConsole from \"tests/testutils/mockConsole\";\nimport { vi } from \"vitest\";\n\nconst queryClient = new QueryClient();\n\nconst mockedNavigate = vi.fn();\nvi.mock(\"react-router\", async (importOriginal) => ({\n  ...(await importOriginal()),\n  useNavigate: () => mockedNavigate,\n}));\ndescribe(\"SignInSuccessPage tests\", () => {\n  beforeEach(() => {\n    queryClient.clear();\n    sessionStorage.clear();\n  });\n  test(\"Page redirects correctly on set value\", async () => {\n    const restoreConsole = mockConsole();\n    sessionStorage.setItem(\"redirect\", \"return-url\");\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"BrowserRouter>\n          <"+"SignInSuccessPage />\n        <"+"/BrowserRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => expect(mockedNavigate).toBeCalledWith(\"return-url\"));\n    expect(screen.getByText(\"Redirecting...\")).toBeInTheDocument();\n    restoreConsole();\n  });\n\n  test(\"Page redirects to / on no value\", async () => {\n    const restoreConsole = mockConsole();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"BrowserRouter>\n          <"+"SignInSuccessPage />\n        <"+"/BrowserRouter>\n      <"+"/QueryClientProvider>,\n    );\n    await waitFor(() => expect(mockedNavigate).toBeCalledWith(\"/\"));\n    restoreConsole();\n  });\n});\n"},"src/tests/pages/Admin/LoadingPage.test.jsx":{"tests":[{"id":"330","name":"LoadingPage tests renders without crashing when lists return empty list"}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter } from \"react-router\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport LoadingPage from \"main/pages/LoadingPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { vi } from \"vitest\";\n\nconst mockNavigate = vi.fn();\nvi.mock(\"react-router\", async (importOriginal) => ({\n  ...(await importOriginal()),\n  useParams: () => ({\n    commonsId: 1,\n  }),\n  useNavigate: () => mockNavigate,\n}));\n\ndescribe(\"LoadingPage tests\", () => {\n  const queryClient = new QueryClient();\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    vi.clearAllMocks();\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  });\n\n  test(\"renders without crashing when lists return empty list\", () => {\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock.onGet(\"/api/commons/all\").reply(200, []);\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"LoadingPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const mainDiv = screen.getByTestId(\"LoadingPage-main-div\");\n    expect(mainDiv).toBeInTheDocument();\n  });\n});\n"},"src/tests/components/RosterStudent/RosterStudentCSVUploadForm.test.jsx":{"tests":[{"id":"331","name":"RosterStudentCSVUploadForm Tests Required fires when there's no input"},{"id":"332","name":"RosterStudentCSVUploadForm Tests No errors on good submit"}],"source":"import { render, fireEvent, screen } from \"@testing-library/react\";\nimport userEvent from \"@testing-library/user-event\";\nimport RosterStudentCSVUploadForm from \"main/components/RosterStudent/RosterStudentCSVUploadForm\";\nimport { vi } from \"vitest\";\n\ndescribe(\"RosterStudentCSVUploadForm Tests\", () => {\n  const mockSubmitAction = vi.fn();\n  const file = new File([\"there\"], \"roster.csv\", { type: \"text/csv\" });\n  test(\"Required fires when there's no input\", async () => {\n    render(<"+"RosterStudentCSVUploadForm />);\n    await screen.findByTestId(\"RosterStudentCSVUploadForm-submit\");\n\n    const submitButton = screen.getByTestId(\n      \"RosterStudentCSVUploadForm-submit\",\n    );\n    fireEvent.click(submitButton);\n    await screen.findByText(/Roster is required/);\n  });\n\n  test(\"No errors on good submit\", async () => {\n    const user = userEvent.setup();\n    render(<"+"RosterStudentCSVUploadForm submitAction={mockSubmitAction} />);\n    await screen.findByTestId(\"RosterStudentCSVUploadForm-submit\");\n\n    const upload = screen.getByTestId(\"RosterStudentCSVUploadForm-upload\");\n    const submitButton = screen.getByTestId(\n      \"RosterStudentCSVUploadForm-submit\",\n    );\n    await user.upload(upload, file);\n    fireEvent.click(submitButton);\n    expect(screen.queryByText(/Roster is required/)).not.toBeInTheDocument();\n\n    expect(upload.files).toHaveLength(1);\n    expect(upload.files[0]).toStrictEqual(file);\n  });\n});\n"},"src/tests/components/TabComponent/AssignmentTabComponent.test.jsx":{"tests":[{"id":"333","name":"Calls successfully"}],"source":"import axios from \"axios\";\nimport { fireEvent, render, waitFor, screen } from \"@testing-library/react\";\nimport AssignmentTabComponent from \"main/components/TabComponent/AssignmentTabComponent\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { vi } from \"vitest\";\n\nconst axiosMock = new AxiosMockAdapter(axios);\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async (importOriginal) => {\n  return {\n    ...(await importOriginal()),\n    toast: (x) => mockToast(x),\n  };\n});\ntest(\"Calls successfully\", async () => {\n  axiosMock.onPost(\"/api/repos/createRepos\").reply(200);\n  const client = new QueryClient();\n  render(\n    <"+"QueryClientProvider nt.change(screen.getByLabelText(\"Repository Prefix\"), {\n    target: { value: \"test\" },\n  });\n  fireEvent.click(screen.getByTestId(\"IndividualAssignmentForm-submit\"));\n  await waitFor(() => expect(mockSubmit).toHaveBeenCalled());\n  expect(\n    screen.queryByText(\"Repository Prefix is required.\"),\n  ).not.toBeInTheDocument();\n});\n"},"src/tests/components/Teams/TeamsCSVUploadForm.test.jsx":{"tests":[{"id":"336","name":"TeamsCSVUploadForm Tests Required fires when there's no input"},{"id":"337","name":"TeamsCSVUploadForm Tests No errors on good submit"}],"source":"import { render, fireEvent, screen } from \"@testing-library/react\";\nimport userEvent from \"@testing-library/user-event\";\nimport TeamsCSVUploadForm from \"main/components/Teams/TeamsCSVUploadForm\";\nimport { vi } from \"vitest\";\n\ndescribe(\"TeamsCSVUploadForm Tests\", () => {\n  const mockSubmitAction = vi.fn();\n  const file = new File([\"there\"], \"teams.csv\", { type: \"text/csv\" });\n  test(\"Required fires when there's no input\", async () => {\n    render(<"+"TeamsCSVUploadForm />);\n    await screen.findByTestId(\"TeamsCSVUploadForm-submit\");\n\n    const submitButton = screen.getByTestId(\"TeamsCSVUploadForm-submit\");\n    fireEvent.click(submitButton);\n    await screen.findByText(/Team CSV is required/);\n  });\n\n  test(\"No errors on good submit\", async () => {\n    const user = userEvent.setup();\n    render(<"+"TeamsCSVUploadForm submitAction={mockSubmitAction} />);\n    await screen.findByTestId(\"TeamsCSVUploadForm-submit\");\n\n    const upload = screen.getByTestId(\"TeamsCSVUploadForm-upload\");\n    const submitButton = screen.getByTestId(\"TeamsCSVUploadForm-submit\");\n    await user.upload(upload, file);\n    fireEvent.click(submitButton);\n    expect(screen.queryByText(/Team CSV is required/)).not.toBeInTheDocument();\n\n    expect(upload.files).toHaveLength(1);\n    expect(upload.files[0]).toStrictEqual(file);\n  });\n});\n"},"src/tests/utils/rosterStudentUtils.test.jsx":{"tests":[{"id":"338","name":"rosterStudentUtils onDeleteSuccess It puts the message on console.log and in a toast"},{"id":"339","name":"rosterStudentUtils cellToAxiosParamsDelete It returns the correct params"}],"source":"import {\n  onDeleteSuccess,\n  cellToAxiosParamsDelete,\n} from \"main/utils/rosterStudentUtils\";\nimport mockConsole from \"tests/testutils/mockConsole\";\nimport { vi } from \"vitest\";\n\nconst mockToast = vi.fn();\nvi.mock(\"react-toastify\", async (importOriginal) => {\n  return {\n    ...(await importOriginal()),\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"rosterStudentUtils\", () => {\n  describe(\"onDeleteSuccess\", () => {\n    test(\"It puts the message on console.log and in a toast\", () => {\n      // arrange\n      const restoreConsole = mockConsole();\n\n      // act\n      onDeleteSuccess(\"abc\");\n\n      // assert\n      expect(mockToast).toHaveBeenCalledWith(\"abc\");\n      expect(console.log).toHaveBeenCalled();\n      const message = console.log.mock.calls[0][0];\n      expect(message).toMatch(\"abc\");\n\n      restoreConsole();\n    });\n  });\n  describe(\"cellToAxiosParamsDelete\", () => {\n    test(\"It returns the correct params\", () => {\n      // arrange\n      const cell = { row: { original: { id: 2 } } };\n\n      // act\n      const result = cellToAxiosParamsDelete(cell);\n\n      // assert\n      expect(result).toEqual({\n        url: \"/api/rosterstudents/delete\",\n        method: \"DELETE\",\n        params: { id: 2 },\n      });\n    });\n  });\n});\n"},"src/tests/pages/HomePageLoggedOut.test.jsx":{"tests":[{"id":"340","name":"HomePageLoggedOut tests renders without crashing"}],"source":"import { render, screen } from \"@testing-library/react\";\nimport HomePageLoggedOut from \"main/pages/HomePageLoggedOut\";\nimport { QueryClient, QueryClientProvider } from \"@tanstack/react-query\";\nimport { MemoryRouter } from \"react-router\";\n\nimport { apiCurrentUserFixtures } from \"fi
